INSERT INTO `simple_test_paper` VALUES ('17', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1 查看无线基站信号，看是否信号不佳。如果信号不好，更换信号好的无线基站连接。\r\n2 查看系统日志，看网内是否有设备占用ip地址，导致ip地址冲突。如果有，封禁冲突mac地址。\r\n3 使用外置无线网卡连接网络看是否正常，查看是否无线网卡本身故障。', '', '12', '2016-10-25 09:45:45');
INSERT INTO `simple_test_paper` VALUES ('18', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '\r\n1.手动配置IP地址，ping网关 dns是否可以ping通，如果可以ping通检查本机dnhp client服务是否开启。如果不能ping通下面进一步排查\r\n2.检查网线，网线水晶头 网卡是否存在故障----更换其他设备，看是否可以获取地址连接网络，\r\n3.联系网络组协助查看是否dhcp地址池已满，或者mac地址被封', '', '15', '2016-10-25 09:45:45');
INSERT INTO `simple_test_paper` VALUES ('19', '请简述计算机的构成', '计算机由硬件和软件组成\r\n硬件包括控制器、运算器、存储器、输入/出设备\r\n软件包括系统软件和应用软件', '', '0', '2016-10-25 09:55:56');
