INSERT INTO `simple_test_paper` VALUES ('23', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1.无线网卡故障\r\n2.距离过远导致无线信号弱\r\n3.无线路由器负载过高\r\n4.无线频段干扰', '李华健', '15', '2016-10-25 10:06:53');
INSERT INTO `simple_test_paper` VALUES ('24', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1.检查电脑网络连接是否是自动获取\r\n2.检查DHCP服务是否开启\r\n3.检查网线是否通畅\r\n4.检查接入交换机端口是否宕机\r\n5.检查DHCP服务器是否正常', '李华健', '15', '2016-10-25 10:06:53');
