INSERT INTO `simple_test_paper` VALUES ('31', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '系统问题  网卡问题', '于振强', '4', '2016-10-25 10:30:10');
INSERT INTO `simple_test_paper` VALUES ('32', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '在电脑李手动调节ip  ', '于振强', '3', '2016-10-25 10:30:10');
INSERT INTO `simple_test_paper` VALUES ('33', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '查看电脑的无线网卡是否打开，如果只是连接无线网的端口没打开的话，一般就是F2或者是Fn+F2开启\r\n\r\n无线网。\r\n查看电脑是否支持所用无线网的BSS模式，一般的无线网有802.11n模式、802.11g模式、802.11b模式，\r\n\r\n如果你电脑事先默认设置成了只能用某一种模式的无线网，那么就进入设备管理器得改过来！\r\n如果上需一切都是好的，还是无法联网的话，那么可能就是路由器这边出了问题', '石晓君', '14', '2016-10-25 10:36:22');
INSERT INTO `simple_test_paper` VALUES ('34', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '无线路由器的连接数已达到上限。', '李小飞', '5', '2016-10-25 10:37:56');
INSERT INTO `simple_test_paper` VALUES ('35', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '方法一：手动更新DHCP租约服务器。即依次在cmd下运行“ipconfig /release”、“ipconfig /renew”.\r\n\r\n方法二：若绑定了IP和MAC，则需要先解绑。在cmd下运行命令“arp -d”，然后再重新获取IP。\r\n\r\n方法三：若主路由支持手动分配IP，则可以手动分配一个IP.', '李小飞', '14', '2016-10-25 10:37:56');
INSERT INTO `simple_test_paper` VALUES ('36', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1可能是驱动问题\r\n2可能是无线信号问题', '吴天生', '6', '2016-10-25 10:46:02');
INSERT INTO `simple_test_paper` VALUES ('37', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '设置固定IP地址\r\n改换其它未占用的IP地址', '吴天生', '7', '2016-10-25 10:46:02');
INSERT INTO `simple_test_paper` VALUES ('38', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', 'wifi环境，路由器硬件，无线网卡驱动。', '', '10', '2016-10-25 10:47:05');
INSERT INTO `simple_test_paper` VALUES ('39', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '检测网卡，检查DHCP CLIENT服务是否开启 检测IP地址是否正常。', '', '11', '2016-10-25 10:47:05');
INSERT INTO `simple_test_paper` VALUES ('40', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1.无线信号差\r\n2.使用用户过多\r\n3.带宽被占导致下载慢', '', '12', '2016-10-25 10:52:16');
INSERT INTO `simple_test_paper` VALUES ('41', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1.可能是IP地址冲突导致无法获取\r\n2.可能是交换机端口故障导致无法获取\r\n3.可能是网线通路问题导致无法获取\r\n4.可能是DHCP Client服务进程关闭导致', '', '15', '2016-10-25 10:52:16');
INSERT INTO `simple_test_paper` VALUES ('42', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '检测WIFI环境，检测网卡驱动', '阎飞', '6', '2016-10-25 10:52:35');
INSERT INTO `simple_test_paper` VALUES ('43', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '检测ip地址，设置固定IP', '阎飞', '7', '2016-10-25 10:52:35');
INSERT INTO `simple_test_paper` VALUES ('44', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1，网卡驱动故障\r\n2，无线路由器距离太远，信号不好。', '冯军', '6', '2016-10-25 11:07:43');
INSERT INTO `simple_test_paper` VALUES ('45', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1，邮件本地连接选择修复\r\n2，重新配置另一个IP地址。', '冯军', '7', '2016-10-25 11:07:43');
INSERT INTO `simple_test_paper` VALUES ('46', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1、查看无线信号是否正常\r\n2、无线网卡驱动是否安装正确', '王成亮', '6', '2016-10-25 11:14:49');
INSERT INTO `simple_test_paper` VALUES ('47', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1、进入TCP/IPv4属性之后，勾选自动获取IP以及自动获取DNS服务器地址，\r\n2、DHCP client服务项是否被禁用', '王成亮', '7', '2016-10-25 11:14:49');
INSERT INTO `simple_test_paper` VALUES ('48', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1、无线网卡驱动损坏\r\n2、无线基站信号不稳定或无线基站网络异常\r\n3、IP地址冲突\r\n4、信道干扰\r\n5、无线网卡物理损坏\r\n', '赵恒明', '15', '2016-10-25 11:16:30');
INSERT INTO `simple_test_paper` VALUES ('49', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1、封禁IP冲突\r\n2、清除DHCP地址池\r\n3、重做水晶头、更换端到端网线\r\n4、MAC是否被封禁\r\n', '赵恒明', '15', '2016-10-25 11:16:30');
INSERT INTO `simple_test_paper` VALUES ('50', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '多数出现在网卡驱动安装不正确，或是网卡自身故障', '刘刚奇', '6', '2016-10-25 11:25:36');
INSERT INTO `simple_test_paper` VALUES ('51', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '手动配置IP地址，使用ping命令检测能否ping通网关，在检测上层交换机所连接其他pc机IP地址能否，如不能ping通说明线路或交换机故障，能ping通则检查路由安全设置，前提先要单独测试该pc电脑无网卡驱动等故障', '刘刚奇', '12', '2016-10-25 11:25:36');
INSERT INTO `simple_test_paper` VALUES ('52', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1AP设备本身故障\r\n2连接人数超过最大负荷\r\n3信号传播不畅\r\n4网卡性能问题\r\n', '邹广祺', '15', '2016-10-25 11:26:03');
INSERT INTO `simple_test_paper` VALUES ('53', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1使用IPCONFIG命令\r\n2释放静电\r\n3重装网卡驱动\r\n4手动指定IP\r\n5MAC被封，解锁', '邹广祺', '15', '2016-10-25 11:26:03');
INSERT INTO `simple_test_paper` VALUES ('54', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1.无线基站信号不稳定 信号弱\r\n2.检查网络上有没有IP地址冲突\r\n3 检查无线网卡驱动，同意基站下面有没有同样的故障，是单机慢还是网络下电脑都慢\r\n4 检查电脑是否有病毒', '李志强', '15', '2016-10-25 11:28:24');
INSERT INTO `simple_test_paper` VALUES ('55', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1 检查电脑dhcp服务是否开启，配置固定ip测试\r\n2 检查电脑网卡 网线 交换机接口是否有故障\r\n3 检查dhcp地址池是否已经满了  检查该计算机mac地址是否被禁用\r\n4 看是否多台电脑无法获取地址 是否dhcp服务器故障', '李志强', '14', '2016-10-25 11:28:24');
INSERT INTO `simple_test_paper` VALUES ('56', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1、带宽受到限制\r\n2、可能局域网内有病毒\r\n3、无线网卡硬件或驱动有问题\r\n4、系统资源不足，如CPU使用率过高\r\n5、网络自身问题', '王亮', '15', '2016-10-25 11:33:00');
INSERT INTO `simple_test_paper` VALUES ('57', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1、检查是否开启dhcp服务，如果没有开启则需要开启\r\n2、设置固定IP\r\n3、重新安装网卡驱动', '王亮', '9', '2016-10-25 11:33:00');
INSERT INTO `simple_test_paper` VALUES ('58', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1，信号弱\r\n2，网卡问题\r\n3，无线设备本身出现故障\r\n4，连接人数超出设备最大人数', '刘胜彬', '15', '2016-10-25 11:42:32');
INSERT INTO `simple_test_paper` VALUES ('59', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1，电脑有静电，释放\r\n2，重新安装网卡驱动\r\n3，无固定IP，重新设置固定IP\r\n4，MAC地址被封，联系后台解锁\r\n5，使用IPCONFIG命令，重新分配地址。', '刘胜彬', '15', '2016-10-25 11:42:32');
INSERT INTO `simple_test_paper` VALUES ('60', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1：无线基站距离计算机过远信号不稳定，2：无线网卡驱动故障。', '', '7', '2016-10-25 11:42:52');
INSERT INTO `simple_test_paper` VALUES ('61', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '原因1：网卡故障，2：网线故障，3：后台地址池满.解决办法，1：更换网卡，2：更换网线，联系二线解决清理地址池。', '', '7', '2016-10-25 11:42:52');
INSERT INTO `simple_test_paper` VALUES ('62', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1 系统缓存较多\r\n2 计算机中毒，计算机配置低\r\n3 水晶头网线损坏\r\n4 交换机或集团网络故障\r\n5 AP距离远 同时使用同一个AP的人太多\r\n6 无线网卡驱动存在问题   无线网卡硬件故障\r\n7 无线网络环境不同频率无线干扰\r\n8 同一无线环境下有人下载，占用资源高\r\n9 防火墙原因 天气原因\r\n10 访问的网站存在问题\r\n', '刘佳林', '15', '2016-10-25 11:47:43');
INSERT INTO `simple_test_paper` VALUES ('63', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1 检查水晶头是否故障，重做水晶头\r\n2 交换机故障，重启交换机，联系网络组\r\n3 有线网卡故障，驱动问题，更新网卡驱动\r\n4 关闭防火墙扫描病毒\r\n5 启用网络修复检查网络配置问题\r\n6 ipconfig /release  ipconfig / renew 释放IP地址并重新续订IP地址\r\n7 固定IP地址 \r\n8 DHCP client DNS Client服务项，启用DHCP client DNS Client 服务项', '刘佳林', '15', '2016-10-25 11:47:43');
INSERT INTO `simple_test_paper` VALUES ('64', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1、无线AP设备发生故障\r\n2、电脑无线网卡本身原因导致的\r\n3、所在位置无线信号差或被遮挡导到的\r\n4、连接AP的用户过多导致的', '王杨智', '15', '2016-10-25 11:49:49');
INSERT INTO `simple_test_paper` VALUES ('65', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1、重新安装网卡驱动\r\n2、尝试手动设置IP地址\r\n3、若Mac地址被封，联系CT同事查看\r\n4、电脑关机重启，释放静电\r\n5、使用IPCONFIG/release和IPCONFIG/renew命令', '王杨智', '15', '2016-10-25 11:49:49');
INSERT INTO `simple_test_paper` VALUES ('66', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '信号弱，距离ap远，AP问题。\r\n更换无线网卡驱动\r\n\r\n清理浏览器记录\r\n\r\n重装系统问题依旧可联系硬件售后', '刘福春', '10', '2016-10-25 11:56:09');
INSERT INTO `simple_test_paper` VALUES ('67', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '更换驱动，切换工作模式\r\n\r\n重新插拔网线或更换网头\r\n\r\n释放并重新获取IP\r\n\r\n电脑安装了虚拟机，被交换机封端口\r\n\r\nMac地址被绑定\r\n\r\nDHCP Client 服务未启动\r\n\r\n电脑设置了错误的固定IP\r\n\r\n网卡硬件问题', '刘福春', '15', '2016-10-25 11:56:09');
INSERT INTO `simple_test_paper` VALUES ('68', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1.IP地址冲突\r\n2.无线路由器故障\r\n3.上游交换机故障\r\n4.中病毒', '徐甘', '12', '2016-10-25 12:04:30');
INSERT INTO `simple_test_paper` VALUES ('69', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1.IP地址被占用\r\n2.网线或水晶头损坏\r\n3.上游交换机故障\r\n4.中病毒', '徐甘', '10', '2016-10-25 12:04:30');
INSERT INTO `simple_test_paper` VALUES ('70', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1、无线网卡驱动安装的不合适，安装官方原版驱动；\r\n2、无线网卡硬件故障；\r\n3、系统问题，中病毒或恶意软件', '邱成龙', '10', '2016-10-25 12:06:05');
INSERT INTO `simple_test_paper` VALUES ('71', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1、设置自动获取ip地址，自动获取dns服务器；\r\n2、禁用启用适配器；\r\n3、重装有线网卡驱动', '邱成龙', '11', '2016-10-25 12:06:05');
INSERT INTO `simple_test_paper` VALUES ('72', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1、用户网卡性能较差或无线网卡驱动问题。\r\n2、电脑所处位置信号较差，无法稳定传输信号导致连接不稳定。\r\n3、连接同一AP的人数超过AP的最大连接数。\r\n4、AP设备出现故障。\r\n', '黄丽云', '15', '2016-10-25 12:10:14');
INSERT INTO `simple_test_paper` VALUES ('73', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1、检查是否ip出现冲突，若出现冲突重新给电脑分配ip\r\n2、使用ipconfig /renew命令重新获取DHCP分配的地址\r\n3、卸载重装网卡驱动。\r\n4、关机断电，释放电脑内的静电。\r\n5、联系网络组同事查看是否电脑MAC地址被封，进行解封MAC。\r\n', '黄丽云', '15', '2016-10-25 12:10:14');
INSERT INTO `simple_test_paper` VALUES ('74', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1，网络AP信号不稳定；2，电脑中毒；3,电脑离信号比较远；4,无线驱动不匹配；5，网卡老化；6，无线配置不完善', '王亚洲', '15', '2016-10-25 12:15:31');
INSERT INTO `simple_test_paper` VALUES ('75', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1，把固定ip改成自动获取；2.更换网线试试；3，更新驱动；4，换个网头；5，换个网口试试；6，升级网络工程师；7，联系售后工程师；', '王亚洲', '15', '2016-10-25 12:15:31');
INSERT INTO `simple_test_paper` VALUES ('76', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1.AP设备本身故障\r\n2.无限连接达到最大现在\r\n3.无线信号不好\r\n4.无线网卡质量不好', '黄龙', '14', '2016-10-25 12:23:20');
INSERT INTO `simple_test_paper` VALUES ('77', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1.使用IPCONFIG命令更新。\r\n2.重新安装网卡驱动\r\n3.释放静电\r\n4.手动设置IP地址\r\n5.有可能后台把此电脑的MAC地址封了，联系后台查看。', '黄龙', '15', '2016-10-25 12:23:20');
INSERT INTO `simple_test_paper` VALUES ('78', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '可能原因如下：\r\n无线信号弱，距离AP远。查看网卡驱动是否安装正确。掉线有可能是由于IP冲突，绑定MAC地址。\r\n', '梁飞风', '13', '2016-10-25 12:32:32');
INSERT INTO `simple_test_paper` VALUES ('79', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '先给主机释放静电，拔下电源，按住开机键3秒再松掉，连续操作7-8次后，使用ipconfig命令：\r\nCMD下首先运行 ipconfig/release，再运行ipconfig/renew。\r\n再查看网卡驱动是否安装成功。', '梁飞风', '8', '2016-10-25 12:32:32');
INSERT INTO `simple_test_paper` VALUES ('80', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1禁用网卡五到十分钟重新启用无线连接\r\n2在 运行中输入CMD，执行ipconfig/all命令，查看当前电脑IP及相关服务启用情况，\r\n3网卡驱动出现问题，此时自己的MAC地址全部为0，需要重新安装网卡驱动\r\n4线路或网卡连接问题，如果是这个问题而又未显示网络电缆已拔出，说明网线在和电脑、路由、或中间连接位置出现接触不良。\r\n5查看电脑ip地址是否为自动获取地址', '于旭', '15', '2016-10-25 12:33:49');
INSERT INTO `simple_test_paper` VALUES ('81', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1、无线网卡驱动未安装好\r\n2、无线网卡性能不佳、离信号源较远\r\n3、连接到的AP有故障\r\n4、电脑感染木马病毒', '刘东昌', '13', '2016-10-25 12:41:59');
INSERT INTO `simple_test_paper` VALUES ('82', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1、连接另外的电脑，确认是网线还是电脑故障\r\n2、网线故障可通过更换水晶头、更换交换机端口来解决，或者联系网络工程师确认交换机端口是否正常\r\n3、电脑端故障，设定固定IP：更改网卡MAC地址来确认MAC没有被封：更新网卡驱动，查杀病毒木马，使用命令更新IP：进入PE系统确认网卡是否有物理损坏', '刘东昌', '15', '2016-10-25 12:41:59');
INSERT INTO `simple_test_paper` VALUES ('83', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1，用户距离无线AP较远，信号不好\r\n2，用户无线网卡有问题需要更新驱动\r\n3，用户电脑可能中病毒\r\n4，用户系统可能有问题需要重装', '朱红波', '14', '2016-10-25 12:46:05');
INSERT INTO `simple_test_paper` VALUES ('84', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1，更换网线水晶头\r\n2，更新网卡驱动\r\n3，另一端网线端口没有插或者端口有问题需要更换端口\r\n4，用户电脑操作系统有问题需要重新安装\r\n5，用户电脑MAC被禁用，需要联系网络二线解封', '朱红波', '15', '2016-10-25 12:46:05');
INSERT INTO `simple_test_paper` VALUES ('85', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1.信号弱\r\n2.电脑携带病毒。\r\n3.用户在下载东西\r\n4.园区网络设备丢包严重。\r\n5.带宽已被占满。\r\n', '叶建龙', '15', '2016-10-25 13:13:46');
INSERT INTO `simple_test_paper` VALUES ('86', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1.禁用启用本地连接；\r\n2.修复本地连接；\r\n3.重新启动电脑；\r\n4.配置固定ip；\r\n5.查看网络设备运行状态，重新启动网络设备。', '叶建龙', '15', '2016-10-25 13:13:46');
INSERT INTO `simple_test_paper` VALUES ('87', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1.无线网络信号比较差\r\n2.无线网络连接用户过多\r\n3.用户占用带宽较高导致网速较慢', '许锋', '12', '2016-10-25 13:24:27');
INSERT INTO `simple_test_paper` VALUES ('88', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1.可能IP地址冲突\r\n2.DHCP Client服务进程未启用\r\n3.交换机端口故障\r\n4.网线或水晶头故障', '许锋', '12', '2016-10-25 13:24:27');
INSERT INTO `simple_test_paper` VALUES ('89', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1.是否离WIFI信号较远信号弱导致\r\n2.检查网卡驱动是否更新最新版本\r\n3.是否有干扰信号干扰WIFI连接', '赵明炜', '12', '2016-10-25 13:36:08');
INSERT INTO `simple_test_paper` VALUES ('90', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1.IP地址是否设置正确，不能设为自动获取\r\n2.电脑网卡驱动是否正常工作最好升级最新版本\r\n3.网络服务是否被关闭在系统服务里查看', '赵明炜', '12', '2016-10-25 13:36:08');
INSERT INTO `simple_test_paper` VALUES ('91', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '一 无线网卡硬件是否正常\r\n二 无线网卡驱动是否正常\r\n三 检查系统是否正常\r\n四 是否安装流氓软件\r\n五 检查系统是否有大量占用网速的软件和进程', '代志伟', '15', '2016-10-25 13:41:49');
INSERT INTO `simple_test_paper` VALUES ('92', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '一：更换网线、水晶头\r\n二：联系网络二线处理\r\n三：更换MAC或者设置手动IP地址\r\n四：检查计算机名\r\n五：排查是否系统原因\r\n六：有线网卡驱动与硬件是否正常\r\n七：排查是否软件原因', '代志伟', '15', '2016-10-25 13:41:49');
INSERT INTO `simple_test_paper` VALUES ('93', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', 'AP设备本身故障\r\n判断依据：整个办公室都是同一故障现象\r\n连接人数超过最大负载\r\n一般一个AP连接数在30个点以内最佳，最高不能超过50个点\r\n信号传播不畅\r\n用户所处的位置阻挡了信号的传播，如柱子或玻璃后面\r\n网卡性能\r\n个别电脑网卡性能较差，表现为其他用户都能正常连接\r\n', '王旭', '15', '2016-10-25 13:42:47');
INSERT INTO `simple_test_paper` VALUES ('94', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', 'CMD下，首先运行ipconfig /release，其次运ipconfig /renew\r\n台式机：首先关机，断开电源线，按住开机键持续3秒再松开，重复此操作7-8次；\r\n笔记本：首先关机，拔掉适配器，卸下笔记本电池，按住开机键持续3秒再松开，重复此操作7-8次。\r\n开始-运行，输入devmgmt.msc，在设备管理器找到网络适配器，在上面右击选择卸载，然后重启电脑，网卡驱动会重新加载一遍。\r\n', '王旭', '15', '2016-10-25 13:42:47');
INSERT INTO `simple_test_paper` VALUES ('95', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1.无线网卡故障。\r\n2.距离远导致信号弱。\r\n3.无线设备故障。\r\n4.无线设备与上联网络设备连接问题。\r\n', '曹磊', '15', '2016-10-25 14:00:50');
INSERT INTO `simple_test_paper` VALUES ('96', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1.手动刷新DHCP租约。\r\n2.手动输入IP地址。\r\n3.更换上联网络设备的网线接口。\r\n4.检查网线是否有故障。\r\n5.检查网卡是否有故障。', '曹磊', '15', '2016-10-25 14:00:50');
INSERT INTO `simple_test_paper` VALUES ('97', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '答：查看无线连接的网络信号，如果信号正常看看是否IP冲突，检查无线网卡驱动，以上都正常的话检查无线路由等设备是否正常。', '倪涛', '12', '2016-10-25 14:35:11');
INSERT INTO `simple_test_paper` VALUES ('98', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '答：一般为IP冲突，更换IP后查看，如果故障依然存在，检查网线水晶头，测试网线是否通畅，在检查网卡驱动，如果还不行则检查交换机端口，逐级向上排查，直到故障排除。', '倪涛', '12', '2016-10-25 14:35:11');
INSERT INTO `simple_test_paper` VALUES ('99', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1.查看是否距离WIFI热点过远信号传输差\r\n2.后台是否有P2P或其他传输数据软件进行大量上传下载\r\n3.IP是否存在冲突导致不停被挤，或者网关管理是否有速度限制以及IP地址被后台纳入黑名单没有\r\n4.检查网卡驱动安装是否正常\r\n5.检查是否达到当前网络阈值，流量吞吐过大。', '杨程钧', '15', '2016-10-25 14:39:30');
INSERT INTO `simple_test_paper` VALUES ('100', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1.检查网卡驱动安装是否正常\r\n2.输入命令ipconfig/release清空IP后再输入ipconfig/new重新分配\r\n3.安装TCP/IP协议\r\n4.检查网线是否故障是否存在IP冲突，重新手动分配IP地址\r\n5.检查相关服务是否开启：管理工具——服务——“DHCP Clinet”和“DNS Client”服务如未打开手动开启。', '杨程钧', '15', '2016-10-25 14:39:30');
INSERT INTO `simple_test_paper` VALUES ('101', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1.距离热点较远，网络不稳定。\r\n2.电脑网卡有问题。\r\n3.接入热点用户过多。', '徐德欣', '12', '2016-10-25 14:44:40');
INSERT INTO `simple_test_paper` VALUES ('102', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1.禁用网卡，重新启动。\r\n2.查看地址分配方式，在切换到指定固定ip地址或者dhcp分配。\r\n3.重新安装驱动。\r\n', '徐德欣', '10', '2016-10-25 14:44:40');
INSERT INTO `simple_test_paper` VALUES ('103', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '无线网卡故障\r\n周围有信号干扰\r\n浏览器故障', '于群杰', '8', '2016-10-25 14:51:13');
INSERT INTO `simple_test_paper` VALUES ('104', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '查看是否有固定IP如果有改为自动获取\r\n查看网卡是否有问题\r\n查看DHCPC Client服务是否开启', '于群杰', '9', '2016-10-25 14:51:13');
INSERT INTO `simple_test_paper` VALUES ('105', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1无线网卡故障\r\n2设备故障或网络故障\r\n3距离设备较远，信号不好\r\n4连接的人较多，占用资源\r\n5访问网站存在问题', '曲宗升', '15', '2016-10-25 14:58:00');
INSERT INTO `simple_test_paper` VALUES ('106', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1检查网线，水晶头是否好用；如不好用，更换网线，水晶头\r\n2检查交换机是否存在问题，重启交换机\r\n3手动固定一个IP地址\r\n4检查网卡驱动', '曲宗升', '12', '2016-10-25 14:58:00');
INSERT INTO `simple_test_paper` VALUES ('107', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1 周围无线信号差,有障碍物阻挡.2 无线网卡故障 3 电脑中病毒了  4  系统故障，可以重装系统  5 浏览器故障', '耿晓琳', '15', '2016-10-25 15:06:16');
INSERT INTO `simple_test_paper` VALUES ('108', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1.查看是否有固定IP，如果有的话将其设为自动获取解决\r\n2.禁用本地连接，再启用。\r\n3.查看DHCP服务有没有被禁止，若有的话启用。\r\n4.查看无线网卡有没有故障。', '耿晓琳', '15', '2016-10-25 15:06:16');
INSERT INTO `simple_test_paper` VALUES ('109', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1、地址冲突\r\n2、信号太弱\r\n3、网络本身就慢\r\n4、无线网卡有问题\r\n', '刘承国', '15', '2016-10-25 15:20:07');
INSERT INTO `simple_test_paper` VALUES ('110', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1、接触不良\r\n2、水晶头坏了，重做\r\n3、确定是否网线损坏，换线\r\n4、重新加载网卡驱动\r\n5、网卡坏了', '刘承国', '15', '2016-10-25 15:20:07');
INSERT INTO `simple_test_paper` VALUES ('111', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1 无线路由器有问题\r\n2 笔记本无线网卡有问题\r\n3 网络带宽不够\r\n4 连接的人过多', '刘凯', '15', '2016-10-25 15:27:30');
INSERT INTO `simple_test_paper` VALUES ('112', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1 水晶头或者网线有问题\r\n2 网卡驱动错误\r\n3 水晶头没有插到位\r\n4 网络设备有问题', '刘凯', '15', '2016-10-25 15:27:30');
INSERT INTO `simple_test_paper` VALUES ('113', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '1：无线网卡，路由故障\r\n2：离信号源过远\r\n3：带宽限制', '谢岳奇', '12', '2016-10-25 15:30:34');
INSERT INTO `simple_test_paper` VALUES ('114', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '1：网卡，水晶头，网线，网络设备端口故障\r\n2：ip，掩码，网关，DNS等地址输入不正确', '谢岳奇', '10', '2016-10-25 15:30:34');
INSERT INTO `simple_test_paper` VALUES ('115', '一台使用无线连接网络的电脑，网速很慢且经常掉线，可能的原因是：', '宽带带宽慢会影响速度。无线接收信号不好也会影响。路由器本身不好也会影响。电脑无线网卡有问题也会影响。', '刘贤辉', '12', '2016-10-25 15:40:00');
INSERT INTO `simple_test_paper` VALUES ('116', '一台使用有线连接网络的电脑，无法获取IP地址，一般的解决方法有：', '检查IP地址是否正确。网线是否插好。网络是否正常。网络设备是否正常。', '刘贤辉', '9', '2016-10-25 15:40:00');
INSERT INTO `simple_test_paper` VALUES ('247', '请说明Win7系统加入Haier-Corp的条件和过程', '11', '钟希康', '15', '2016-11-22 17:39:40');
INSERT INTO `simple_test_paper` VALUES ('248', '请说明新电脑标准化需要安装的软件和配置', '22', '钟希康', '15', '2016-11-22 17:39:40');
INSERT INTO `simple_test_paper` VALUES ('249', '请说明Win7系统加入Haier-Corp的条件和过程', '条件：无线可以正常使用，需要加域和加账号。使用过程：首先在无线网络里添加配置haier-corp，点击连接即可使用。', '王亚洲', '12', '2016-11-23 09:16:31');
INSERT INTO `simple_test_paper` VALUES ('250', '请说明新电脑标准化需要安装的软件和配置', '安装NAC，安装完后，在服务器弹框里输入10.128.4.1；安装smart-it需要把之前的版本卸载掉，然后运行192.168.100.97里的itsteup;安装dlp，需要选择所属部门的配置，填写进去，进行下一步安装即可。趋势杀毒，根据计算机的系统位数，安装即可。', '王亚洲', '15', '2016-11-23 09:16:31');
INSERT INTO `simple_test_paper` VALUES ('251', '请说明Win7系统加入Haier-Corp的条件和过程', '1 计算机已经连到海尔内网\r\n2 Computer Browser Workstation 系统服务已经启动\r\n3 计算机名称已经标准化\r\n\r\n计算机属性-高级系统设置-计算机名-更改--输入corp.haier.com  输入具有加域权限的域账号和密码', '李志强', '15', '2016-11-23 09:22:34');
INSERT INTO `simple_test_paper` VALUES ('252', '请说明新电脑标准化需要安装的软件和配置', 'Cisco NAC    DLP防泄密软件     smartit      趋势杀毒\r\n\r\n\r\nsmartit      趋势杀毒 双击安装程序 会自行安装\r\nCisco NAC 安装完成后一定要导入证书\r\n\r\nDLP防泄密软件 需要输入服务器地址 \r\n也有批处理安装 直接执行即可\r\n', '李志强', '15', '2016-11-23 09:22:34');
INSERT INTO `simple_test_paper` VALUES ('253', '请说明Win7系统加入Haier-Corp的条件和过程', '条件:确保网络正常系统正常.\r\n过程:桌面计算机图标右激属性-更改设置-更改-在域项输入corp.haier.com确定,再输入有权限维护员的账号密码.', '王兴和', '10', '2016-11-23 09:37:04');
INSERT INTO `simple_test_paper` VALUES ('254', '请说明新电脑标准化需要安装的软件和配置', '需要安装的软件:DLP、NAC、趋势、smartiT、企业邮箱、office.\r\n配置：计算机名、IP地址、资产标签。', '王兴和', '15', '2016-11-23 09:37:04');
INSERT INTO `simple_test_paper` VALUES ('255', '请说明Win7系统加入Haier-Corp的条件和过程', '使用100.97里的操作系统镜像安装完成后检查桌面标准化软件是否完整无异常，确定无异常后标准化更改计算机名，配置IP，重启后使用工程师账号加入域corp.haier.com。', '冯军', '10', '2016-11-23 09:52:17');
INSERT INTO `simple_test_paper` VALUES ('256', '请说明新电脑标准化需要安装的软件和配置', '需要安装NAC，DLP,SMARTIT，趋势。\r\n配置：系统为 XP 和 WIN7 32位', '冯军', '10', '2016-11-23 09:52:17');
INSERT INTO `simple_test_paper` VALUES ('257', '请说明Win7系统加入Haier-Corp的条件和过程', '1 电脑有网卡并且正常使用\r\n2 确认电脑是否终端标准化\r\n3点击电脑右下角的无线网络图标点击打开网络和共享中心\r\n4点击管理无线网络  手动连接无线网络添加无线网络（Haier-Corp）\r\n5完全类型选择wpa2企业加密类型aes\r\n6打开无线网络属性 安全 取消验证服务器证书 \r\n7如需更改域密码 去门户修改', '于旭', '15', '2016-11-23 09:52:37');
INSERT INTO `simple_test_paper` VALUES ('258', '请说明Win7系统加入Haier-Corp的条件和过程', '条件：内部人员需终端标准化，外部人员需安装NAC软件，系统脚本需正确配置。\r\n过程：手动搜索HAIER-CORP无线网络--手动创建配置无线网络--网络名为haier-corp，更改安全类型为WPA2-企业，加密类型选AES--选择安全选项卡，去掉验证服务器证书的对勾--身份验证方法选择安全密码EAP-MSCHAP V2--加域用户选择使用系统登录名以及密码，非加域用户不选--非加域用户需打开高级设置，在802.1x中更改指定身份验证模式为用户身份验证。', '李涛', '15', '2016-11-23 09:54:10');
INSERT INTO `simple_test_paper` VALUES ('259', '请说明新电脑标准化需要安装的软件和配置', '安装集团要求的正版操作系统，XP SP3或者WIN7企业版。安装DLP防泄密软件11.0。安装趋势杀毒软件。计算机名标准化命名，资产编号加员工工号。安装2016年10月最新下发SMARTIT软件。安装NAC软件4.7.3.2。加域海尔域corp.haier.com。', '李涛', '15', '2016-11-23 09:54:10');
INSERT INTO `simple_test_paper` VALUES ('260', '请说明Win7系统加入Haier-Corp的条件和过程', '1、确认系统是否正版。\r\n2、按要求更改计算机名\r\n3、按要求桌面标准化\r\n4、加入域\r\n5、增加管理员权限\r\n', '吴天生', '5', '2016-11-23 09:57:40');
INSERT INTO `simple_test_paper` VALUES ('261', '请说明新电脑标准化需要安装的软件和配置', '1.必须条件：①加入海尔集团域。②安装趋势杀毒软件。③安装NAC网络准入软件。④安装Smartit资产管理软件。⑤安装DLP信息防泄漏软件： ', '吴天生', '15', '2016-11-23 09:57:40');
INSERT INTO `simple_test_paper` VALUES ('262', '请说明Win7系统加入Haier-Corp的条件和过程', '1.在系统属性中确认计算机名正确及确认各服务项已开启\r\n2.在计算机名/域更改中勾选隶属于域，并填写域名：\"corp.haier.com\"，然后使用管理权限确认加入到域。', '李华健', '15', '2016-11-23 10:05:20');
INSERT INTO `simple_test_paper` VALUES ('263', '请说明新电脑标准化需要安装的软件和配置', '1.安装SmartIT（解压后双击ITSetup.exe安装）\r\n2.安装NAC（安装完成后填写服务器地址：10.128.4.1-4）\r\n3.安装趋势杀毒软件\r\n4.安装DLP防泄密软件（需填写服务器地址，安装完成后检查edpa.exe和wdp.exe进程是否正常运行）', '李华健', '15', '2016-11-23 10:05:20');
INSERT INTO `simple_test_paper` VALUES ('264', '请说明Win7系统加入Haier-Corp的条件和过程', '条件：加入海尔域\r\n过程：开启无线功能，打开网络和共享中心-管理无线网络-添加-手动创建网络配置文件-网络名：Haier-Corp 安全类型：WP2-企业-下一步-更改连接设置-安全-设置-去掉 验证服务器证书 前面的勾-确定 确定 关闭 即可', '邱成龙', '15', '2016-11-23 10:10:59');
INSERT INTO `simple_test_paper` VALUES ('265', '请说明Win7系统加入Haier-Corp的条件和过程', '答：接入条件：需要标准化，加域及安装NAC。\r\n过程：使用脚本配置，如果配置失败，手动建立建立无线连接，网络名为Haier-Corp,安全类型选WPA2-企业，加密类型选AES，然后更改Haier-Corp的设置，打开安全选项卡，去掉验证服务器证书的勾选，身份验证方法选择安全密EAP-MSCHAP v2，点配置，勾选自动使用windows登录名和密码，完成配置，连接Haier-Corp无线信号即可。', '李强', '15', '2016-11-23 10:12:01');
INSERT INTO `simple_test_paper` VALUES ('266', '请说明新电脑标准化需要安装的软件和配置', '首先确认电脑的操作系统是否可以加域，如果是XP64位，或家庭版的win7810需要先更换系统。\r\n加域前需要先更改标准计算机名，接入内网后加入corp.haier.com域，加域后将用户工号加入管理员组，重启电脑登陆用户工号,安装趋势、DLP、SmartIT、导入NAC证书、安装NAC，添加服务器主机发现地址10.128.4.1，重启电脑完成标准化。', '李强', '15', '2016-11-23 10:12:01');
INSERT INTO `simple_test_paper` VALUES ('267', '请说明Win7系统加入Haier-Corp的条件和过程', '1.系统统一安装海尔集团正版授权windows系统(windows xp sp3 /windows7_ent sp1)\r\n2.安装数据防泄漏软件DLP（11.0）；\r\n3.安装趋势网络版杀毒软件 软件版本10.6；\r\n4.安装思科网络准入系统NAC 4.7.3.2；\r\n5.标准化计算机名：资产标签（7位）+员工号（8位）；\r\n6.安装资产管理软件SmartIT 8.2.13.1225；\r\n7.加入海尔域corp.haier.com；\r\n', '石成军', '15', '2016-11-23 10:12:39');
INSERT INTO `simple_test_paper` VALUES ('268', '请说明新电脑标准化需要安装的软件和配置', '1.安装office办公软件（office2003/office2007/office2010）；\r\n2.安装邮箱系统（NOTES8.5.3basic）；\r\n3.安装即时通讯软件（RTX2010版）；\r\n4.安装PDF阅读软件（免费版adobe reader）；\r\n5.安装解压缩软件（免费版好压haozip）；\r\n6.根据用户需求，安装输入法；\r\n7.根据用户需求，安装VPN并测试可用性；\r\n8.根据用户需求，安装业务应用系统（SAP720/PLM/horis/BO/日日顺等）；\r\n', '石成军', '15', '2016-11-23 10:12:39');
INSERT INTO `simple_test_paper` VALUES ('269', '请说明Win7系统加入Haier-Corp的条件和过程', '有自己的工号，海尔在职员工，安装标准化软件，修改计算机姓名，添加域', '杨昆宇', '12', '2016-11-23 10:18:04');
INSERT INTO `simple_test_paper` VALUES ('270', '请说明新电脑标准化需要安装的软件和配置', 'dlp插件，nac客户端，SmartIT，趋势，需要2G内存', '杨昆宇', '10', '2016-11-23 10:18:04');
INSERT INTO `simple_test_paper` VALUES ('271', '请说明Win7系统加入Haier-Corp的条件和过程', '1，更改计算机名为资产编号+工号。更改静态IP。重启。\r\n2，加入corp.haier.com域。在计算机管理-组中添加用户工号，重启。\r\n3，使用工号和密码登录。安装桌面标准化软件。', '韦彬', '15', '2016-11-23 10:22:12');
INSERT INTO `simple_test_paper` VALUES ('272', '请说明新电脑标准化需要安装的软件和配置', '1.NAC\r\n2.X86\r\n3.趋势\r\n4.SmartIT', '韦彬', '10', '2016-11-23 10:22:12');
INSERT INTO `simple_test_paper` VALUES ('273', '请说明Win7系统加入Haier-Corp的条件和过程', '', '秦振新', '0', '2016-11-23 10:27:22');
INSERT INTO `simple_test_paper` VALUES ('274', '请说明新电脑标准化需要安装的软件和配置', 'win7专业版  先加域， 安装软件 杀毒软件  SAP  腾讯通  连接打印机  安装和配置Java  添加可信任站点\r\n安装正确浏览器 并测试相对应系统正常登录', '秦振新', '15', '2016-11-23 10:27:22');
INSERT INTO `simple_test_paper` VALUES ('275', '请说明Win7系统加入Haier-Corp的条件和过程', '1、个人电脑需与主管部门申请，并签订保密协议。公司电脑需跟主管部门申请。\r\n2、了解所需要加域的工号是否有加域的权限，以前是否加过域，域密码是否过期，未加过域的修改出域密码。\r\n3、计算机属性--更改设置--更改--标准化计算机名称--域文本框内输入：corp.haier.com--enter--使用管理员权限加入域网络，重启电脑。\r\n4、登Administrator账号给予所加域工号权限并安装桌面标准化软件。', '代生灿', '15', '2016-11-23 10:29:22');
INSERT INTO `simple_test_paper` VALUES ('276', '请说明新电脑标准化需要安装的软件和配置', '1、修改计算机名称为标准名称，加入域网络。\r\n2、安装NAC软件，设置服务器地址，查看登陆内网缺少的标准化软件。\r\n3、安装趋势杀毒软件。\r\n4、安装DLP防泄密软件。\r\n5、安装SMARTIT关闭USB口。', '代生灿', '15', '2016-11-23 10:29:22');
INSERT INTO `simple_test_paper` VALUES ('277', '请说明Win7系统加入Haier-Corp的条件和过程', '1.确认用户电脑操作系统为家庭版以上。\r\n2.确认用户电脑的资产编号，若无标签需要先贴一个新标签。\r\n3.将电脑进行标准化命名并重启电脑，重启后进行加域操作，将计算机加入CORP.HAIER.COM\r\n4.安装DPL、趋势、SMARTIT三款集团标准化软件。至此加域完成。', '郑勇', '15', '2016-11-23 10:33:40');
INSERT INTO `simple_test_paper` VALUES ('278', '请说明新电脑标准化需要安装的软件和配置', '1.标准化需要安装的软件有：DPL、趋势、smartit、OFFICE\r\n、压缩软件、SAP、NOTES邮箱、IAHIER、谷歌浏览器。\r\n2.需要配置的软件有IE、notes、sap、无线网络Haier-Corp。', '郑勇', '10', '2016-11-23 10:33:40');
INSERT INTO `simple_test_paper` VALUES ('279', '请说明Win7系统加入Haier-Corp的条件和过程', '答：WIN7个人版不能加域，加域需要用户提供域帐号和密码。安装NAC，DLP，SmartIT和趋势。加入HAIER域。使用域用户及密码登录系统。', '石晓君', '15', '2016-11-23 10:38:01');
INSERT INTO `simple_test_paper` VALUES ('280', '请说明新电脑标准化需要安装的软件和配置', '答：需要安装NAC，DLP，SmartIT和趋势。', '石晓君', '10', '2016-11-23 10:38:01');
INSERT INTO `simple_test_paper` VALUES ('281', '请说明Win7系统加入Haier-Corp的条件和过程', '条件：\r\n海尔资产电脑\r\n在内网使用电脑\r\n安装海尔封装的企业版系统（XP系统不再安装）\r\n\r\n过程\r\n1.根据计算机命名规范修改计算机名\r\n2.加入corp域\r\n3.登录用户的域\r\n4.执行电脑标准化操作', '姜向博', '15', '2016-11-23 10:41:50');
INSERT INTO `simple_test_paper` VALUES ('282', '请说明新电脑标准化需要安装的软件和配置', '1.NAC\r\n2.smartIT\r\n3.趋势杀毒\r\n4.DLP\r\n5.开启远程桌面\r\n', '姜向博', '12', '2016-11-23 10:41:50');
INSERT INTO `simple_test_paper` VALUES ('283', '请说明Win7系统加入Haier-Corp的条件和过程', '条件：\r\n1.保证网络畅通2.更改计算机名称为规范要求的标准名称3.确保必要的服务都已开启\r\n过程：\r\n1.修改计算机名2.由“工作组”改为“域”，并输入域名称corp.haier.com，输入加域权限3.桌面标准化（安装DLP，安装NAC，安装SmartIT，安装趋势）', '党小蒙', '15', '2016-11-23 10:42:01');
INSERT INTO `simple_test_paper` VALUES ('284', '请说明新电脑标准化需要安装的软件和配置', '1.修改计算机名2.由“工作组”改为“域”，并输入域名称corp.haier.com，输入加域权限3.桌面标准化（安装DLP，安装NAC，安装SmartIT，安装趋势）4.添加域账号（鼠标右击“我的电脑”，选择“管理”，选择“计算机管理（本地）”->“系统工具”->“本地用户和组”->“组”，再双击右边的Administrators，点击“添加”按钮，、在“输入对象名称来选择”下的输入框中输入用户的域帐号）', '党小蒙', '15', '2016-11-23 10:42:01');
INSERT INTO `simple_test_paper` VALUES ('285', '请说明Win7系统加入Haier-Corp的条件和过程', '安装dlp安装趋势杀毒安装nac安装SmartIT设置计算机名后加入corp.haier.com', '阎飞', '15', '2016-11-23 10:44:55');
INSERT INTO `simple_test_paper` VALUES ('286', '请说明新电脑标准化需要安装的软件和配置', '安装海尔正版windows系统，安装dlp安装趋势杀毒安装nac安装SmartIT设置计算机名后加入corp.haier.com', '阎飞', '10', '2016-11-23 10:44:55');
INSERT INTO `simple_test_paper` VALUES ('287', '请说明Win7系统加入Haier-Corp的条件和过程', '答：\r\n1、Win7加域的电脑都可以\r\n2、打开网络和共享中心 -->管理无线网路 -->添加-->手动创建网络配置文件-->网络名输入 Haier-Corp，安全类型 WPA2-企业，加密类型 AES -->更改连接设置-->安全-->设置-->取消\"验证服务器证书\"-->确定', '牛延群', '15', '2016-11-23 10:53:14');
INSERT INTO `simple_test_paper` VALUES ('288', '请说明新电脑标准化需要安装的软件和配置', '答：1.修改计算机名为标准命名，重启电脑\r\n2.加域\r\n3.安装DLP，根据系统安装x86/x64的软件，根据部门选择服务器地址\r\n3.安装SmarIT\r\n4.安装趋势，根据系统安装x86/x64的软件\r\n5.安装NAC，NAC对应服务器发现主机地址为\r\n10.128.4.1、10.128.4.3\r\n\r\n', '牛延群', '15', '2016-11-23 10:53:14');
INSERT INTO `simple_test_paper` VALUES ('289', '请说明Win7系统加入Haier-Corp的条件和过程', 'Win7系统加入域的条件：电脑不能装有杀毒软件，P2P下载软件，电脑命名要符合规范。\r\nWin7系统加入域的过程：首先标准化命名计算机，即资产编码+工号。然后卸载电脑上不合规范的软件，如杀毒软件、P2P下载软件等。最后分别安装DLP、NAC、SmartIT、趋势这四个加域软件，并将电脑加入域和将用户的工号加入管理员组即可。', '李小飞', '15', '2016-11-23 11:08:11');
INSERT INTO `simple_test_paper` VALUES ('290', '请说明新电脑标准化需要安装的软件和配置', '需要安装的软件有DLP、NAC、SmartIT、趋势。装完之后，需要将计算机加入corp.haier.com域，并把用户的工号加入管理员组。', '李小飞', '15', '2016-11-23 11:08:11');
INSERT INTO `simple_test_paper` VALUES ('291', '请说明Win7系统加入Haier-Corp的条件和过程', '条件：\r\n  1.内部人员，需终端标准化；外部人员：需要安装NAC。对于win7可以使用脚本进行配置。\r\n\r\nwin7接入流程：\r\n 1，终端标准化，2.粘贴资产标签，3.更改计算机名称，4.禁用其他用户和组名； 5、连接海尔内网；5.加入海尔haier-Corp即可。', '叶建龙', '15', '2016-11-23 11:13:19');
INSERT INTO `simple_test_paper` VALUES ('292', '请说明新电脑标准化需要安装的软件和配置', '1.系统统一安装海尔集团正版授权windows系统(windows xp sp3 /windows7_ent sp1)\r\n2.安装数据防泄漏软件DLP（11.0）；\r\n3.安装趋势网络版杀毒软件 软件版本10.6；\r\n4.安装思科网络准入系统NAC 4.7.3.2；\r\n5.标准化计算机名：资产标签（7位）+员工号（8位）；\r\n6.安装资产管理软件SmartIT 8.2.13.1225；\r\n7.加入海尔域corp.haier.com；\r\n', '叶建龙', '15', '2016-11-23 11:13:19');
INSERT INTO `simple_test_paper` VALUES ('293', '请说明Win7系统加入Haier-Corp的条件和过程', '在给用户加入Haier-Corp时，首先确认用户电脑是否海尔资产，然后检查是否标准化完成。确认没有问题后，打开网络共享中心，管理无线网络，添加-手动创建，网络名：Haier-Corp（注意区分大小写），安全类型：WPA2-企业。然后双击设好的Haier-Corp，安全，选择网络验证方法后面有个设置，将验证服务器取消打勾。配置完成。', '梁飞风', '15', '2016-11-23 11:15:08');
INSERT INTO `simple_test_paper` VALUES ('294', '请说明Win7系统加入Haier-Corp的条件和过程', '1电脑联网\r\n2安装dlp\r\n3启用5项必要服务\r\n4标准化命名 \r\n5加域\r\n6用户域帐号下继续安装其他标准化软件\r\n', '刘福春', '15', '2016-11-23 11:16:47');
INSERT INTO `simple_test_paper` VALUES ('295', '请说明新电脑标准化需要安装的软件和配置', '1安装系统，电脑联网\r\n2安装dlp\r\n3启用5项必要服务（Workstation、Windows Time、TCP/IP NetBIOS Helper、Server、Computer Browser）\r\n4标准化命名 （标签+工号）\r\n5加域（corp.haier.com）\r\n6用户域帐号下继续安装其他标准化软件（smartit、趋势、NAC）\r\n', '刘福春', '15', '2016-11-23 11:16:47');
INSERT INTO `simple_test_paper` VALUES ('296', '请说明Win7系统加入Haier-Corp的条件和过程', '1.连接海尔内网\r\n2.加入海尔域corp.haier.com\r\n3.安装数据防泄漏软件DLP\r\n4.安装趋势网络版杀毒软件\r\n5.安装思科网络准入系统NAC\r\n6.安装资产管理软件SmartIT', '张志亚', '15', '2016-11-23 11:21:09');
INSERT INTO `simple_test_paper` VALUES ('297', '请说明Win7系统加入Haier-Corp的条件和过程', '真确接入网络，IP准确标准，计算机名准确且与用户工号关联，安装上网许可软件  安装操作系统-标准化计算机名称-标准化IP地址，确保无重名和冲突问题，安装NAC上网许可软件包，加入对应域!', '刘刚奇', '15', '2016-11-23 11:23:01');
INSERT INTO `simple_test_paper` VALUES ('298', '请说明新电脑标准化需要安装的软件和配置', '安装NAC 趋势防毒 SmartIT8.2 DLP 输入法 FDP阅览器 解压工具 Lotus Notes及目标用户ID邮箱配置 办公软件打印机驱动及打印机ip配置  其他需求软件根据不同用户需求进行安装', '刘刚奇', '15', '2016-11-23 11:23:01');
INSERT INTO `simple_test_paper` VALUES ('299', '请说明新电脑标准化需要安装的软件和配置', '1、更该机器名并入域。\r\n2、添加用户到管理员权限。\r\n3、安装NAC；安装完成后，添加NAC的服务器地址，10.128.4.1或者10.128.4.3；在组策略里面勾选Kerberos加密。\r\n4、安装SmartIt软件。\r\n5、安装DLP软件；安装过程中会提示输入服务器地址，根据部门选择相应的服务器地址。\r\n6、安装趋势杀毒软件。\r\n7、安装并配置Lotus邮箱。\r\n8、安装iHaier、sap、腾讯通等软件。\r\n9、配置无线网络\r\n', '李扬', '15', '2016-11-23 11:31:23');
INSERT INTO `simple_test_paper` VALUES ('300', '请说明新电脑标准化需要安装的软件和配置', '	系统统一安装海尔集团正版授权windows系统(windows xp sp3 /windows7_ent sp1)\r\n	安装数据防泄漏软件DLP（11.0）；\r\n	安装趋势网络版杀毒软件 软件版本10.6；\r\n	安装思科网络准入系统NAC4.7.3.2；\r\n	标准化计算机名：资产标签（7位）+员工号（8位）；\r\n          安装资产管理软件SmartIT 8.2.13.1225；\r\n	加入海尔域corp.haier.com；\r\n', '贾鑫龙', '15', '2016-11-23 11:32:41');
INSERT INTO `simple_test_paper` VALUES ('301', '请说明Win7系统加入Haier-Corp的条件和过程', '条件：\r\n1、非集团资产计算机操作系统需是正版系统，且无集团黑名单软件（部分有版权授权文件除外。）\r\n2、非集团资产需用户联系接口人签字确认可接入海尔网络\r\n3、计算机是否能正常开机\r\n\r\n加域过程\r\n1、粘贴资产标贴\r\n2、标准化计算机名称\r\n3、加入域 corp.haier.com\r\n4、登记资产台账', '赵恒明', '5', '2016-11-23 11:46:52');
INSERT INTO `simple_test_paper` VALUES ('302', '请说明新电脑标准化需要安装的软件和配置', '需要安装的软件\r\n1、DLP\r\n2、smartit\r\n3、趋势杀毒网络版\r\n4、NAC\r\n需要的配', '赵恒明', '12', '2016-11-23 11:46:52');
INSERT INTO `simple_test_paper` VALUES ('303', '请说明Win7系统加入Haier-Corp的条件和过程', '条件：win7系统不能为家庭版，专业版、旗舰版均可以\r\n过程：首先确认网络是否连通，然后修改计算机名，修改完成后在更改设置界面点击更改选择域键入corp.haier.com，管理员账户验证后重启，在管理界面选择组添加用户账户，管理员验证重启。完成加入海尔域', '孟世超', '15', '2016-11-23 11:53:31');
INSERT INTO `simple_test_paper` VALUES ('304', '请说明新电脑标准化需要安装的软件和配置', '需要安装的软件DLP、smart、趋势、NAC\r\nDLP配置：dlpwulumuqigm.haier.me\r\nsmartIT无需配置\r\n趋势无需配置\r\nNAC配置：10.128.4.1 或 10.128.4.3', '孟世超', '15', '2016-11-23 11:53:31');
INSERT INTO `simple_test_paper` VALUES ('305', '请说明Win7系统加入Haier-Corp的条件和过程', '1.系统统一安装海尔集团正版授权windows系统(windows xp sp3 /windows7企业版)\r\n2.安装数据防泄漏软件DLP\r\n3.安装趋势网络版杀毒软件\r\n4.安装思科网络准入系统NAC4.7\r\n5.标准化计算机名：资产标签（7位）+员工号（8位）\r\n6.安装资产管理软件SmartIT\r\n7.加入海尔域corp.haier.com\r\n', '刘胜彬', '15', '2016-11-23 11:55:48');
INSERT INTO `simple_test_paper` VALUES ('306', '请说明Win7系统加入Haier-Corp的条件和过程', '答：系统版本为32位或64位专业版，系统里不存在360及其他杀毒软件。首先修改计算机名为集团要求的标准计算机名，然后在计算机右键属性-计算机名，域及工作组设置里把此计算机添加到Haier-Corp里。', '孙宏宇', '15', '2016-11-23 11:57:42');
INSERT INTO `simple_test_paper` VALUES ('307', '请说明新电脑标准化需要安装的软件和配置', '答：新电脑标准化需安装趋势杀毒软件，SmartIT软件，DLP软件，NAC网络准入软件。以及用户需要的日常办公软件如notes邮箱，打印机驱动，office办公软件等。', '孙宏宇', '15', '2016-11-23 11:57:42');
INSERT INTO `simple_test_paper` VALUES ('308', '请说明Win7系统加入Haier-Corp的条件和过程', '条件：win7系统不能是家庭版，专业版、旗舰版均可以\r\n过程：更改计算机名，更改计算机设置里更改域键入crop.haier.com，管理员站好验证重启，添加用户账号完成', '孟世超', '15', '2016-11-23 11:59:45');
INSERT INTO `simple_test_paper` VALUES ('309', '请说明新电脑标准化需要安装的软件和配置', '需要安装的软件：DLP、smart、趋势、NAC\r\nDLP配置：dlpwulumuqigm.haier.me\r\nsmart和趋势不用配置\r\nNAC:10.128.4.1或10.128.4.3', '孟世超', '15', '2016-11-23 11:59:45');
INSERT INTO `simple_test_paper` VALUES ('310', '请说明Win7系统加入Haier-Corp的条件和过程', '用鼠标右击我的电脑点属性进入系统点更改设置把工作组改为HAIER把域改为coep.haier.com', '于振强', '10', '2016-11-23 12:16:43');
INSERT INTO `simple_test_paper` VALUES ('311', '请说明新电脑标准化需要安装的软件和配置', '需要安装sap notes SmartIT8.2 全时云 日日顺 ', '于振强', '5', '2016-11-23 12:16:43');
INSERT INTO `simple_test_paper` VALUES ('312', '请说明Win7系统加入Haier-Corp的条件和过程', '1.系统统一安装海尔集团正版授权windows系统(windows xp sp3 /windows7_ent sp1)\r\n2.标准化计算机名：资产标签（7位）+员工号（8位）；\r\n3.安装数据防泄漏软件DLP（11.0）；\r\n4.安装趋势网络版杀毒软件 软件版本10.6；\r\n5.安装思科网络准入系统NAC4.7.3.2；\r\n6.安装资产管理软件SmartIT 8.2.13.12257；\r\n7.加入海尔域corp.haier.com。', '揭志鹏', '15', '2016-11-23 12:38:48');
INSERT INTO `simple_test_paper` VALUES ('313', '请说明新电脑标准化需要安装的软件和配置', '安装海尔集团正版授权windows系统\r\n安装数据防泄漏软件DLP（11.0）\r\n安装趋势杀毒软件\r\n安装NAC\r\n标准化计算机名：资产标签（7位）+员工号（8位）\r\n安装资产管理软件SmartIT\r\n加入海尔域corp.haier.com\r\n', '李军帅', '15', '2016-11-23 12:41:59');
INSERT INTO `simple_test_paper` VALUES ('314', '请说明新电脑标准化需要安装的软件和配置', '答：新电脑标准化需要安装Cisco Nac,DLP，趋势，SmartIT。NAC安装完毕后，需要在右键属性中，输入主机地址：10.128.4.1，如果是Win7系统安装NAC，需要在组策略中,Windows设置-安全设置-本地策略-安全选项-配置 Kerberos 允许的加密类型中，将所有选项勾选。', '曹磊', '15', '2016-11-23 12:45:40');
INSERT INTO `simple_test_paper` VALUES ('315', '请说明Win7系统加入Haier-Corp的条件和过程', '条件：属于海尔内网工作电脑\r\n过程：右键计算机属性-更改设置-更改计算机名-将计算机名改为用户资产信息并加入corp.haier.com域-输入管理员账号密码进行验证-确认重启电脑完成加域-用户使用工号进行登录', '许锋', '15', '2016-11-23 12:48:08');
INSERT INTO `simple_test_paper` VALUES ('316', '请说明新电脑标准化需要安装的软件和配置', '安装DLP，PLM，趋势杀毒软件，NAC，SmartIT，同时安装notes邮箱，确认进程及服务开启', '许锋', '12', '2016-11-23 12:48:08');
INSERT INTO `simple_test_paper` VALUES ('317', '请说明Win7系统加入Haier-Corp的条件和过程', '条件：\r\n1 电脑加域标准化\r\n2配置Haier-Corp\r\n3使用用户账号登陆计算机\r\n过程：\r\n1添加无线网络ssid。\r\n2安全类型wap2-企业\r\n3取消验证服务器证书\r\n4选择用户身份验证模式\r\n', '刘佳林', '15', '2016-11-23 13:20:12');
INSERT INTO `simple_test_paper` VALUES ('318', '请说明新电脑标准化需要安装的软件和配置', '标准化软件:dlp  smart-it  nac  趋势\r\n配置：1安装系统，电脑联网\r\n4标准化命名（标签+工号）\r\n5加域（corp.haier.com）\r\n', '刘佳林', '15', '2016-11-23 13:20:12');
INSERT INTO `simple_test_paper` VALUES ('319', '请说明Win7系统加入Haier-Corp的条件和过程', '（内部人员）需要终端标准化（笔记本加域、安装NAC），如不符合连接条件请拨打电话 1000，进行处理；\r\n（外部人员）需要安装nac，如不符合连接条件请拨打电话 1000，进行处理；\r\n对于windows7、windows 8可以使用脚本进行配置，\r\n\r\n或手动连接到无线网络，\r\n设置无线属性种的相关选项\r\n输入域帐号和密码，', '孟祥来', '15', '2016-11-23 13:20:58');
INSERT INTO `simple_test_paper` VALUES ('320', '请说明新电脑标准化需要安装的软件和配置', '1.	安装数据防泄漏软件DLP（11.0）；\r\n2.	安装趋势网络版杀毒软件 软件版本10.6；\r\n3.	安装思科网络准入系统NAC4.7.3.2；\r\n4.	安装资产管理软件SmartIT 8.2.13.1225；\r\n5.      配置NAC,加入corp.haier.com', '孟祥来', '15', '2016-11-23 13:20:58');
INSERT INTO `simple_test_paper` VALUES ('321', '请说明新电脑标准化需要安装的软件和配置', 'DLP SmartIT 趋势  网络准入NAC\r\nNAC对应服务器发现主机地址\r\n10.128.4.1、10.128.4.3\r\nSmart IT 安装最新版\r\n', '代志伟', '10', '2016-11-23 13:23:06');
INSERT INTO `simple_test_paper` VALUES ('322', '请说明Win7系统加入Haier-Corp的条件和过程', 'win7版本要求，除去win7家庭版。\r\n修改计算机名称-安装加域软件-趋势-DLP-NAC并设置服务器-SmartIT-设置IP地址-重启电脑-加入海尔域-重启-用户登录。', '王旭', '15', '2016-11-23 13:28:28');
INSERT INTO `simple_test_paper` VALUES ('323', '请说明新电脑标准化需要安装的软件和配置', '修改计算机名称-安装加域软件-趋势-DLP-NAC并设置服务器-SmartIT-设置IP地址-重启电脑-加入海尔域-重启-用户登录-安装打印机-安装office办公软件-安装邮箱客户端-安装用户需要用的其它软件（sap,pdf等）', '王旭', '15', '2016-11-23 13:28:28');
INSERT INTO `simple_test_paper` VALUES ('324', '请说明Win7系统加入Haier-Corp的条件和过程', 'win7系统除家庭版以外的版本\r\n修改计算机名称-安装加域软件-趋势-DLP-NAC并设置服务器-SmartIT-设置IP地址-重启电脑-加入海尔域-重启-用户登录。', '王旭', '15', '2016-11-23 13:33:15');
INSERT INTO `simple_test_paper` VALUES ('325', '请说明新电脑标准化需要安装的软件和配置', '修改计算机名称-安装加域软件-趋势-DLP-NAC并设置服务器-SmartIT-设置IP地址-重启电脑-加入海尔域-重启-用户登录-安装打印机-安装常用办公软件-修改浏览器设置', '王旭', '15', '2016-11-23 13:33:15');
INSERT INTO `simple_test_paper` VALUES ('326', '请说明Win7系统加入Haier-Corp的条件和过程', '首先更改用户计算机用户名，使用规范的用户名。\r\n安装好规定必备软件后确认未安装黑名单内的软件\r\n点击依次点击：桌面——“计算机”右键——属性——中“计算机名称域和工作组设置”点击更改设置——再次确认计算机名规范后在隶属于选项中从“工作组”WORKGROUP改为“域”corp.haier.com后点击确定——根据提示填入用户所申请的工号和密码或者输入管理员工号或密码带用户入域——依照提示重启即可。', '杨程钧', '15', '2016-11-23 13:51:05');
INSERT INTO `simple_test_paper` VALUES ('327', '请说明新电脑标准化需要安装的软件和配置', '安装趋势杀毒\r\n    smartIT\r\n    加域\r\n严禁安装黑名单内软件', '杨程钧', '10', '2016-11-23 13:51:05');
INSERT INTO `simple_test_paper` VALUES ('328', '请说明新电脑标准化需要安装的软件和配置', '安装dlp：服务器地址：dlpbeijinggm.haier.me\r\n安装nac：服务器地址：10.128.4.1，再导入nac证书\r\n安装趋势杀毒软件；\r\n安装smartIT\r\n重启电脑；\r\n重启电脑，用域账号登录电脑\r\n安装常用的一些软件..........', '蒋军陶', '15', '2016-11-23 14:06:55');
INSERT INTO `simple_test_paper` VALUES ('329', '请说明新电脑标准化需要安装的软件和配置', '安装dlp：服务器地址：dlpbeijinggm.haier.me\r\n安装nac：服务器地址：10.128.4.1，再导入nac证书\r\n安装趋势杀毒软件；\r\n安装smartIT\r\n重启电脑；\r\n重启电脑，用域账号登录电脑\r\n安装常用的一些软件..........', '蒋军陶', '15', '2016-11-23 14:07:05');
INSERT INTO `simple_test_paper` VALUES ('330', '请说明新电脑标准化需要安装的软件和配置', '安装dlp\r\n安装nac\r\n安装趋势杀毒软件；\r\n安装smartIT\r\n重启电脑；\r\n重启电脑，用域账号登录电脑\r\n安装输入法，浏览器，OFFICE软件等常用办公及使用软件.', '郭旭', '15', '2016-11-23 14:14:26');
INSERT INTO `simple_test_paper` VALUES ('331', '请说明新电脑标准化需要安装的软件和配置', '答：1.IP地址 2.加入海尔域 3.重启用域权限进入系统后，依次安装DLP，SmartIT客户端，趋势杀毒软件. 4.根据用户需求配置IE设置，安装office,notes邮箱,Ihaier,SAP,等办公软件。5.配置公用打印机等必要外设。', '刘栋', '15', '2016-11-23 14:29:01');
INSERT INTO `simple_test_paper` VALUES ('332', '请说明Win7系统加入Haier-Corp的条件和过程', '首先确认资产是否属于海尔集团所有，操作系统是否安装的是海尔正版授权系统。确认完毕进行桌面标准化操作：\r\n1. 安装DLP防泄密软件\r\n2. 安装趋势杀毒软件\r\n3. 安装思科网络准入系统NAC\r\n4. 标准化计算机名：资产标号+用户8位员工号\r\n5. 安装资产管理软件SmartIT\r\n6. 加入海尔域 corp.haier.com', '黄龙', '15', '2016-11-23 14:30:40');
INSERT INTO `simple_test_paper` VALUES ('333', '请说明Win7系统加入Haier-Corp的条件和过程', '1我的电脑又键属性计算机名改为七位的资产编号+八位的员工号字母（A和Z）大写\r\n2工作组改为域(CORP.HAIER.COM)不分大小写\r\n3输入用户名和密码\r\n4单机开始——程序——管理工具——本地安全策略——允许本地用户登录\r\n5把用户的账号和密码加入到组里面\r\n', '刘凯', '15', '2016-11-23 14:33:27');
INSERT INTO `simple_test_paper` VALUES ('334', '请说明新电脑标准化需要安装的软件和配置', 'Office办公软件  腾讯通RTX  SAP\r\n邮箱软件NOTES 8.5的版本  PDF阅读软件  \r\n安装解压软件（WinRAR) \r\n根据用户的需求安装输入法和内网的其他软件', '刘凯', '15', '2016-11-23 14:33:27');
INSERT INTO `simple_test_paper` VALUES ('335', '请说明Win7系统加入Haier-Corp的条件和过程', '安装集团的企业版win7，然后更改计算机名资产编号+员工号，确保网络通畅，确保必要的服务已经开启computer browser、server、TCP/IP NetBios Helper、windows time、workstation依次安装dlp、趋势杀毒、nac和smart IT后加入海尔域', '刘寅', '15', '2016-11-23 14:39:12');
INSERT INTO `simple_test_paper` VALUES ('336', '请说明新电脑标准化需要安装的软件和配置', '1.更改计算机名称标准化计算机名 ：资产编号+员工号\r\n2.安装dlp11.0\r\n3.安装趋势杀毒\r\n4.安装nac 4.7.3.2\r\n5.安装Smart IT 8.2.13.1225\r\nps：现用系统为win7 企业版 x86或者x64', '刘寅', '15', '2016-11-23 14:39:12');
INSERT INTO `simple_test_paper` VALUES ('337', '请说明Win7系统加入Haier-Corp的条件和过程', '条件：安装好dlp、趋势、nac、smartit、更改计算机名等标准化操作后再进行加域\r\n过程：１域名CORP.HAIER.COM　２加域账号密码登录３添加权限\r\n\r\n', '刘承国', '15', '2016-11-23 14:40:56');
INSERT INTO `simple_test_paper` VALUES ('338', '请说明新电脑标准化需要安装的软件和配置', '1.安装dlp、趋势、nac、smartit,加域，计算机名标准化\r\n2.office、rtx、输入法、解压、pdf阅读器、sap、收藏夹、把*.haier.com和haier.net加入信任站点，把IE安全级别最低\r\n\r\n\r\n\r\n', '刘承国', '15', '2016-11-23 14:40:56');
INSERT INTO `simple_test_paper` VALUES ('339', '请说明新电脑标准化需要安装的软件和配置', '1.系统统一安装海尔集团正版授权windows系统(windows xp sp3 /windows7_ent sp1)\r\n2.安装数据防泄漏软件DLP（11.0）；\r\n3.安装趋势网络版杀毒软件 软件版本10.6；\r\n4.安装思科网络准入系统NAC 4.7.3.2；\r\n5安装资产管理软件SmartIT 8.2.13.1225；\r\n', '蔡逢阳', '15', '2016-11-23 14:52:57');
INSERT INTO `simple_test_paper` VALUES ('340', '请说明Win7系统加入Haier-Corp的条件和过程', '条件：正版海尔WIN7系统，正常连接海尔内部网络。\r\n过程：正常连接海尔内部网络，右键计算机点击属性，点击更改设置里面更改其域或者工作组点击更改，在隶属于里面选择“域”输入“corp.haier.com\"，在使用正确的海尔域内管理员账号和密码，确认加入到Haier-Corp即可。', '李冬冬', '15', '2016-11-23 14:58:28');
INSERT INTO `simple_test_paper` VALUES ('341', '请说明新电脑标准化需要安装的软件和配置', '新到电脑标准化：更改自己区域正确的计算机名称（资产标签+保管人员工号）然后加入haier-Corp,其次在安装海尔标准化软件，安装正确的DLP、安装趋势杀毒软件、安装NAC（需配置NAC对应服务器发现主机地址10.128.4.1、10.128.4.3,在把NAC安装证书添加到可信任）在安装SmartIT客户端，确认正常安装之后查看NAC是否正常验证通过，通过即可，不通过可以查看NAC报错提示在进行相对的标准化软件安装。', '李冬冬', '15', '2016-11-23 14:58:28');
INSERT INTO `simple_test_paper` VALUES ('342', '请说明Win7系统加入Haier-Corp的条件和过程', '在我的电脑上单击右键选属性在选计算机名在更改。更改计算机名后和后缀名在将隶属于由工作组改为域并输入域名称corp.haier.com然后点确定在输入密码在重启电脑后把用户名和密码添加进去。', '刘贤辉', '15', '2016-11-23 15:00:15');
INSERT INTO `simple_test_paper` VALUES ('343', '请说明新电脑标准化需要安装的软件和配置', '杀毒软件  办公自动化软件  解压缩软件  PDF软件\r\n\r\nIE浏览器   公司内部软件', '刘贤辉', '8', '2016-11-23 15:00:15');
INSERT INTO `simple_test_paper` VALUES ('344', '请说明Win7系统加入Haier-Corp的条件和过程', '条件：计算机系统为windows xp sp3 /windows7_ent sp1  并完全安装好标准化软件\r\n过程：计算机属性-计算名称/域设置 更改计算机名资产标签（7位）+员工号（8位）更改为隶属于corp.haier.com域即可', '谢岳奇', '15', '2016-11-23 15:23:52');
INSERT INTO `simple_test_paper` VALUES ('345', '请说明新电脑标准化需要安装的软件和配置', '软件：\r\n1.数据防泄漏软件DLP\r\n2.趋势网络版杀毒软件\r\n3.思科网络准入系统NAC\r\n4.资产管理软件SmartIT\r\n\r\n配置：\r\n不知道', '谢岳奇', '12', '2016-11-23 15:23:52');
INSERT INTO `simple_test_paper` VALUES ('346', '请说明Win7系统加入Haier-Corp的条件和过程', '条件：win7系统非HOME版  可以连接海尔网络\r\n过程：\r\n1.	安装数据防泄漏软件DLP（11.0）；\r\n2.	安装趋势网络版杀毒软件 软件版本10.6；\r\n3.	安装思科网络准入系统NAC 4.7.3.2；\r\n4.	标准化计算机名：资产标签（7位）+员工号（8位）；\r\n5.	安装资产管理软件SmartIT 8.2.13.1225；\r\n6.	加入海尔域corp.haier.com；\r\n注意：必须先标准化计算机命名后再安装SmartIT\r\n\r\n', '孟祥山', '15', '2016-11-23 15:24:39');
INSERT INTO `simple_test_paper` VALUES ('347', '请说明Win7系统加入Haier-Corp的条件和过程', '条件要求：\r\n电脑内存配置要2G硬盘大小要够用\r\n1.安装防泄漏软件DLP\r\n2.安装趋势杀毒软件 \r\n3.安装统NAC\r\n4.正确标准化计算机名\r\n5.安装软件SmartIT\r\n6.加域corp.haier.com\r\n', '郝丙伟', '15', '2016-11-23 15:31:38');
INSERT INTO `simple_test_paper` VALUES ('348', '请说明Win7系统加入Haier-Corp的条件和过程', '属于集团电脑规范命名电脑名称 资产标签+工号，在电脑属性点击计算机名称、域和工作组设置 项更改设置，选择计算机名/域更改在，隶属于输入corp.haier.com 之后输入有权限的域管理员账号完成加域', '赵明炜', '15', '2016-11-23 15:45:45');
INSERT INTO `simple_test_paper` VALUES ('349', '请说明新电脑标准化需要安装的软件和配置', '规范计算机名称，加域，配置IP地址。安装Lotus邮箱和SAP趋势杀毒软件和office、SmartIT、ihaier', '赵明炜', '15', '2016-11-23 15:45:45');
INSERT INTO `simple_test_paper` VALUES ('350', '请说明Win7系统加入Haier-Corp的条件和过程', '集团计算机，命名规范在计算机更改名称中选择域输入corp.haier.com 输入与管理员账号加域', '徐甘', '12', '2016-11-23 15:54:59');
INSERT INTO `simple_test_paper` VALUES ('351', '请说明新电脑标准化需要安装的软件和配置', 'office、SmartIT、趋势杀毒软件、SAP、Lotus邮箱、ihaier、配置IP 计算机名称加域', '徐甘', '12', '2016-11-23 15:54:59');
INSERT INTO `simple_test_paper` VALUES ('352', '请说明Win7系统加入Haier-Corp的条件和过程', '步骤1.计算机本地重新命名，严格按照地区+部门+资产编号\r\n步骤2.重启计算机\r\n步骤3.加域工具加域，严格按照地区+部门+资产编号\r\n', '张天星', '12', '2016-11-23 16:00:20');
INSERT INTO `simple_test_paper` VALUES ('353', '请说明Win7系统加入Haier-Corp的条件和过程', '进行桌面标准化，之后右击我的电脑在计算机名称，域和工作组名称项下点击更改设置，之后将计算机描述更改为主机资产编码+用户员工编号，之后在更改域和用户组处点击更改将域名设定为corp.haier.com,之后输入工程师的员工号和密码后，将用户的域账号添加至计算机的管理员组中，最后重启电脑完成操作', '周宇翔', '15', '2016-11-23 16:08:43');
INSERT INTO `simple_test_paper` VALUES ('354', '请说明新电脑标准化需要安装的软件和配置', 'DLP,趋势杀毒软件,SMART IT,CISO NAC', '周宇翔', '12', '2016-11-23 16:08:43');
INSERT INTO `simple_test_paper` VALUES ('355', '请说明新电脑标准化需要安装的软件和配置', '规范化计算机命名,安装nac dlp 趋势 smartIT标准软件,贴上资产标签,加入海尔域corp.haier.com', '赵伟贺', '15', '2016-11-23 16:12:50');
INSERT INTO `simple_test_paper` VALUES ('356', '请说明Win7系统加入Haier-Corp的条件和过程', '条件：海尔内部员工标准化端口  外部安装NAA\r\n过程：打开网络共享中心-管理无线网络-创建网络配置文件-网络名haier-corp-安全级别wpa2-加密类型AES-添加成功-更改安全设置 。非加域用户选择haier-corp无线网络属性-高级设置-802.1x-用户验证-确定-用域账号和密码登陆', '高雄雄', '15', '2016-11-23 16:16:28');
INSERT INTO `simple_test_paper` VALUES ('357', '请说明新电脑标准化需要安装的软件和配置', '1.安装海尔正版授权windows系统 安装DLP数据防泄漏软件 安装趋势下毒软件 安装NAC 计算机名标准化 安装SmartIT  加入海尔域 \r\n2.调试分辨率 确定有线网络正常连接 调试系统UAC级别 设置网络安全 安装NAC证书 安装打印机 替换 host文件 根据客户要求安装其他办公软件。', '高雄雄', '15', '2016-11-23 16:16:28');
INSERT INTO `simple_test_paper` VALUES ('358', '请说明Win7系统加入Haier-Corp的条件和过程', '保证网络畅通\r\n更改计算机名称为规范要求的标准名称。	\r\n确保必要的服务都已开启，如：Server、TCP/IP NetBIOS Helper、Workstation。\r\n使用加域工具进行加域操作。', '邱冠桦', '15', '2016-11-23 16:17:51');
INSERT INTO `simple_test_paper` VALUES ('359', '请说明新电脑标准化需要安装的软件和配置', '加域；\r\n安装DLP；notes邮箱；smatrlIT；\r\n配置趋势', '邱冠桦', '12', '2016-11-23 16:17:51');
INSERT INTO `simple_test_paper` VALUES ('360', '请说明Win7系统加入Haier-Corp的条件和过程', '条件是集团电脑或者有备案申请的私人电脑 win7不能是家庭版 加域前要按要求先做好标准化再加域', '毕凡', '5', '2016-11-23 16:25:47');
INSERT INTO `simple_test_paper` VALUES ('361', '请说明新电脑标准化需要安装的软件和配置', '新电脑需要安装最新的dlp SmartIT客户端 趋势杀毒 nac 加入海尔域', '毕凡', '12', '2016-11-23 16:25:47');
INSERT INTO `simple_test_paper` VALUES ('362', '请说明Win7系统加入Haier-Corp的条件和过程', '条件：\r\n1 电脑加域标准化\r\n2配置Haier-Corp\r\n3使用用户账号登陆计算机\r\n过程：\r\n1添加无线网络ssid。\r\n2安全类型wap2-企业\r\n3取消验证服务器证书\r\n4选择用户身份验证模式\r\n  备注：\\192.168.100.97服务器共享文件办公和数据库系统常用中有', '曲开浩', '15', '2016-11-23 16:50:14');
INSERT INTO `simple_test_paper` VALUES ('363', '请说明新电脑标准化需要安装的软件和配置', '标准化软件:dlp  smart-it  nac  趋势\r\n配置：1安装系统，电脑联网\r\n4标准化命名（标签+工号）\r\n5加域（corp.haier.com）\r\n\r\n', '曲开浩', '15', '2016-11-23 16:50:14');
