INSERT INTO `simple_test_paper` VALUES ('366', '请说明Win7系统加入Haier-Corp的条件和过程', '条件：\r\n1 电脑加域标准化\r\n2配置Haier-Corp\r\n3使用用户账号登陆计算机\r\n过程：\r\n1添加无线网络ssid。\r\n2安全类型wap2-企业\r\n3取消验证服务器证书\r\n4选择用户身份验证模式\r\n', '曲宗升', '15', '2016-11-23 17:07:01');
INSERT INTO `simple_test_paper` VALUES ('367', '请说明新电脑标准化需要安装的软件和配置', '联网，标准化，加域，计算机命名', '曲宗升', '10', '2016-11-23 17:07:01');
INSERT INTO `simple_test_paper` VALUES ('368', '请说明Win7系统加入Haier-Corp的条件和过程', '用户电脑标准化后，员工工号下。手动添加无线Haier-Corp，选择WPA2-企业，配置无线安全设置，取消验证服务器证书。', '徐德欣', '15', '2016-11-23 17:38:23');
INSERT INTO `simple_test_paper` VALUES ('369', '请说明新电脑标准化需要安装的软件和配置', 'dlp，趋势，nac，smart it。\r\ndlp-程序分为32位和64位操作系统，安装前查看操作系统详细信息，进入x64/x86，双击AgentInstall.msi，一直下一步，直到需要填写ENDPOINT SERVER的一步，将其个人所安装区域的域名填写上，确认安装是否成功，在进程里面查看有没有edpa.exe和wdp.exe进程。\r\n趋势杀毒，对应系统安装双击\r\nnac，直接安装，安装证书到物理信任。\r\nsmartit，双击ITSetup.exe', '徐德欣', '15', '2016-11-23 17:38:23');
INSERT INTO `simple_test_paper` VALUES ('370', '请说明Win7系统加入Haier-Corp的条件和过程', 'WIN7加入需要加域并进行标准化。\r\n\r\n\r\n过程：点击右下角无线图标，然后打开网络和共享中心里面的管理无线网络进行添加。', '李可湘', '10', '2016-11-23 17:53:25');
INSERT INTO `simple_test_paper` VALUES ('371', '请说明新电脑标准化需要安装的软件和配置', '需要安装的软件有DLP,NAC,趋势,SmartIT。\r\n\r\n\r\n需要的配置为系统需要企业版以上的32位系统', '李可湘', '15', '2016-11-23 17:53:25');
INSERT INTO `simple_test_paper` VALUES ('372', '请说明Win7系统加入Haier-Corp的条件和过程', '', '丁世祥', '15', '2016-11-23 17:59:16');
INSERT INTO `simple_test_paper` VALUES ('373', '请说明新电脑标准化需要安装的软件和配置', '趋势杀毒，smith，DLP，邮箱，更换用户名和域，NAC', '丁世祥', '15', '2016-11-23 17:59:16');
INSERT INTO `simple_test_paper` VALUES ('374', '请说明Win7系统加入Haier-Corp的条件和过程', '过程打开网络和共享中心——管理无线网络——添加——手动设置——WF2企业——选下下步——安全————设置————验证服务器哪里去了————配置——入域点确定——高级设置————选上身份验证模式点确定————确定就可以了               条件', '徐已轩', '15', '2016-11-23 17:59:41');
INSERT INTO `simple_test_paper` VALUES ('375', '请说明新电脑标准化需要安装的软件和配置', '安装标准化软件，更改计算机名入域    {趋势  ，DLP，NAC，smart IT }', '徐已轩', '15', '2016-11-23 17:59:41');
INSERT INTO `simple_test_paper` VALUES ('376', '请说明Win7系统加入Haier-Corp的条件和过程', '条件：加域标准化。\r\n过程：打开网络和共享中心，管理无线网络，添加网络，Haier-Corp,类型选WPA2-企业，加密类型选择AES，完成。\r\n设置Haier-Corp属性,把验证服务器证书前面的勾去掉，身份验证方式选择自动使用windows登录名连接，完成。', '王斌', '15', '2016-11-24 10:08:56');
INSERT INTO `simple_test_paper` VALUES ('377', '请说明新电脑标准化需要安装的软件和配置', '安装数据防泄漏软件DLP 11.0 :服务器地址要填dlp690.haier.me\r\n安装趋势网络版杀毒软件 10.6\r\n安装思科网络准入系统NAC 4.7.3.2:主机发现地址为10.128.4.1\r\n安装资产管理软件SmartIT', '王斌', '15', '2016-11-24 10:08:56');
INSERT INTO `simple_test_paper` VALUES ('378', '请说明Win7系统加入Haier-Corp的条件和过程', '（内部人员）需要终端标准化（笔记本加域、安装NAC），如不符合连接条件请拨打电话 1000，进行处理；\r\n\r\n（外部人员）需要安装nac，如不符合连接条件请拨打电话 1000，进行处理；\r\n', '高平歌', '15', '2016-11-24 10:19:58');
INSERT INTO `simple_test_paper` VALUES ('379', '请说明新电脑标准化需要安装的软件和配置', '安装smartit dlp 趋势 nac\r\n', '高平歌', '12', '2016-11-24 10:19:58');
INSERT INTO `simple_test_paper` VALUES ('380', '请说明Win7系统加入Haier-Corp的条件和过程', '加入Haier-Corp需要具有海尔员工号，或外来专家号，需要安装nac', '王旬朋', '15', '2016-11-24 13:57:11');
INSERT INTO `simple_test_paper` VALUES ('381', '请说明新电脑标准化需要安装的软件和配置', '新电脑需要先更改为标准的计算机名，然后重启计算机。\r\n重启计算机后，安装dlp、smartIT、趋势杀毒软件，安装完毕后加入corp.haier.com域', '王旬朋', '15', '2016-11-24 13:57:11');
INSERT INTO `simple_test_paper` VALUES ('386', '请说明Win7系统加入Haier-Corp的条件和过程', '', '丁世祥', null, '2016-11-24 14:09:01');
INSERT INTO `simple_test_paper` VALUES ('387', '请说明Win7系统加入Haier-Corp的条件和过程', ' qqq', '钟希康', null, '2016-11-24 14:54:42');
INSERT INTO `simple_test_paper` VALUES ('388', '请说明新电脑标准化需要安装的软件和配置', '111', '钟希康', null, '2016-11-24 14:54:42');
INSERT INTO `simple_test_paper` VALUES ('391', '请说明Win7系统加入Haier-Corp的条件和过程', '条件：内部人员需要终端标准化，外部人员需要安装NAC.\r\n过程：电脑右下角无线图标-打开网络和共享中心-管理无线网络-手动创建网络配置文件-网络名haier-corp-安全类型wpa2-企业-加密类型AES-添加成功-更改连接设置-安全-取消验证服务器证书-选择省份验证方法-安全密码（EAP-MSCHAPV2）-配置-加域用户选择不使用Windows登入用户名和密码，非加域用户选择-确定-haier-corp无线网络属性-高级设置-加域用户无需设置，非加域用户选择802.1X-用户验证-确定-用域账号密码登入即可.', '刘胜彬', null, '2016-11-24 15:54:59');
INSERT INTO `simple_test_paper` VALUES ('392', '请说明新电脑标准化需要安装的软件和配置', '桌面标准化：\r\n1、系统统一安装海尔集团正版授权windiws系统（windows xp sp3 - windows7_ent sp1）\r\n2、安装数据防泄漏软件DLP（版本11.0）\r\n3、安装趋势网络版杀毒软件（版本10.6）\r\n4、安装思科网络准入系统（版本4.7.3.2）\r\n5、标准化计算机名：7位资产标签+8位员工号\r\n6、安装资产管理软件SmartIT8.2.13.1225\r\n7、加入海尔域corp.haier.com\r\n提醒：必须是先标准化计算机名称后在安装SmartIT软件.\r\n\r\n系统设置：\r\n1、调整桌面图标\r\n2、确认有线网络连接正常\r\n3、连接无线网络，确认无线可用性\r\n4、调整windows7系统UAC级别\r\n5、组策略-windows设置-安全设置-本地策略-安全选项，网络安全：配置Kerberos允许的加密类型，全部勾选\r\n6、安装NAC证书\r\n7、安装打印机，打印测试页\r\n8、替换Host文件\r\n\r\nIE设置：\r\n1、添加*.haier.com、*.haier.net信任站点，取消https验证，并将信任站点安全级别调为最低\r\n2、取消弹出窗口阻止程序\r\n\r\n软件设置：\r\n1、安装office办公软件（office2003、office2007、office20010）\r\n2、安装Notes8.53basic邮箱系统\r\n3、安装RTX2010即时通讯软件\r\n4、安装PDF阅读软件（免费版adobe reader）\r\n5、安装解压缩软件（免费版bandzip）\r\n6、根据用户需求，安装输入法\r\n7、根据用户需求，安装VPN并测试可用性\r\n8、根据用户需求，安装业务应用系统（SAP720.PLM.HORIS.BO.日日顺系统等）', '刘胜彬', null, '2016-11-24 15:54:59');
INSERT INTO `simple_test_paper` VALUES ('393', '请说明Win7系统加入Haier-Corp的条件和过程', '', '周杰', null, '2016-12-17 22:20:32');
INSERT INTO `simple_test_paper` VALUES ('394', '请说明新电脑标准化需要安装的软件和配置', '', '周杰', null, '2016-12-17 22:20:32');
INSERT INTO `simple_test_paper` VALUES ('395', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '前期', '钟希康', '15', '2016-12-19 11:06:12');
INSERT INTO `simple_test_paper` VALUES ('396', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', 'QQ群', '钟希康', '15', '2016-12-19 11:06:12');
INSERT INTO `simple_test_paper` VALUES ('397', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '双击运行“anyconnect-win-4.3.01095-pre-deploy-k9”，如果是windows 8 或windows 10操作系统，请右键点击安装软件“以管理员的身份进行安装”，点击“next”,选择“I accept the terms in the License Agreement”，点击“Install”，然后点击“Finish”。\r\n点击运行“Cisco AnyConnect Secure Mobility Client”，输入VPN服务器地址和端口，27.223.70.57:10445或58.56.174.4：10445，点击\r\n“connect”，会弹出一个安全提示对话框，点击“Connect Anyway”，会弹出输入用户名密码的对话框，输入Portal门户系统用户名密码进行连接验证，如果连接成功，桌面右下角会出现一个带锁的图标，连接成功后系统会自动下载两个VPN服务器的连接策略，一个是Haier-DX（电信），另外一个是Haier-LT（联通），如果能确认自己使用联通线路上网，请选择Haier-LT进行连接，同理如果能确认使用电信线路上网，请选择Haier-DX进行连接，这样网络速度会最佳。', '', '15', '2016-12-22 09:58:32');
INSERT INTO `simple_test_paper` VALUES ('398', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '因将桌面和我的文档，网页收藏夹，还有NOtes邮箱ID，转移备份到D盘 或是其他盘，因为一旦系统重装会导致文件丢失。', '', '15', '2016-12-22 09:58:32');
INSERT INTO `simple_test_paper` VALUES ('399', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '告知用户需要先从门户申请权限\r\n登录VPN.haier.net网站下载对应的操作系统版本的vpn\r\n下载最新版本vpn，然后右键管理员身份安装，选择 I accept the terms in the License Agreement，然后下一步安装，\r\nFinish”，安装完成。\r\n点击电脑屏幕左下角图标，然后点击“Cisco AnyConnect Secure Mobility Client”运行 VPN 软件。\r\n在空白栏中输入 VPN 服务器的地址和端 27.223.70.57:10445 或者58.56.174.4:10445 ，然后点击左下角的“小齿轮”进行设置。确保”Block connections to untrusted servers”未被选中后关闭设置窗口，点击 Connect 按钮\r\n在弹出的安全提示对话框中，点击“Connect Anyway”按钮\r\n在弹出的对话框中，输入用户名和密码，此用户名和密码为 Portal 门户系统的自己的用户名和密码。\r\n\r\n\r\n', '代志伟', '15', '2016-12-22 09:59:11');
INSERT INTO `simple_test_paper` VALUES ('400', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '告知用户需要重新安装操作系统，需要将C盘与桌面文件备份，协助指导用户将数据备份之后在工单 *用户是否已完成重要数据备份 处签单（并告知原因） 询问用户确定数据备份已完成，开始重新安装操作系统。', '代志伟', '15', '2016-12-22 09:59:11');
INSERT INTO `simple_test_paper` VALUES ('401', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '联系用户约定维修时间，下载VPN软件，确认用户已经开通CPN权限。安装软件，之后运行配置。输入27.223.70.57:10445点连接，输入用户员工号以及门户密码，选择VPN服务器，若不知运营商，点击设置在开启自动选择VPN服务器之前的对勾。即可使用。最后请用户签单，再在系统中回填服务单。\r\n\r\n', '李涛', '15', '2016-12-22 10:01:20');
INSERT INTO `simple_test_paper` VALUES ('402', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '重新安装系统操作会影响用户电脑中的数据，要先让用户自行备份并在服务单中对应位置签字确认。\r\n解释：重新安装操作系统可能会影响您电脑中的数据安全，请先将重要的数据备份转移至其他硬盘。特别是桌面，我的文档以及C盘中的资料。之后请在服务工单对应位置签字确认。', '李涛', '15', '2016-12-22 10:01:20');
INSERT INTO `simple_test_paper` VALUES ('403', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件，（如果是windows 8 或windows 10操作系统，请右键点击安装软件“以管理员的身份进行安装”）。\r\n2.点击”next”之后，选择“I accept the terms in the License Agreement”，然后点击”next”。\r\n3.点击”Install”。\r\n4.点击”Finish”，安装完成。\r\n5.点击电脑屏幕左下角图标，然后依次点击“所有程序”-“cisco” –“Cisco AnyConnect Secure Mobility Client” –“Cisco AnyConnect Secure Mobility Client” 运行VPN软件。也可以将该快捷方式拖到桌面，以后通过点击桌面的图标启动VPN软件。\r\n6.在下图空白栏中输入VPN服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击“connect”进行VPN连接。\r\n7.在弹出的安全提示对话框中，点击“Connect Anyway”按钮。\r\n8.在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。\r\n9.连接成功后，桌面右下角会出现一个带锁的图标（连接不成功不带锁）。', '张志亚', '15', '2016-12-22 10:11:20');
INSERT INTO `simple_test_paper` VALUES ('404', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.不签单不操作\r\n2.需要备份用户C盘重要的资料到其他盘\r\n3.备份用户的桌面资料到其他盘\r\n4.备份用户的收藏夹到其他盘\r\n5.备份用户电脑的计算机名，打印机配置信息和用户的员工号', '张志亚', '15', '2016-12-22 10:11:20');
INSERT INTO `simple_test_paper` VALUES ('405', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1、 将 VPN 客户端软件anyconnect-win-4.3.01095-pre-deploy-k9.msi下载到本地后，双击运行该\r\n软件，（如果是 windows 8 或 windows 10 操作系统，请右键点击安装软件“以管理员的身份\r\n进行安装”），按照安装向导进行安装\r\n2、VPN 客户端软件安装完成之后， 启动 VPN 客户端软件\r\n3、在下图空白栏中输入 VPN 服务器的地址和端口， 27.223.70.57:10445 或者\r\n58.56.174.4:10445 ，然后点击左下角的“小齿轮” 进行设置，确保”Block connections to untrusted servers”未被选中后关闭设置窗口， 点击 Connect 按钮\r\n4、在弹出的安全提示对话框中，点击“ Connect Anyway”按钮\r\n5、在弹出的对话框中，输入用户名和密码， 此用户名和密码为 Portal 门户系统的自己的用\r\n户名和密码，连接成功后，桌面右下角会出现一个带锁的图标（连接不成功不带锁）\r\n6、成功连接一次 VPN 后，系统会自动下载两个 VPN 服务器的连接策略，一个是\r\nHaier-DX（电信），另一个是 Haier-LT（联通）\r\n7、在酒店里， 需要按下面的方式设置自动选择\r\n点击小齿轮的图标对 anyconnect 进行设置，选中“ Enable automatic VPN Server Selection”，然后关闭对话框，然后，如下图 VPN 连接对话框就会变成“ Automatic Selection” ,要连接 VPN 时直接点击\r\n“ connect”即可', '刘东昌', '15', '2016-12-22 10:15:15');
INSERT INTO `simple_test_paper` VALUES ('406', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '操作：工程师维修过程中应及时与用户沟通操作的步骤原因，如涉及数据及个人隐私问题必需先向用户说明待用户确认再维修。 \r\n操作机器时如果涉及数据安全，一定让用户自己备份，并在服务单上签字。\r\n解释：系统重装抹掉C盘数据，请您一定要将C盘和桌面的文件、收藏夹备份到其他磁盘，备份完毕请在服务单上签字，谢谢。', '刘东昌', '15', '2016-12-22 10:15:15');
INSERT INTO `simple_test_paper` VALUES ('407', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1：进入vpn.haier.net下载windows版，双击运行安装。\r\n2：完成后在电脑屏幕左下角图标，然后点击“Cisco AnyConnect Secure Mobility Client”运行VPN软件。\r\n3：在空白栏中输入 VPN服务器的地址 27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击左下角的 “小齿轮 ”进行设置，确保Block connections to untrusted servers未被选中后 关闭设置窗口点击 Connect。\r\n4：在弹出的安全提示对话框中点击“ Connect Anyway”，然后输入门户账号密码。\r\n5：连接成功后，桌面连接成功后，桌面右下角会出现一个带锁的图标 （连接不成功带锁） \r\n6：如果想退出 VPN连接，在桌面连接，在桌面右下角带锁的图标 上点击右键，选 Disconnect会中断连接，选 Quit会退出 VPN软件（同时也中断连接了）。', '梁飞风', '15', '2016-12-22 10:15:45');
INSERT INTO `simple_test_paper` VALUES ('408', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '上门后发现系统故障，需要重装系统。首先查看C盘是否崩盘，如崩盘需要跟用户解释C盘资料可能无法修复，如需更深层次的修复需要升级售后处理。如未崩盘，在PE下查看C盘用户工号及别的文件夹下的重要工作数据，将C盘的工作资料以及IE收藏夹拷贝至别的盘。并查看notes邮箱及是否有别的软件安装在C盘，如果是在C盘，将用户的邮箱备份转移至别的盘。别的安装软件需跟用户解释重装系统后将会丢失，需要重新安装。如是mass、PLM、工单系统等软件，重装完系统后指导用户通过ESP、部门信息化接口人 完成安装。', '梁飞风', '15', '2016-12-22 10:15:45');
INSERT INTO `simple_test_paper` VALUES ('409', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1,Haier Oversea VPN System申请\r\n2,Haier Oversea VPN System拨入\r\n3,操作系统拨入.', '王兴和', '5', '2016-12-22 10:20:52');
INSERT INTO `simple_test_paper` VALUES ('410', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.先对用户说明是系统问题无法修复,一定要重新安装系统才能解决问题.\r\n2.重新安装系统有可能导致数据丢失,所以一定要保存好电脑数据,可要求客户自行保存,如果客户一定要工程师保存,就需客户签名确认后才能安装系统.', '王兴和', '15', '2016-12-22 10:20:52');
INSERT INTO `simple_test_paper` VALUES ('411', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.将VPN客户端软件anyconnect-win-4.3.01095-pr-deploy-k9下载到本地后，双击运行，（若是win8或win10系统，右键点击安装软件“以管理员身份安装”）。\r\n2.选择 “I accept the terms in the License Agreement”，然后 点击 ”next”，再点击install，安装完毕时点击finish。\r\n3.VPN客户端软件安装完成之后， 启动 VPN客户端软件。点击电脑屏幕左下角图标，然后点击“ Cisco AnyConnect Secure Mobility Client”运行 VPN软件。\r\n4.点击电脑屏幕左下角图标，然后依次点击“所有程序”-“cisco”，-“cisco AnyConnect Secure Mobility Client”-“cisco AnyConnect Secure Mobility Client”运行VPN软件。\r\n5.在空白栏中输入VPN服务器的地址和端口，27.223.70.57:10445 或者58.56.174.4:10445 ，然后点击左下角的“小齿轮”进行设置。确保”Block connections to untrusted servers”未被选中后关闭设置窗口，点击Connect按钮。\r\n6.在弹出的安全提示对话框中，点击“Connect Anyway”按钮。\r\n7.在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。\r\n8.连接成功后，桌面右下角会出现一个带锁的图标（连接不成功不带锁）。如果想退出VPN连接，在桌面右下角会带锁的图标上点击右键，选Disconnect会中断连接，选Quit会退出VPN软件\r\n9.成功连接一次VPN后，系统会自动下载两个VPN服务器的连接策略，一个是Haier-DX（电信），另一个是Haier-LT（联通）。如果能确认自己使用联通线路上网，选择Haier-LT进行连接，同理如果能确认使用电信线路上网，选择Haier-DX进行连接，这样网络速度会最佳。使用长城宽带、中国移动线路上网的用户，建议选择Haier-DX电信接入点。\r\n10.如果不确定所使用的上网线路，需要点击小齿轮的图标对anyconnect进行设置。选中“Enable automatic VPN Server Selection”，然后关闭对话框。\r\n11.然后，连接对话框就会变成“Automatic Selection”,要连接VPN时直接点击“connect”即可。', '曹磊', '15', '2016-12-22 10:22:04');
INSERT INTO `simple_test_paper` VALUES ('412', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.需要先向用户说明需要对C盘，特别是桌面以及收藏夹中的数据进行备份，如果C盘其他位置有数据需要备份，也请用户一并备份到其他的盘。\r\n2.当用户备份完成后，需要让用户在工单中的“用户是否已完成重要数据备份”一栏中签字确认。\r\n3.在重装系统之前，就再向用户确认，是否已经备份C盘所有的数据，经用户同意，再进行安装。', '曹磊', '15', '2016-12-22 10:22:04');
INSERT INTO `simple_test_paper` VALUES ('413', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '打开VPN下载官网：http://vpn.haier.net\r\n根据操作系统版本下载对应的VPN国内安装包\r\nVPN 客户端软件安装完成之后，启动 VPN 客户端软件：\r\n点击电脑屏幕左下角图标，然后点击“Cisco AnyConnect Secure Mobility Client”运行 VPN 软\r\n件。 也可以将该软件图标拖到桌面，以后通过点击桌面的图标启动 VPN  软件。\r\n或者，点击电脑屏幕左下角图标，然后依次点击“所有程序”-“cisco” –“Cisco AnyConnect\r\nSecure Mobility Client” –“Cisco AnyConnect Secure Mobility Client” 运行 VPN 软件。也可以\r\n将该快捷方式拖到桌面，以后通过点击桌面的图标启动 VPN 软件。\r\n输入 VPN 服务器的地址和端口，27.223.70.57:10445 或者\r\n58.56.174.4:10445 ，然后点击左下角的“小齿轮”进行设置。\r\n确保”Block connections to untrusted servers”未被选中后关闭设置窗口，点击 Connect 按钮\r\n在弹出的安全提示对话框中，点击“Connect Anyway”按钮。\r\n在弹出的对话框中，输入用户名和密码， 此用户名和密码为 Portal门户系统的自己的用户名和密码。\r\n连接成功后，桌面右下角会出现一个带锁的图标（连接不成功不带锁），如果想退出 VPN 连接，在桌面右下角会带锁的图标上点击右键，选 Disconnect 会中断连接，选 Quit 会退出 VPN 软件（同时也中断连接了）。成功连接一次 VPN 后，系统会自动下载两个 VPN 服务器的连接策略，一个是Haier-DX（电信），另一个是 Haier-LT（联通）。如果能确认自己使用联通线路上网，请选择 Haier-LT  进行连接，同理如果能确认使用电信线\r\n路上网，请选择 Haier-DX  进行连接，这样网络速度会最佳。\r\n使用长城宽带、中国移动线路上网的用户，建议选择 Haier-DX 电信接入点。如果不确定自己所使用的上网线路，比如在酒店里， 需要按下面的方式设置自动选择：\r\n点击小齿轮的图标对 anyconnect 进行设置：\r\n选中“Enable automatic VPN Server Selection”，然后关闭对话框。\r\n然后，VPN 连接对话框就会变成“Automatic Selection”,要连接 VPN 时直接点击“connect”即可。', '邱成龙', '15', '2016-12-22 10:23:01');
INSERT INTO `simple_test_paper` VALUES ('414', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '根据实际情况判断是只格式化C盘还是需要全盘都格，然后让用户将自己的重要数据备份到其他盘或者自己的移动存储设备，然后让用户再次确认后签字。——您的电脑中了勒索者病毒，为了彻底清除您电脑的病毒文件，需要将您的电脑全盘格掉，在此之前，您需要将您的资料自行安全备份。', '邱成龙', '15', '2016-12-22 10:23:01');
INSERT INTO `simple_test_paper` VALUES ('415', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '进vpn.haier.net,然后根据系统版本下载并安装。再根据配置手册给用户说一遍，电信的网选哪个，联通的网选哪个。然后连上外网测试一下，就行。', '王亚洲', '10', '2016-12-22 10:23:34');
INSERT INTO `simple_test_paper` VALUES ('416', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '数据部分工程师不要沾手。可以用户或协助用户备份数据后，让用户在工单已确认备份处，签名。然后再给人装系统。', '王亚洲', '15', '2016-12-22 10:23:34');
INSERT INTO `simple_test_paper` VALUES ('417', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '安装系统前要和用户说明安装系统C盘需要格式化资料应该备份到其他盘如D盘\r\n帮助用户保存在用户下的桌面资料还有收藏\r\n记录当前计算机名\r\n确认用户桌面、收藏夹、我的文档里的资料已备份至其它盘符；\r\n确认notes安装在C盘外的其它盘符； \r\n确认用户C盘里的所有文档均备份至其它盘符，并请用户签字；\r\n从certmgr.msc中备份个人证书；\r\n记录用户电脑的特殊网络设置（固定IP）；\r\n记录RTX服务器地址；\r\n备份RTX配置文件C:users用户工号AppDataRoamingTencent； \r\n记录打印机型号及IP地址；\r\n确认用户C盘里的所有文档均备份至其它盘符，并请用户签字；\r\n\r\n', '于旭', '15', '2016-12-22 10:26:29');
INSERT INTO `simple_test_paper` VALUES ('418', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '答：\r\n1、安装VPN客户端，\r\n2、将网络切换到手机热点，运行客户端，在地址栏输入27.223.70.57:10445，点设置取消\"Block connections to untrusted servers”的勾选，点连接\r\n3、弹出的安全提示对话框点Connect Anyway\r\n4、最后弹出的对话框输入门户的工号和密码点OK\r\n5、桌面右下角的图标带锁表示连接成功。', '李强', '15', '2016-12-22 10:37:19');
INSERT INTO `simple_test_paper` VALUES ('419', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '答：\r\n首先跟用户说明重装系统会清空C盘所有数据，询问用户是否同意安装系统，指导用户将C盘的文档进行备份，然后确认NOTES客户端的ID文件及本地备份文件，如在C盘需要备份，备份用户的浏览器收藏夹及聊天工具的聊天记录，如用户使用SAP系统还需要备份SAP的两个配置文件。最后请用户确认数据是否备份完成，并请用户在工单上签字。', '李强', '15', '2016-12-22 10:37:19');
INSERT INTO `simple_test_paper` VALUES ('420', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '将 VPN 客户端软件 anyconnect-win-4.3.01095-pre-deploy-k9 下载到本地后，双击运行该\r\n软件，（如果是 windows 8 或 windows 10 操作系统，请右键点击安装软件“以管理员的身份\r\n进行安装”）。\r\n 点击”next\r\n选择“ I accept the terms in the License Agreement”， 然后点击”next”\r\n 点击”Install”\r\n点击”Finish”， 安装完成。\r\nVPN 客户端软件安装完成之后， 启动 VPN 客户端软件：\r\n点击电脑屏幕左下角图标，然后点击“ Cisco AnyConnect Secure Mobility Client”运行 VPN 软\r\n件。 也可以将该软件图标拖到桌面，以后通过点击桌面的图标启动 VPN 软件。\r\n或者， 点击电脑屏幕左下角图标， 然后依次点击“所有程序” -“ cisco” –“ Cisco AnyConnect\r\nSecure Mobility Client” –“ Cisco AnyConnect Secure Mobility Client” 运行 VPN 软件。 也可以\r\n将该快捷方式拖到桌面，以后通过点击桌面的图标启动 VPN 软件。空白栏中输入 VPN 服务器的地址和端口， 27.223.70.57:10445 或者\r\n58.56.174.4:10445 ，然后点击左下角的“小齿轮” 进行设置。确保”Block connections to untrusted servers”未被选中后关闭设置窗口， 点击 Connect 按钮。在弹出的安全提示对话框中，点击“ Connect Anyway”按钮。在弹出的对话框中，输入用户名和密码， 此用户名和密码为 Portal 门户系统的自己的用\r\n户名和密码。连接成功后，桌面右下角会出现一个带锁的图标（连接不成功不带锁），如果想退出 VPN 连接，在桌面右下角会带锁的图标上点击右键，选 Disconnect 会中断连\r\n接，选 Quit 会退出 VPN 软件（同时也中断连接了）。成功连接一次 VPN 后，系统会自动下载两个 VPN 服务器的连接策略，一个是\r\nHaier-DX（电信），另一个是 Haier-LT（联通）。', '郑勇', '15', '2016-12-22 10:38:41');
INSERT INTO `simple_test_paper` VALUES ('421', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.向用户说明，重装系统会删除C盘数据，让用户自己备份好C盘需要的保留的数据，尤其是桌面和收藏夹。\r\n2.提示用户是否自行使用过windows自带加密，有的话备份证书。\r\n3.查看用户NOTES邮箱是否安装在了C盘，有的话备份相关文件。\r\n4.让用户确认并签字，然后进行系统重装。', '郑勇', '15', '2016-12-22 10:38:41');
INSERT INTO `simple_test_paper` VALUES ('422', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1登陆vpn.haier.net下载对应系统的安装包，下载到本地后，双击运行。2安装后点击所有程序里的Cisco AnyConnect Secure Mobility Client运行VPN软件。3在空白处输入VPN服务器地址（27.223.70.57:10445 或者 58.56.174.4:10445）然后点击左下角的“小齿轮”进行设置。确保”Block connections to untrusted servers”未被选中后未被选中后关闭设置窗口设置窗口，点击Connect按钮。在弹出的安全提示对话框中，点击“Connect Anyway”。在弹出的的窗口中输入用户的门户账号和密码登陆。连接成功后，桌面右下角右下角会出现一个带锁的图标。想退出点击右下角的VPN图标右击选择Disconnect退出即可。', '朱红波', '15', '2016-12-22 10:43:35');
INSERT INTO `simple_test_paper` VALUES ('423', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '告知用户将桌面文件夹、收藏夹、临时文件、下载、我的文档、保存在除C盘以外的其他磁盘内。查看用户邮箱有没有安装在C盘。再看看C盘有没有其他重要文件\r\n解释：我们为您重装系统，会将C盘格式化重新安装，如果您没有将C盘数据保存，重装后数据会丢失，所以请您查看C盘文件，将重要数据进行备份，保存在其他磁盘。', '朱红波', '15', '2016-12-22 10:43:35');
INSERT INTO `simple_test_paper` VALUES ('424', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '第1：在门户网站申请VPN权限\r\n第2：下载安装VPN\r\n第3：根据网络情况配置VPN ', '王伟峰', '5', '2016-12-22 10:50:04');
INSERT INTO `simple_test_paper` VALUES ('425', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '第1：备份重要文件数据到其它盘\r\n第2：备份收藏夹地址', '王伟峰', '5', '2016-12-22 10:50:04');
INSERT INTO `simple_test_paper` VALUES ('426', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', ' 打开http://vpn.haier.net，看看用户查看系统版本，根据用户系统版本下载相应版本的vpn，然后安装上。然后把配置手册拖到用户桌面，根据用户所在地网络服务商类型，选择相应的配置。安装完毕后，用用户账号密码测试，所安装VPN是否好用。谢谢。', '徐已轩', '15', '2016-12-22 10:57:09');
INSERT INTO `simple_test_paper` VALUES ('427', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '数据部分绝对不操作，分区不签字不操作，多次确认 ，用户或协助用户备份数据后，用户在工单已确认备份处签字再给用户装系统', '徐已轩', '15', '2016-12-22 10:57:09');
INSERT INTO `simple_test_paper` VALUES ('428', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '安装FortiClient SSLVPN 服务器地址输入27.223.70.57 然后输入有VPN权限的账号和密码 即可连接', '张松', '00', '2016-12-22 11:02:39');
INSERT INTO `simple_test_paper` VALUES ('429', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '如果是固定IP需吧IP记下 把c盘的文件 放到其他盘 防止数据丢失 记录下客户需要安装的软件 方便重装系统后进行安装 ', '张松', '10', '2016-12-22 11:02:39');
INSERT INTO `simple_test_paper` VALUES ('430', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1、VPN账号申请\r\n2、选择合适的操作系统拨入\r\n3、选择合适的节点后输入账号跟密码，登陆成功即可使用\r\n', '肖玉', '5', '2016-12-22 11:02:44');
INSERT INTO `simple_test_paper` VALUES ('431', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1、根客户确认需要备份的数据和资料，及时导出移动硬盘或者其他存储设备\r\n2、重装前跟客户协商好安装后需要安装哪些工作常用软件以及插件，根据客户要求调试好应用软件\r\n3、重装好之后，确认网络正常，安装办公软件', '肖玉', '15', '2016-12-22 11:02:44');
INSERT INTO `simple_test_paper` VALUES ('432', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '登陆http://vpn.haier.net/下载操作系统版本的VPN，双击运行安装程序（win8 win10右键选择“以管理员的身份进行安装”)，一直下一步最后安装完成。在桌面或菜单所有程序中选择“Cisco AnyConnect Secure Mobility Client”运行VPN软件。在桌面右下角弹出的空白栏输入 VPN 服务器的地址和端口，27.223.70.57:10445 或者58.56.174.4:10445，然后点击左下角的“小齿轮”进行设置;确保”Block connections to untrusted servers”未被选中后关闭设置窗口,之后点Connect按钮，在弹出的安全提示对话框中，点击“ Connect Anyway”按钮。在弹出的对话框中，输入门户的用户名和密码点击“OK”然后即可连接成功。以后登陆VPN自行根据运营商选择Haier-DX（电信）或者Haier-LT（联通）输入账号使用即可。退出VPN右键图标选择Disconnect断开连接或者Quit直接关闭VPN软件。', '赵明炜', '15', '2016-12-22 11:11:43');
INSERT INTO `simple_test_paper` VALUES ('433', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '跟用户讲解重装操作系统会把C盘格式化掉，桌面文件和浏览器收藏夹内容已经安装在C盘的软件清空。需要请用户自行把要保留的文件和收藏的网页拷贝至其他盘，可以指导用户但不能代劳用户操作，向用户解释关于资料丢失的责任问题请用户谅解我们不能代劳。完成后跟用户确认完毕后即可重新安装操作系统。', '赵明炜', '15', '2016-12-22 11:11:43');
INSERT INTO `simple_test_paper` VALUES ('434', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '登录 http://www.forticlient.com下载最新安装包。直接运行 FortiClientOnlineInstall.exe，安装完成配置VPN\r\n连接类型选择SSL-VPN，远程网关联通宽带填写27.223.70.57\r\n电信宽带填写58.56.174.4，选择自定义端口输入10443，点应用\r\n输入员工号和门户密码登录', '李军辉', '15', '2016-12-22 11:13:16');
INSERT INTO `simple_test_paper` VALUES ('435', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '跟用户说明电脑系统出现问题 需要重装系统。C盘的数据将清空，需要用户备份桌面文件收藏夹等数据，并指导用户操作。若系统进不去，可进安全模式或PE系统操作\r\n数据确认备份完成，让用户确认并签字后，可给用户重装系统', '李军辉', '15', '2016-12-22 11:13:16');
INSERT INTO `simple_test_paper` VALUES ('436', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '答：将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件。安装后点击桌面的图标启动VPN软件。输入VPN服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击“connect”进行VPN连接。\r\n弹出的安全提示对话框中，点击“Connect Anyway”按钮在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。', '吴天生', '15', '2016-12-22 11:13:51');
INSERT INTO `simple_test_paper` VALUES ('437', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '答：跟用户解释情况，让用户签纸质维修单，注明数据备份，用户签字。由用户自行操作，工程师协助处理。确认无误备份其它收藏夹，邮箱，SAP 等，再重新安装系统', '吴天生', '15', '2016-12-22 11:13:51');
INSERT INTO `simple_test_paper` VALUES ('438', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '到指定网站下载ANYCONNECT并安装\r\n在开始菜单中点击所有程序——>CISCO——>CISCO ANYCONNECT SECURE MOBILIIT CLIENT——>CISCO ANYCONNECT SECURE MOBILIIT CLIENT——>运行VPN程序\r\n在弹出的窗口中填入服务器地址以及端口：27.223.70.57:10445或者58.56.174.4.10445\r\n在弹出的安全对话框中选择点击CONNECT ANYWAY\r\n之后输入此用户的用户名和密码，成功后系统会自动下载2个VPN连接策略：HAIER_DX和HAIER_LT用户可以按照自己的网络类型进行选择。\r\n在酒店上网时要按VPN连接对话框坐下的齿轮按钮在弹出的对话框中将ENABLE AUTOMATIC VPN SERVER SELECTION的勾去掉，在点击CONNECT即可', '周宇翔', '15', '2016-12-22 11:14:21');
INSERT INTO `simple_test_paper` VALUES ('439', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '', '周宇翔', '0', '2016-12-22 11:14:21');
INSERT INTO `simple_test_paper` VALUES ('440', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1 、VPN  客户端安装\r\n1.1 将 VPN 客户端软件 anyconnect-win-4.3.01095-pre-deploy-k9 下载到本地后，双击运行该\r\n软件，（如果是 windows 8 或 windows 10 操作系统，请右键点击安装软件“以管理员的身份\r\n进行安装”）。\r\n点击”next”\r\n1.2 选择“I accept the terms in the License Agreement”，然后点击”next”\r\n1.3 点击”Install”\r\n1.4 点击”Finish”，安装完成。\r\n2 、VPN  客户端 配置和使用\r\n2.1 VPN 客户端软件安装完成之后，启动 VPN 客户端软件：\r\n点击电脑屏幕左下角图标，然后点击“Cisco AnyConnect Secure Mobility Client”运行 VPN 软\r\n件。 也可以将该软件图标拖到桌面，以后通过点击桌面的图标启动 VPN  软件。\r\n或者，点击电脑屏幕左下角图标，然后依次点击“所有程序”-“cisco” –“Cisco AnyConnect\r\nSecure Mobility Client” –“Cisco AnyConnect Secure Mobility Client” 运行 VPN 软件。也可以\r\n将该快捷方式拖到桌面，以后通过点击桌面的图标启动 VPN 软件。\r\n2.2 在下图空白栏中输入 VPN 服务器的地址和端口，27.223.70.57:10445 或者\r\n58.56.174.4:10445 ，然后点击左下角的“小齿轮”进行设置。\r\n确保”Block connections to untrusted servers”未被选中后关闭设置窗口，点击 Connect 按钮\r\n2.3 在弹出的安全提示对话框中，点击“Connect Anyway”按钮。\r\n2.4 在弹出的对话框中，输入用户名和密码， 此用户名和密码为 Portal  门户系统 的 自己的 用\r\n户名和密码。\r\n2.5 连接成功后，桌面右下角会出现一个带锁的图标（连接不成功不带锁），\r\n2.6 如果想退出 VPN 连接，在桌面右下角会带锁的图标上点击右键，选 Disconnect 会中断连\r\n接，选 Quit 会退出 VPN 软件（同时也中断连接了）。\r\n2.7 成功连接一次 VPN 后，系统会自动下载两个 VPN 服务器的连接策略，一个是\r\nHaier-DX（电信），另一个是 Haier-LT（联通）。\r\n如果能确认自己使用联通线路上网，请选择 Haier-LT  进行连接，同理如果能确认使用电信线\r\n路上网，请选择 Haier-DX  进行连接，这样网络速度会最佳。\r\n使用长城宽带、中国移动线路上网的用户，建议选择 Haier-DX 电信接入点。\r\n如果不确定自己所使用的上网线路，比如在酒店里， 需要按下面的方式设置自动选择\r\n点击下图中小齿轮的图标对 anyconnect 进行设置：\r\n选中下图“Enable automatic VPN Server Selection”，然后关闭对话框。\r\n然后，如下图 VPN 连接对话框就会变成“Automatic Selection”,要连接 VPN 时直接点击\r\n“connect”即可。', '刘福春', '15', '2016-12-22 11:19:21');
INSERT INTO `simple_test_paper` VALUES ('441', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '不泄密。\r\n禁止私自操作。\r\n在对电脑进行操作时必须得到机主的许可，在许可的情况下员工必须在机主的陪同下完成电脑维修工作。或自己指导，机主\r\n\r\n操作。\r\n在进行维护工作前必须首先提醒客户做好重要资料的备份与保密工作。绝对禁止工程师带走客户一切数据资料\r\n不在未经许可情况下调用和查看客户信息\r\n不准在客户未许可情况下改变客户机器设置\r\n未经许可不对硬盘进行随意分区等操作\r\n需要提前备份数据，并在《现场服务记录单》签字确认同意，方可进行操作\r\n工程师坚决不能代客户在维修单上签字，跟用户部门IT接口人员及现场主管或协调员确认服务完成', '刘福春', '15', '2016-12-22 11:19:21');
INSERT INTO `simple_test_paper` VALUES ('442', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.登录电脑的服务器10.156.128.8找到国内VPN的相应操作系统的安装包，下载到用户桌面。                                       \r\n2.双击安装安装包\r\n3.安装完成后，将电信还是联通的地址告诉用户，用其登录，或者用管理员的身份导入配置信息，写入到注册表里，方便用户记不住地址。', '耿晓琳', '15', '2016-12-22 11:22:57');
INSERT INTO `simple_test_paper` VALUES ('443', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.安装前需要先告诉用户需要备份数据，可以指导用户备份桌面等资料，但是需要用户自己备份，工程师不能帮用户备份数据，用户备份完后，叫用户确认后进行签字，后工程师进行操作。\r\n2.插入优盘，重启电脑。进PE，将系统装入C盘即可。', '耿晓琳', '15', '2016-12-22 11:22:57');
INSERT INTO `simple_test_paper` VALUES ('444', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件。安装后点击桌面的图标启动VPN软件。输入VPN服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击“connect”进行VPN连接。\r\n弹出的安全提示对话框中，点击“Connect Anyway”按钮在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。\r\n', '石成军', '15', '2016-12-22 11:33:09');
INSERT INTO `simple_test_paper` VALUES ('445', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '首先在确认电脑室系统问题，在做系统前要询问客户电脑C盘或者桌面是不是有重要额数据，要是有让他们备份到其他盘符或者移动硬盘U盘等外部存储设备。然后告诉他们要是不备份你们的这些数据就会丢失。并且让用户备份完重装系统是签字确认后方可经行重装系统', '石成军', '15', '2016-12-22 11:33:09');
INSERT INTO `simple_test_paper` VALUES ('446', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '登录VPN进行操作', '于振强', '0', '2016-12-22 11:42:07');
INSERT INTO `simple_test_paper` VALUES ('447', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '让客户自行备份数据。文件。照片 等一切重要文件  告知客户重装系统会删除c盘的一切文件 告知重要性。', '于振强', '10', '2016-12-22 11:42:07');
INSERT INTO `simple_test_paper` VALUES ('448', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1、VPN客户端安装: 将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件,按默认下一步，直到安装完成。\r\n2.VPN客户端配置和使用：启动VPN客户端软件；在下图空白栏中输入VPN服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击“connect”进行VPN连接；在弹出的安全提示对话框中，点击“Connect Anyway”按钮；在弹出的对话框中，输入用户名和密码；连接成功后；请选择Haier-LT进行连接，同理如果能确认使用电信线路上网，请选择Haier-DX进行连接。', '叶建龙', '15', '2016-12-22 11:50:58');
INSERT INTO `simple_test_paper` VALUES ('449', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '数据备份：\r\n1.记录当前计算机名；\r\n2.确认用户桌面、收藏夹、我的文档里的资料已备份至其它盘符；\r\n3。确认notes安装在C盘外的其它盘符； \r\n4.确认用户C盘里的所有文档均备份至其它盘符，并请用户签字；\r\n5.从certmgr.msc中备份个人证书；\r\n6.记录用户电脑的特殊网络设置（固定IP）；\r\n7.记录RTX服务器地址；\r\n8.备份RTX配置文件C:users用户工号AppDataRoamingTencent； \r\n9.记录打印机型号及IP地址；\r\n10.与用户确认数据资料。', '叶建龙', '15', '2016-12-22 11:50:58');
INSERT INTO `simple_test_paper` VALUES ('450', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '答：将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件。安装后点击桌面的图标启动VPN软件。输入VPN服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击“connect”进行VPN连接。\r\n弹出的安全提示对话框中，点击“Connect Anyway”按钮在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。\r\n', '张毅', '15', '2016-12-22 12:22:02');
INSERT INTO `simple_test_paper` VALUES ('451', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '答：应让用户自己做数据迁移，我们只能协助并提示那些数据需保存。面向用户解释为：我们无权多用户的数据做操作，最多只能从旁协助。', '张毅', '10', '2016-12-22 12:22:02');
INSERT INTO `simple_test_paper` VALUES ('452', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1 将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件，（如果是windows 8 或windows 10操作系统，请右键点击安装软件“以管理员的身份进行安装”）。\r\n2 选择“I accept the terms in the License Agreement”，然后点击”next”\r\n3 点击”Install”\r\n4 点击”Finish”，安装完成。\r\n5 VPN客户端软件安装完成之后，启动VPN客户端软件.\r\n6 在空白栏中输入VPN服务器的地址和端口，27.223.70.57:10445或者58.56.174.4:10445，然后点击“connect”进行VPN连接。\r\n7 在弹出的安全提示对话框中，点击“Connect Anyway”按钮。\r\n8 在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。\r\n', '徐甘', '15', '2016-12-22 12:22:08');
INSERT INTO `simple_test_paper` VALUES ('453', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '首先告知客户，根据海尔信息安全规范中规定C盘数据由客户自己完成备份，所造成的数据丢失不由工程师负责。等待客户完成好备份后，和客户一一核对并确定数据备份完成，然后要求客户再现场服务单上的数据备份完成栏里签字确认。最后进行C盘格式化操作并安装系统。', '徐甘', '15', '2016-12-22 12:22:08');
INSERT INTO `simple_test_paper` VALUES ('454', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1、登录vpn.haier.net，根据系统的版本，下载相应的VPN客户端。\r\n2、下载完成后，进行安装，单击“下一步，下一步”即可。\r\n3、安装完毕后，将vpn发送到桌面，双击打开。\r\n4、在弹出的界面中输入服务器地址（联通、电信都可以），单击左下角齿轮按钮，在preferences选项卡中，取消选中“”Block connections to untrusted servers”选项，单击关闭，返回主界面。\r\n4、在弹出的安全提示对话框中，点击“在弹出的安全提示对话框中，点击“Connect Anyway”。\r\n5、弹出输入帐号和密码对话框，选择group为VPN，输入员工号和portal密码，单击OK按钮。\r\n6、vpn会进行连接，连接成功后右下角会出现，一个小地球和一把小锁，表明连接成功；也可以通过访问hr.portal.com网站，进行验证是否连接成功。', '李扬', '15', '2016-12-22 12:27:32');
INSERT INTO `simple_test_paper` VALUES ('455', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '答：1、首先要告诉用户，重装系统会格式化C盘，需要把C盘的数据备份出来。\r\n2、用户备份完成后，需要在工单上签字确认，之后才可以安装系统。\r\n3、重装系统前，记录号电脑的机器名、打印机物理卡号、IP地址、打印机地址等相关信息。\r\n4、现在只安装系统WIN7系统，除非用户报备，申请成功，否则不安装其他系统。', '李扬', '15', '2016-12-22 12:27:32');
INSERT INTO `simple_test_paper` VALUES ('456', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '答：1. 将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件，（如果是windows 8 或windows 10操作系统，请右键点击安装软件“以管理员的身份进行安装”）。\r\n2. 选择“I accept the terms in the License Agreement”，然后点击”next”\r\n3 .点击”Install”\r\n4. 点击”Finish”，安装完成。\r\n5 .VPN客户端软件安装完成之后，启动VPN客户端软件.\r\n6 .在空白栏中输入VPN服务器的地址和端口，27.223.70.57:10445或者58.56.174.4:10445，然后点击“connect”进行VPN连接。\r\n7 .在弹出的安全提示对话框中，点击“Connect Anyway”按钮。\r\n8 .在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。\r\n', '黄龙', '15', '2016-12-22 12:37:14');
INSERT INTO `simple_test_paper` VALUES ('457', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '答：告知用户需要重新安装操作系统，用户签单后，进行数据备份。首先记录计算机名称和IP地址，备份网络打印机IP地址，检查备份NOTES邮箱是否是安装在C盘以外的盘符，备份桌面文件和收藏夹，备份腾讯通和ihaier文件接受文件夹，询问用户是否有特殊证书需要备份，如有进行备份。', '黄龙', '15', '2016-12-22 12:37:14');
INSERT INTO `simple_test_paper` VALUES ('458', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '答：将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件。安装后点击桌面的图标启动VPN软件。输入VPN服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击“connect”进行VPN连接。\r\n弹出的安全提示对话框中，点击“Connect Anyway”按钮在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。\r\n', '冯秉杰', '15', '2016-12-22 12:40:11');
INSERT INTO `simple_test_paper` VALUES ('459', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '答：对数据部分工程师应让用户自己操作，工程师只能从旁协助并提示需备份的数据。对数据部分解释为：工程师无权对用户数据做操作，用户需自行备份。工程师可从旁协助。', '冯秉杰', '10', '2016-12-22 12:40:11');
INSERT INTO `simple_test_paper` VALUES ('460', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '安装vpn软件配置vpn服务器 输入工号密码连接vpn', '赵伟贺', '5', '2016-12-22 12:52:36');
INSERT INTO `simple_test_paper` VALUES ('461', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '不好意思用户 这台电脑现在无法修复 需要重装系统 请把桌面上的文件和c盘其他重要的文件做好备份', '赵伟贺', '10', '2016-12-22 12:52:36');
