INSERT INTO `simple_test_paper` VALUES ('463', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '用户的计算机名及打印机物理卡号备份，确认邮箱安装位置\r\n涉及数据备份需要用户自行备份，数据备份完后签字确认后才可以重装系统。', '刘佳林', '10', '2016-12-22 13:00:35');
INSERT INTO `simple_test_paper` VALUES ('464', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1，安装：\r\n   使用系统版本对应的VPN安装包安装。\r\n   安装完成后重启计算机。      \r\n2，配置：\r\n   启动VPN，点击配置VNP，连接类型选择SSL-VPNVPN，自行输入连接名、描述等；\r\n远程网关即为接入的VPN服务器，一共有两个请自行选择（非联通、电信用户填写可随意选择）\r\n联通宽带填写: 27.223.70.\r\n电信宽带填写: 58.56.174.4\r\n同时勾选自定端口，输入同时勾选自定端口，输入10443，点击应用，稍后关闭弹出登陆界面，输入工号和portal密码登录即可，遇到提示点击“是”。', '冯军', '15', '2016-12-22 13:27:10');
INSERT INTO `simple_test_paper` VALUES ('465', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '告知用户系统出现故障，需要重新安装系统才能解决。重新安装系统C盘文件会全部格式化，所以需要备份一下C盘下的数据。然后帮助用户备份数据至其他盘，重点提示用户桌面的文件存于C盘，所以需要注意备份。待用户确认所有数据备份完成后即可开始重装系统。', '冯军', '15', '2016-12-22 13:27:10');
INSERT INTO `simple_test_paper` VALUES ('466', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '将 VPN 客户端软件 anyconnect-win-4.3.01095-pre-deploy-k9 下载到本地后，双击运行该\r\n软件，（如果是 windows 8 或 windows 10 操作系统，请右键点击安装软件“以管理员的身份\r\n进行安装”）。1 VPN 客户端软件安装完成之后，启动 VPN 客户端软件：\r\n点击电脑屏幕左下角图标，然后点击“Cisco AnyConnect Secure Mobility Client”运行 VPN 软\r\n件。', '孙涛', '15', '2016-12-22 13:37:33');
INSERT INTO `simple_test_paper` VALUES ('467', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '需要备份数据 因为需要重装系统 所以格式化C盘 指引用户如何备份  ，需要备份哪些东西，等用户签字确认后，进行重装系统操作。', '孙涛', '10', '2016-12-22 13:37:33');
INSERT INTO `simple_test_paper` VALUES ('468', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.登录vpn.haier.net下载相应的VPN应用程序\r\n2.安装运行vpn\r\n3.配置VPN\r\n4.登录测试VPN', '王旬朋', '5', '2016-12-22 14:09:57');
INSERT INTO `simple_test_paper` VALUES ('469', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.告知用户电脑需要重装系统的原因，并得到用户的肯定\r\n2.让用户备份C盘中的数据，之后帮用户检查看有无遗漏，并让用户在纸制工单上签字确认\r\n3.重装系统\r\n', '王旬朋', '15', '2016-12-22 14:09:57');
INSERT INTO `simple_test_paper` VALUES ('470', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1) 登录网站http://vpn.haier.net/，下载客户端 ，选择\r\n对应的版本安装，安装完毕后重启电脑\r\n2) 启动Cisco VPN Client，点击新建，输入VPN连接名称，Description:可空置 \r\nHost:必须填写，如下 \r\n亚太（香港平台）-Host: 202.55.20.123 \r\n欧洲（法兰克福平台）-Host: 5.10.138.1 \r\n美洲（圣何塞平台 ）-Host：66.102.252.67 就近选择接入的Pop点，分别填入申请VPN帐号时管理员分配的组帐号和组密码\r\n双击新建连接，弹出对话框，输入二次帐号和密码即可', '王成亮', '10', '2016-12-22 14:14:11');
INSERT INTO `simple_test_paper` VALUES ('471', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1、告知用户重装系统，硬盘上的数据有一定风险，有可能丢失\r\n2、让用户把重要的数据备份\r\n3、让用户在现场服务单上数据备份部分签字。', '王成亮', '15', '2016-12-22 14:14:11');
INSERT INTO `simple_test_paper` VALUES ('472', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '指导用户登录\\192.168.100.97 找到服务器共享文件办公和数据库系统常用VPN新版VPN20151127，根据系统版本选择vpn64或32位，双击安装完成。\r\n安装vpn证书，安装到受信任的根证书颁发机构，确定。\r\n打开vpn配置，联通宽带填写27.223.70.57；电信宽带填写：58.56.174.4（非联通、电信用户 填写可随意选择）。', '徐德欣', '5', '2016-12-22 14:17:03');
INSERT INTO `simple_test_paper` VALUES ('473', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '让用户备份好C盘数据，告诉重装系统C盘数据会全部清除，记录用户的计算机名，备份加密密钥，检查C盘是否有邮箱数据，让用户签字确认数据已经备份完成。', '徐德欣', '15', '2016-12-22 14:17:03');
INSERT INTO `simple_test_paper` VALUES ('474', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '下载安装vpn客服端，运行并配置：连接类型选择SSL-vpn，输入连接名 ，描述，远程网关为该接入点vpn服务器，两个自行选择，勾选自定义端口，更新证书后输入用户和密码', '刘刚奇', '5', '2016-12-22 14:20:04');
INSERT INTO `simple_test_paper` VALUES ('475', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '对该用户解释 电脑操作系统故障且无法修复，需通过重新更新系统方法才能得到解决，由于系统故障不能确定数据有无丢失损坏的情况，系统的安装需要一定时间，需询问用户桌面及C盘是否存在重要数据，（在不确定桌面文件夹是否丢失或损坏的情况，不能给用户保证数据完整性，只能尽量找回数据的完整）沟通好用户认可签单后才能进行数据备份及系统安装。', '刘刚奇', '15', '2016-12-22 14:20:04');
INSERT INTO `simple_test_paper` VALUES ('476', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '安装vpn客服端，运行配置对应连接ssl-vpn，设置vpn服务器，完成后输入账号及密码登录', '王志荣', '5', '2016-12-22 14:26:49');
INSERT INTO `simple_test_paper` VALUES ('477', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '询问用户数据存放位置，沟通安装时间接数据完整性，签单后操作', '王志荣', '10', '2016-12-22 14:26:49');
INSERT INTO `simple_test_paper` VALUES ('478', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.准备好工具U盘 告知用户申请VPN使用权限 \r\n2.为用户安装 新版VPN 并为用户下载说明书及常见问题解决方法\r\n3.有条件的可以为用户安装好 测试一下 \r\n', '孟祥山', '15', '2016-12-22 14:40:50');
INSERT INTO `simple_test_paper` VALUES ('479', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.牵扯到数据的备份故障 坚决执行 不签单不操作\r\n2.为用户拷贝桌面 收藏夹 加密文件的证书  邮箱ID  邮箱备份 等重要资料\r\n3.对于有敏感数据可以在重装系统之前把原来的坏系统 备份成GHO文件 备用 即使C盘有数据也可以还原', '孟祥山', '15', '2016-12-22 14:40:50');
INSERT INTO `simple_test_paper` VALUES ('480', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1、将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件，（如果是windows 8 或windows 10操作系统，请右键点击安装软件“以管理员的身份进行安装”）。\r\n2、VPN客户端软件安装完成之后，启动VPN客户端软件：点击电脑屏幕左下角图标，然后点击“Cisco AnyConnect Secure Mobility Client”运行VPN软件。也可以将该软件图标拖到桌面，以后通过点击桌面的图标启动VPN软件。\r\n3、在出现的对话框中输入VPN服务器的地址和端口，27.223.70.57:10445或者58.56.174.4:10445，然后点击“connect”进行VPN连接。在弹出的安全提示对话框中，点击“Connect Anyway”按钮。\r\n4、在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。连接成功后，桌面右下角会出现一个带锁的图标\r\n', '王亮', '15', '2016-12-22 14:40:53');
INSERT INTO `simple_test_paper` VALUES ('481', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1、询问客户是否有重要数据需要备份，如有要说明会尽量协助客户将数据进行备份，但也不排除有可能会有数据丢失情况\r\n2、用户确认后请用户在工单上签字，说明其已经清楚数据备份的风险。\r\n3、协助指导用户备份数据，比如桌面文件，收藏夹，邮箱ID，邮箱本地备份等。', '王亮', '15', '2016-12-22 14:40:53');
INSERT INTO `simple_test_paper` VALUES ('482', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '下载客户端软件，运行软件完成后启动VPN，输入VPN地址端口，联通27.223.70.57:10445 电信58.56.174.4:10445\r\n选择connect连接，在弹出的对话框中输入账号密码。', '孟世超', '15', '2016-12-22 14:41:30');
INSERT INTO `simple_test_paper` VALUES ('483', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '告知用户数据无价，需要用户亲自操作备份，用户有疑问的地方给出指导性建议，提醒用户备份收藏夹和文档。并说明情况涉及到安全性策略，工程师不能随意帮用户备份数据。', '孟世超', '15', '2016-12-22 14:41:30');
INSERT INTO `simple_test_paper` VALUES ('484', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', 'VPN客户端安装将VPN客户端软件客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件如果是windows 8 或windows 10操作系统，请右键点击安装软件“以管理员的身份操作系统，点击”next”选择“I accept the terms in the License Agreement”，然后点击”next”点击”Install”点击”Finish”，安装完成安装完成。启动vpn在下图空白栏中输入在下图空白栏中输入VPN服务器的地址和端口，服务器的地址和端口，服务器的地址和端口27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击左下角的“小齿轮”进行设置确保”Block connections to untrusted servers”未被选中后未被选中后关闭设置窗口设置窗口，点击Connect按钮\r\n登录门户账号密码登陆', '于旭', '15', '2016-12-22 14:47:03');
INSERT INTO `simple_test_paper` VALUES ('485', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '安装系统前要和用户说明安装系统C盘需要格式化资料应该备份到其他盘如D盘帮助用户保存在用户下的桌面资料还有收藏记录当前计算机名确认用户桌面、收藏夹、我的文档里的资料已备份至其它盘符确认notes安装在C盘外的其它盘符； \r\n确认用户C盘里的所有文档均备份至其它盘符，并请用户签字；从certmgr.msc中备份个人证书；记录用户电脑的特殊网络设置（固定IP）；记录RTX服务器地址；备份RTX配置文件C:users用户工号AppDataRoamingTencent； \r\n记录打印机型号及IP地址；确认用户C盘里的所有文档均备份至其它盘符，并请用户签字；\r\n', '于旭', '15', '2016-12-22 14:47:03');
INSERT INTO `simple_test_paper` VALUES ('486', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '安装：将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件，（如果是windows 8 或windows 10操作系统，请右键点击安装软件“以管理员的身份进行安装”）。弹出界面点击”next”，选择“I accept the terms in the License Agreement”\r\n，然后点击”next”点击”Install”点击”Finish”，安装完成。\r\n配置：点击“Cisco AnyConnect Secure Mobility Client”运行VPN软件，空白栏中输入VPN服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击“connect”进行VPN连接。\r\n在弹出的安全提示对话框中，点击“Connect Anyway”按钮\r\n在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。', '李冬冬', '15', '2016-12-22 14:47:51');
INSERT INTO `simple_test_paper` VALUES ('487', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '向用户解释电脑因为系统原因无法正常进入操作系统，需要重新安装操作系统。进入PE界面让用户自己备份系统盘所需要的文件资料，并确认备份完成在纸质工单签字之后，才能对用户电脑进行安装新的操作系统。', '李冬冬', '15', '2016-12-22 14:47:51');
INSERT INTO `simple_test_paper` VALUES ('488', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.登录http://vpn.haier.net/,根据用户电脑版本下载并安装相应版本vpn\r\n2.启动VPN，根据外网服务商配置远程网关和端口（一般全部配置好让用户根据环境自己选择）（联通网关：27.223.70.57，电信网关：58.56.174.4，端口号：10443）（非联通电信用户用那个网关都可以）\r\n3.用员工VPN账号测试登录是否正常', '刘承国', '15', '2016-12-22 14:48:07');
INSERT INTO `simple_test_paper` VALUES ('489', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.按照海尔工程师手册，涉及用户数据保存操作的部分需要用户自己完成工程师从旁协助。\r\n', '刘承国', '5', '2016-12-22 14:48:07');
INSERT INTO `simple_test_paper` VALUES ('490', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '首先确认客户有VPN使用权限，没有就指导客户申请权限，然后安装VPN客户端软件，给客户配置好VPN服务器地址，联通的是27.223.70.57，电信的是58.56.174.4，不知道运营商的情况下随意一个都可以使用。配置好之后输入员工账号和门户密码点击Connect即可登录使用', '严从政', '15', '2016-12-22 14:50:56');
INSERT INTO `simple_test_paper` VALUES ('491', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '先要告诉客户重装会清理掉C盘所有数据，数据有丢失我们不负责，让客户自行备份好C盘里的有用资料，然后帮客户备份好浏览器收藏夹，然后重装系统', '严从政', '10', '2016-12-22 14:50:56');
INSERT INTO `simple_test_paper` VALUES ('492', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1将vpn软件下载到本地双击运行（win8和win10右键以管理员身份运行）\r\n2 VPN客户端软件安装完成之后，启动VPN客户端软件。在开始菜单中选择vpn软件点击打开，然后在空白处输入VPN服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击connect\r\n在跳出的安全提示对话框中选择connect anyway(始终连接），在弹出的对话框中输入此用户的门户账号和门户密码进行登录。登录成功后会在右下角任务栏中出现一个带锁的图标（没有成功连接则不带锁），成功后右键小锁图标点击disconnect中断连接然后选择quit退出。第一次成功连接后系统会自动下载2个vpn服务器的链接策略，一个是Haier-DX和Haier-LT', '刘寅', '15', '2016-12-22 14:52:03');
INSERT INTO `simple_test_paper` VALUES ('493', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '您好，根据我的分析您的电脑出现这种现象是因为系统的原因造成的。这个问题在维修时可能会影响到您的硬盘数据安全，请您将重要数据进行备份，备份完毕请在服务单上签字，谢谢。（务必跟用户强调C盘和桌面的文件要备份到其他硬盘）', '刘寅', '15', '2016-12-22 14:52:03');
INSERT INTO `simple_test_paper` VALUES ('494', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地按默认安装，然后启动VPN输入VPN服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击“connect”进行VPN连接。在弹出的安全提示对话框中，点击“Connect Anyway”按钮在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。', '毕凡', '15', '2016-12-22 14:53:41');
INSERT INTO `simple_test_paper` VALUES ('495', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '跟用户说明故障情况及可能引起故障的可能，协助用户备份数据资料，在用户纸质维修单数据备份上签字后方可开始安装系统。', '毕凡', '15', '2016-12-22 14:53:41');
INSERT INTO `simple_test_paper` VALUES ('496', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1 没有VPN客户端的先下载VPN客户端（国内版）\r\n2 解压缩 点击客户端安装\r\n3 安装好之后在开始——程序找到VPN，在配置\r\n4 切换到互联网，填写VPN账号和密码让用户测试', '刘凯', '10', '2016-12-22 15:04:17');
INSERT INTO `simple_test_paper` VALUES ('497', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1 先告知用户先将C盘和桌面以及重要资料自己备份好\r\n2 先填写现场服务单，让用户签字确认重要数据已备份好\r\n3 从新安装系统\r\n4 安装系统之后，电脑桌面标准化其他软，再根据用户的需求安   装其他软件', '刘凯', '15', '2016-12-22 15:04:17');
INSERT INTO `simple_test_paper` VALUES ('498', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.从vpn.haier.net下载对应版本的安装包。\r\n2.安装完成后配置为自动选择线路', '李华健', '5', '2016-12-22 15:07:36');
INSERT INTO `simple_test_paper` VALUES ('499', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.要求用户自己备份资料\r\n2.要求用户在工单“数据备份”栏确认签字', '李华健', '10', '2016-12-22 15:07:36');
INSERT INTO `simple_test_paper` VALUES ('500', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件，（如果是windows 8 或windows 10操作系统，请右键点击安装软件“以管理员的身份进行安装”）。\r\n2.启动VPN客户端软件。\r\n3.输入VPN服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击“connect”进行VPN连接。\r\n4.输入用户名和密码。\r\n5.成功连接一次VPN后，系统会自动下载两个VPN服务器的连接策略，一个是\r\nHaier-DX（电信），另一个是Haier-LT（联通）\r\n，长城宽带、中国移动线路上网的用户，建议选择Haier-DX电信接入点。', '党小蒙', '15', '2016-12-22 15:07:43');
INSERT INTO `simple_test_paper` VALUES ('501', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.记录当前计算机名；\r\n2.确认用户桌面、收藏夹、我的文档里的资料已备份至其它盘符, notes安装在C盘外的其它盘符；\r\n3.确认用户C盘里的所有文档均备份至其它盘符，并请用户签字；\r\n4.从certmgr.msc中备份个人证书；\r\n5.备份SAP配置文件，Saplogon、services\r\n6.记录用户电脑的特殊网络设置（固定IP）；\r\n7.记录RTX服务器地址, 备份RTX配置文件C:users用户工号AppDataRoamingTencent；\r\n8.记录打印机型号、物理卡号及IP地址；\r\n', '党小蒙', '15', '2016-12-22 15:07:43');
INSERT INTO `simple_test_paper` VALUES ('502', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '将VPN客户端软件下载到本地后以管理员身份安装，待安装完成后启动VPN客户端软件输入VPN服务器地址和端口进行连接在弹出对话框中输入门户的用户名和密码登陆即可。', '刘贤辉', '10', '2016-12-22 15:08:58');
INSERT INTO `simple_test_paper` VALUES ('503', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '先跟用户声明C盘有无重要数据，如有重要数据先备份至后面盘待用户确认数据已拷备完毕在重装系统。', '刘贤辉', '5', '2016-12-22 15:08:58');
INSERT INTO `simple_test_paper` VALUES ('504', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.先告知是否该员工提前申请自己的vpn权限，如果没有需申请。\r\n2.在vpn.haier.net网站下载对应版本或者可使用的vpn安装包，     安装。\r\n3.测试一个已知的vpn帐号，连上为准，测试成功。\r\n4.指导用户使用vpn以及在不同的运营商连接不同的服务器，以及出现问题怎么处理，并准备好错误处理文档放到用户电脑。\r\n5.客户满意后结单离开。\r\n', '朱帅', '15', '2016-12-22 15:08:59');
INSERT INTO `simple_test_paper` VALUES ('505', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.说明问题，必须得安装系统才可以解决。\r\n2.询问系统盘是否有重要数据，有，可以进入安全模式拷贝出来，或者pe进去，拷贝到别的盘，或者u盘镜像启动进入命令行拷贝到别的盘。没有，就直接安装。并让用户在数据备份上签字。\r\n3.安装系统，以及软件，配置等等。\r\n4.结单走人。', '朱帅', '15', '2016-12-22 15:08:59');
INSERT INTO `simple_test_paper` VALUES ('506', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '电话指导用户自行安装，将VPN客户端软件下载到本地后，鼠标右键以管理员权限进行安装，指导用户按安装步骤和选项一直安装完成。安装完成打开填上VPN的服务器地址和端口，点connect进行连接，然后用户使用自己的门户网账户密码就可以远程了。如果条件允许，工程师还可以远程用户电脑进行安装。', '李可湘', '15', '2016-12-22 15:16:26');
INSERT INTO `simple_test_paper` VALUES ('507', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '操作机器时如果涉及数据安全，一定让用户自己备份，跟用户强调C盘和桌面的文件要备份到其它硬盘，并在服务单上签字。', '李可湘', '15', '2016-12-22 15:16:26');
INSERT INTO `simple_test_paper` VALUES ('508', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.访问vpn.haier.net下载新版VPN的Windows版本.\r\n2.运行已下载的VPN安装包，一步步操作直到安装过程结束。\r\n3.在开始菜单应用程序列表里面找到并运行已安装好的VPN客户端Cisco AnyConnect Secure Mobility \r\n\r\nClient。\r\n4.在弹出的空白登录栏中输入VPN服务器的地址和端口，27.223.70.57:10445或者58.56.174.4:10445.\r\n5.在弹出的安全提示对话框中点击Connect Anyway按钮。\r\n6.在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。\r\n7.连接成功后，桌面右下角会出现一个带锁的图标（连接不成功不带锁）。\r\n8.如果想退出VPN连接，在桌面右下角会带锁的图标上点击右键，选Disconnect会中断连接，选Quit会退\r\n\r\n出VPN软件（同时也中断连接了）。', '李小飞', '15', '2016-12-22 15:17:01');
INSERT INTO `simple_test_paper` VALUES ('509', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '答：涉及数据部分，我们不签单不操作，有关数据的备份等操作应由用户自己独立完成并承担相应的数据丢失或损坏所带来的后果及责任，并和用户签署相应的协议，协议上让用户签字，然后我们留存。', '李小飞', '15', '2016-12-22 15:17:01');
INSERT INTO `simple_test_paper` VALUES ('510', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件。安装后点击桌面的图标启动VPN软件。输入VPN服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击“connect”进行VPN连接。\r\n弹出的安全提示对话框中，点击“Connect Anyway”按钮在弹出的对话框中，输入用户名和密码，户名和密码为Portal门户系统的自己的用户名和密码', '郝丙伟', '15', '2016-12-22 15:18:51');
INSERT INTO `simple_test_paper` VALUES ('511', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '应让用户先签数据签收单，确保数据安全性之后，告诉应用一旦数据有任何丢失将于工程师没有任何关系，必须要客户签字以后在进行数据操作，不可以操作后再签字，和客户一定药品解释清楚在进行正确的数据拷贝，再安装操作系统，然后进行桌面标准化安装一些应用软件和对电脑的调试。', '郝丙伟', '15', '2016-12-22 15:18:51');
INSERT INTO `simple_test_paper` VALUES ('512', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.下载VPN客户端，安装，然后下一步，下一步，直到安装完成。\r\n2.运行vpn客户端，输入VPN服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击“connect”进行VPN连接。\r\n3.在弹出的对话框中，输入用户名和密码，用户名和密码为Portal门户系统的自己的用户名和密码。\r\n4.如果连接成功则出现加锁图标，否则不加锁。\r\n5.如果想退出VPN连接，在桌面右下角会带锁的图标上点击右键，选Disconnect会中断连接，选Quit会退出VPN软件（同时也中断连接了）。\r\n6.连接成功后系统会自动下载两个VPN服务器的连接策略，一个是Haier-DX（电信），另一个是Haier-LT（联通）。\r\n7.不确定上网线路可以选择anyconnect进行设置.PN连接对话框就会变成“Automatic Selection”,要连接VPN时直接点击“connect”即可。', '孙群', '15', '2016-12-22 15:21:11');
INSERT INTO `simple_test_paper` VALUES ('513', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.记录下计算机名，员工号，IP地址，打印机型号及ip地址等\r\n2.拷贝桌面文件以及收藏夹文件，我的文档资料，保存的其他盘。\r\n3.确定c盘资料全部拷贝，并请用户签字确定。\r\n4.从certmgr.msc中备份个人证书.\r\n5.记录RTX服务器地址；\r\n6.备份RTX配置文件C:users用户工号AppDataRoamingTencent； \r\n7.安装桌面标准化\r\n8.请用户确定无误，询问是否还需安装其他软件，确定没有，方可离场.\r\n解释：\r\n确认数据拷贝，保存数据以免丢失给用户带来麻烦，影响办公。拷贝其他盘，因为做系统只对系统盘（c盘）进行操作其他无影响。记录ip地址 方便安装后直接固定及安装，不然随便写个容易ip冲突。带来不便。', '孙群', '15', '2016-12-22 15:21:11');
INSERT INTO `simple_test_paper` VALUES ('514', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.VPN客户端软件安装完成之后，启动VPN客户端软件：\r\n点击电脑屏幕左下角图标，然后点击“Cisco AnyConnect Secure Mobility Client”运行VPN软件。\r\n2.运行VPN软件后输入VPN服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击“connect”进行VPN连接。\r\n3.在弹出的安全提示对话框中，点击“Connect Anyway”按钮\r\n4. 在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码\r\n5.连接成功后，桌面右下角会出现一个带锁的图标。', '蔡逢阳', '15', '2016-12-22 15:21:58');
INSERT INTO `simple_test_paper` VALUES ('515', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.向用户解释由于系统故障需要重做系统\r\n2.备份用户资料并让用户确定签字。\r\n', '蔡逢阳', '10', '2016-12-22 15:21:58');
INSERT INTO `simple_test_paper` VALUES ('516', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '将VPN软件anyconnect下载到本地\r\n双击运行软件如果是WIN8或者WIN10请右键用管理员权限运行\r\n1.选I accept the terms in the liscenseagreemen\r\n然后next\r\n2点install 点finish\r\n3.在开始菜单里找到VPN 打开运行\r\n输入VPN地址 27.227.70.57:10445\r\n           58.56.174.4:10445\r\n点击 connect\r\n4.在弹出对话框里选择 connect anyway\r\n5.在弹出对话框中输入  VPN帐号密码(portal帐号密码)', '贾鑫龙', '15', '2016-12-22 15:22:13');
INSERT INTO `simple_test_paper` VALUES ('517', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1首先请用户确认系统盘里是否有需要备份的数据\r\n2请用户签单确认数据备份\r\n3然后找到相关的数据 复制到其他不使用的盘符里', '贾鑫龙', '15', '2016-12-22 15:22:13');
INSERT INTO `simple_test_paper` VALUES ('518', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '安装vpn后配置服务器地址218.58.70.219:10443', '阎飞', '5', '2016-12-22 15:24:38');
INSERT INTO `simple_test_paper` VALUES ('519', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '和客户说明情况系统已经崩溃，数据有很大可能丢失，我会努力拯救电脑C盘数据。\r\n进入PE查看从C盘是否损坏，能否看见C盘，如看不见就和用户说明数据全部丢失，如能看见让用户自己备份。', '阎飞', '15', '2016-12-22 15:24:38');
INSERT INTO `simple_test_paper` VALUES ('520', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地\r\n2.双击运行该软件。安装后点击桌面的图标启动VPN软件。\r\n3.输入VPN服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击“connect”进行VPN连接。\r\n4.弹出的安全提示对话框中，点击“Connect Anyway”按钮在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。', '薛孟', '15', '2016-12-22 15:25:05');
INSERT INTO `simple_test_paper` VALUES ('521', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '向用户说明,重装电脑系统,需要用到电脑C盘，C盘数据需要备份到除C盘以外的磁盘。', '薛孟', '10', '2016-12-22 15:25:05');
INSERT INTO `simple_test_paper` VALUES ('522', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '双击“anyconnect-win-4.3.01095-pre-deploy-k9”应用程序，如果是windows 8 或windows 10操作系统，请右键点击安装软件“以管理员的身份进行安装”，点击“next”,\r\n选择“I accept the terms in the License Agreement”，然后点击”next”，点击”Install”，点击”Finish”，安装完成。\r\n点击“Cisco AnyConnect Secure Mobility Client”运行VPN软件，在下图空白栏中输入VPN服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击“connect”进行VPN连接，会弹出对话框点击“Connect Anyway”按钮，会跳出输入用户名和密码的界面，此时请输入Portal门户网的用户和密码，点“OK”.\r\n如果连接成功，桌面右下角会有个带锁的图标，成功连接后系统会自动下载两个VPN服务器的连接策略，一个是\r\nHaier-DX（电信），另一个是Haier-LT（联通）.\r\n如果能确认自己使用联通线路上网，请选择Haier-LT进行连接，同理如果能确认使用电信线路上网，请选择Haier-DX进行连接，这样网络速度会最佳。', '蔡艳林', '15', '2016-12-22 15:26:59');
INSERT INTO `simple_test_paper` VALUES ('523', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '在确定系统重装前，应该对桌面数据以及我的文档，包括网页收藏夹还有NOtes邮箱进行数据备份到D盘或是其他，避免数据丢失。', '蔡艳林', '10', '2016-12-22 15:26:59');
INSERT INTO `simple_test_paper` VALUES ('524', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '答：登录网站http://vpn.haier.net,，下载客户端oversea vpn clinet for winXP,vista,win7,win8选择对应的版本安装，从启即可。启动cisco vpn client,点击新建，connection entry:输入vpn连接名称，出差至海外用户就近选择接入的pop点即可，group authencation name和password分别填入申请vpn帐号时管理员分配的帐号组密码,填完即可。双击新建连接，弹出如下对话框输入二次帐号和密码即可。', '黄荣杰', '15', '2016-12-22 15:27:47');
INSERT INTO `simple_test_paper` VALUES ('525', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '答：首先告知用户电脑需要从装系统才能解决故障，但是涉及到数据安全必须先得到用户同意并签单才能操作，然后把客户需要的资料保存无误后开始安装系统。', '黄荣杰', '15', '2016-12-22 15:27:47');
INSERT INTO `simple_test_paper` VALUES ('526', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.先登录海尔VPN网址：vpn.haier.net\r\n2.下载对应操作系统的国内版VPN最新版为（AnyConnect VPN）\r\n3.将 VPN 客户端软件下载到本地后，双击运行该软件，（如果是 windows 8 或 windows 10 操作系统，请右键点击安装软件“以管理员的身份\r\n进行安装”）\r\n4.安装网页上的说明进行安装过程中的选择，即同意协议下一步（ I accept the terms in the License Agreement）\r\n5.安装完毕后开始配置环节：启动 VPN 客户端软件：\r\n点击电脑屏幕左下角图标，然后点击“ Cisco AnyConnect Secure Mobility Client”运行 VPN 软件。 也可以将该软件图标拖到桌面，以后通过点击桌面的图标启动 VPN 软件\r\n6.运行VPN软件在桌面右下角空白栏中输入 VPN 服务器的地址和端口， 27.223.70.57:10445（联通） 或者58.56.174.4:10445（电信） ，然后点击左下角的“小齿轮” 进行设置。\r\n7.确保”Block connections to untrusted servers”未被选中后关闭设置窗口， 点击 Connect 按钮\r\n8.在弹出的安全提示对话框中，点击“ Connect Anyway”按钮。\r\n9.在弹出的对话框中，输入用户名和密码， 此用户名和密码为 Portal 门户系统的自己的用\r\n户名和密码。\r\n10.连接成功后，桌面右下角会出现一个带锁的图标（连接不成功不带锁）\r\n11.如果想退出 VPN 连接，在桌面右下角会带锁的图标上点击右键，选 Disconnect 会中断连接，选 Quit 会退出 VPN 软件（同时也中断连接了）。\r\n12.成功连接一次 VPN 后，系统会自动下载两个 VPN 服务器的连接策略，一个是\r\nHaier-DX（电信），另一个是 Haier-LT（联通）。\r\n如果能确认自己使用联通线路上网，请选择 Haier-LT 进行连接，同理如果能确认使用电信线路上网，请选择 Haier-DX 进行连接，这样网络速度会最佳。使用长城宽带、中国移动线路上网的用户，建议选择 Haier-DX 电信接入点。如果不确定自己所使用的上网线路，比如在酒店里， 需要按下面的方式设置自动选择点击小齿轮的图标对 anyconnect 进行设置：选中“ Enable automatic VPN Server Selection”，然后关闭对话框。然后，VPN 连接对话框就会变成“ Automatic Selection” ,要连接 VPN 时直接点击“ connect”即可。', '杨程钧', '15', '2016-12-22 15:29:18');
INSERT INTO `simple_test_paper` VALUES ('527', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.首先告知用户系统崩溃，并且修复无果，为了节约用户宝贵时间以及有效的排除当前故障告知用户需要重装系统进行解决。\r\n2.对于用户放在C盘里的敏感数据在得知用户权限的情况下（即是否有USB使用权限或者数据拷贝出电脑权限）建议用户优先拷贝出电脑进行备份存档，如无权限建议用户把数据拷贝至C盘以外的其他磁盘进行数据备份操作。\r\n3.在像用户再三确认数据备份后使用PE进至系统使用PE C盘备份软件进行二次备份并放至与用户备份不同的磁盘，最后在用户承认许可的情况下进行操作系统重装。', '杨程钧', '15', '2016-12-22 15:29:18');
INSERT INTO `simple_test_paper` VALUES ('528', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '安装：将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件，（如果是windows 8 或windows 10操作系统，请右键点击安装软件“以管理员的身份进行安装”）。点击”next”。选择“I accept the terms in the License Agreement”，然后点击”next”。点击”Install”。点击”Finish”，安装完成。\r\n配置：打开VPN软件，输入VPN服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击“connect”进行VPN连接。在弹出的安全提示对话框中，点击“Connect Anyway”按钮。在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。', '李冬冬', '15', '2016-12-22 15:36:41');
INSERT INTO `simple_test_paper` VALUES ('529', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '向用户解释是因为是因为操作系统出现故障需要重新安装操作系统，进PE界面指导用户对自己需要的资料进行备份，用户确定并在纸质工单签字确认备份完成之后在对电脑进行安装操作系统。', '李冬冬', '15', '2016-12-22 15:36:41');
INSERT INTO `simple_test_paper` VALUES ('530', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件，（如果是windows 8 或windows 10操作系统，请右键点击安装软件“以管理员的身份进行安装”）。\r\n2.VPN客户端软件安装完成之后，启动VPN客户端软件.\r\n3.在VPN服务器的窗口输入27.223.70.57:10445或者58.56.174.4:10445，然后点击“connect”进行VPN连接。\r\n4.在弹出的安全提示对话框中，点击“Connect Anyway”按钮。在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。\r\n5.连接成功后，桌面右下角会出现一个带锁的图标（连接不成功不带锁）.\r\n6.成功连接一次VPN后，系统会自动下载两个VPN服务器的连接策略，一个是Haier-DX（电信），另一个是Haier-LT（联通）。如果能确认自己使用联通线路上网，请选择Haier-LT进行连接，同理如果能确认使用电信线路上网，请选择Haier-DX进行连接，这样网络速度会最佳。使用长城宽带、中国移动线路上网的用户，建议选择Haier-DX电信接入点.如果不确定自己所使用的上网线路，比如在酒店里，需要按下面的方式设置自动选择点击下图中小齿轮的图标对anyconnect进行设置.选中“Enable automatic VPN Server Selection”，然后关闭对话框.然后,VPN连接对话框就会变成“Automatic Selection”,要连接VPN时直接点击“connect”即可。\r\n', '刘胜彬', '15', '2016-12-22 15:38:42');
INSERT INTO `simple_test_paper` VALUES ('531', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.记录当前计算机名；\r\n2.确认用户桌面、收藏夹、我的文档里的资料已备份至其它盘符；\r\n3.确认notes安装在C盘外的其它盘符； \r\n4.确认用户C盘里的所有文档均备份至其它盘符，并请用户签字；\r\n5.从certmgr.msc中备份个人证书；\r\n6.记录用户电脑的特殊网络设置（固定IP）；\r\n7.记录RTX服务器地址；\r\n8.备份RTX配置文件C:users用户工号AppDataRoamingTencent； \r\n9.记录打印机型号及IP地址；', '刘胜彬', '15', '2016-12-22 15:38:42');
INSERT INTO `simple_test_paper` VALUES ('532', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '将VPN客户端软件拷到本地运行，非win7系统需要使用管理员运行\r\n安装完成后启动运行VPN软件\r\n连接VPN服务器及端口27.223.70.57:10445或58.56.174.4:10445\r\n使用portal用户名密码登录后选择运行商网络连接\r\n', '许锋', '15', '2016-12-22 15:42:02');
INSERT INTO `simple_test_paper` VALUES ('533', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '告知用户重装系统可能会导致数据丢失，需要备份哪些文件，如桌面文件、我的文档以及收藏夹', '许锋', '10', '2016-12-22 15:42:02');
INSERT INTO `simple_test_paper` VALUES ('534', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1. 登录 http://vpn.haier.net/，下载最新客户端在线安装包\r\n2. 直接运行 FortiClientOnlineInstall.exe\r\n3. 启动桌面新增的 FortiClient 客户端，配置客户端\r\n连接类型选择 SSL-VPN，自定义连接名、描述等；\r\n根据网络环境选择远程网关即为接入的 VPN 服务器，一共有两个，请自行选择（非联通、电信用户\r\n填写可随意选择）\r\n联通宽带填写: 27.223.70.57\r\n电信宽带填写: 58.56.174.4 \r\n同时勾选自定端口，输入 10443，点击应用，稍后关闭，弹出如下界面，\r\n 输入工号和 portal 密码登录即可，如遇如下提示，点击是', '赵恒明', '15', '2016-12-22 15:42:02');
INSERT INTO `simple_test_paper` VALUES ('535', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '指导用户将电脑重要数据进行异地备份，并告知，对数据的操作工程师只提供技术支持，如若需要工程师进行操作需签署免责协议。\r\n', '赵恒明', '15', '2016-12-22 15:42:02');
INSERT INTO `simple_test_paper` VALUES ('536', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '将VPN客户端软件客户端软件下载到本地后，双击运行该下载到本地后，双击运行该下载到本地后，双击运行该软件。w8和w10可直接双击操作。\r\n选择I accept the terms in the License Agreement，然后点击next，然后选择点击Install，点击Finish。\r\nVPN客户端软件安装完成之后，\r\n然后点击Cisco AnyConnect Secure Mobility Client”运行VPN软件。\r\n依次点击所有程序-“cisco” –“Cisco AnyConnect Secure Mobility Client”  运行VPN软件。\r\n在空白栏中输入在下图空白栏中输入VPN服务器的地址和端口，服务器的地址和端口，服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击左下角的“小齿轮”进行设置。确保Block connections to untrusted servers未被选中后未被选中后关闭设置窗口设置窗口，点击Connect按钮。在弹出的安全提示对话框中，点击“在弹出的安全提示对话框中，点击“在弹出的安全提示对话框中，点击“在弹出的安全提示对话框中，点击“Connect Anyway”。在弹出的对话框中，输入用户名和密码在弹出的对话框中，输入用户名和密码在弹出的对话框中，输入用户名和密码在弹出的对话框中，输入用户名和密码在弹出的对话框中，输入用户名和密码此用户名和密码为Portal门户系统的自己的用户名和密码。', '周德昌', '15', '2016-12-22 15:42:37');
INSERT INTO `simple_test_paper` VALUES ('537', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.拿报修单找用户签字，让用户自己备份；确保安装路径\r\n2.帮助用户保存c盘（桌面）文件等重要信息。\r\n3.帮用户保存邮箱Id等一些需要登录的文件，确认邮箱文件保存目录。', '周德昌', '15', '2016-12-22 15:42:37');
INSERT INTO `simple_test_paper` VALUES ('538', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '安装VP软件并配置好端口和IP', '邱冠桦', '5', '2016-12-22 15:44:41');
INSERT INTO `simple_test_paper` VALUES ('539', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '需要跟客户确认备份内容，并让客户签字之后才能操作', '邱冠桦', '10', '2016-12-22 15:44:41');
INSERT INTO `simple_test_paper` VALUES ('540', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件进行安装。\r\n2.VPN客户端软件安装完成之后，启动VPN客户端软件.\r\n3.在VPN服务器的窗口输入27.223.70.57:10445或者58.56.174.4:10445，然后点击“connect”进行VPN连接。\r\n4.在弹出的安全提示对话框中，点击“Connect Anyway”按钮。在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。\r\n5.连接成功后，桌面右下角会出现一个带锁的图标（连接不成功不带锁）.\r\n', '石晓君', '15', '2016-12-22 15:48:51');
INSERT INTO `simple_test_paper` VALUES ('541', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '安装系统前提示用户将文件备份到C盘以外其它盘，C盘未备份数据在重装系统后将不可恢复。', '石晓君', '10', '2016-12-22 15:48:51');
INSERT INTO `simple_test_paper` VALUES ('542', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '答：1；将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件，（如果是windows 8 或windows 10操作系统，请右键点击安装软件“以管理员的身份进行安装”。2；vPN客户端软件安装完成之后，启动VPN客户端软件：点击电脑屏幕左下角图标，然后点击“Cisco AnyConnect Secure Mobility Client”运行VPN软件。也可以将该软件图标拖到桌面，以后通过点击桌面的图标启动VPN软件。3；打开软件后在空白栏中输入VPN服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击“connect”进行VPN连接。4；在弹出的安全提示对话框中，点击“Connect Anyway”按钮。5；在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密6；成功连接一次VPN后，系统会自动下载两个VPN服务器的连接策略，一个是Haier-DX（电信），另一个是Haier-LT（联通）。7；如果能确认自己使用联通线路上网，请选择Haier-LT进行连接，同理如果能确认使用电信线路上网，请选择Haier-DX进行连接，这样网络速度会最佳。使用长城宽带、中国移动线路上网的用户，建议选择Haier-DX电信接入点。如果不确定自己所使用的上网线路，需要按下面的方式设置自动选择.8；点击下小齿轮的图标对anyconnect进行设置。9；选中“Enable automatic VPN Server Selection”，然后关闭对话框。10；然后VPN连接对话框就会变成“Automatic Selection”,要连接VPN时直接点击“connect”即可。', '孙宏宇', '15', '2016-12-22 15:51:01');
INSERT INTO `simple_test_paper` VALUES ('543', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '答：到现场后发现用户计算机需要重新安装操作系统，首先告知用户重要数据需要用户提前做备份，安装系统有丢失数据的风险存在，请用户一定重视做好备份，备份完成后，经用户允许后为用户安装操作系统。', '孙宏宇', '15', '2016-12-22 15:51:01');
INSERT INTO `simple_test_paper` VALUES ('544', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.安装VPN客户端，管理员身份运行安装-下一步下一步\r\n2.在开始菜单中找到客户端文件点击运行，也可先快捷方式到桌面\r\n3.指定VPN服务器地址27.223.70.57:10445，下一步输入账号密码，密码为portal门户密码\r\n连接上VPN', '秦振新', '15', '2016-12-22 15:52:31');
INSERT INTO `simple_test_paper` VALUES ('545', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.先让用户备份数据，备份完毕后让用户重新核对数据完整，之后进行重装系统\r\n2.解释：因为重装系统会涉及到磁盘格式化，所以需要提前把有用的数据文件进行备份，桌面上的以及各磁盘的，避免出现数据损失', '秦振新', '15', '2016-12-22 15:52:31');
INSERT INTO `simple_test_paper` VALUES ('546', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.链接WIFI 登录vpn.haier.net \r\n.将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件\r\n2.VPN客户端软件安装完成之后，启动VPN客户端软件.\r\n3.在VPN服务器的窗口输入27.223.70.57:10445或者58.56.174.4:10445，然后点击“connect”进行VPN连接。\r\n4.在弹出的安全提示对话框中，点击“Connect Anyway”按钮。在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。', '孟祥来', '15', '2016-12-22 15:53:16');
INSERT INTO `simple_test_paper` VALUES ('547', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '解释故障原因，提醒用户备份文件， C盘文件  桌面文件 收藏夹 文档 图片 视频 NOTES ID 等 备份C盘以外的盘符\r\n \r\n请用户在工单中签字。\r\n ', '孟祥来', '15', '2016-12-22 15:53:16');
INSERT INTO `simple_test_paper` VALUES ('548', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '答：\r\n1软件vpn像安装其他软件一样，将vpn安装在电脑上它会自动在电脑上出现图标\r\n2双击打开会提示安装一个虚拟网卡，确定可以了，xp可能会提示\r\n驱动没通过验证，选仍然继续\r\n3.安装完虚拟网卡后要求输入用户名和密码\r\n4.进入vpn控制台界面点击启动vpn\r\n5等提示信息最下面一行提示虚拟网卡的ip地址被设置为....后软件vpn就正常连接上了', '郭洋博', '15', '2016-12-22 15:55:13');
INSERT INTO `simple_test_paper` VALUES ('549', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '答\r\n1首先确认故障，发现系统问题。\r\n2与客户沟通确认重要数据都是怎样储存的。\r\n3如果有数据，第一步不要盲目的为客户做系统，告知和引导客户如有数据要做备份操作，如不备份重新装系统可导致数据丢失（数据备份最好要做到外部介质备份，这样做目的是最安全）。最好做到纸质操作的签署，和客户说明这样做不会影响他的工作以免造成严重后果。\r\n4以上都做到数据备份，在我们的客户同意的情况下为客户重新装系统并确认可以正常使用\r\n', '郭洋博', '15', '2016-12-22 15:55:13');
INSERT INTO `simple_test_paper` VALUES ('550', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1，申请 青岛工业园、各工贸、各外地工业园内拨打1000；\r\n外部固定电话拨打8008101000，手机拨打4006001111；\r\n或者在http://esp.haier.com上提报。\r\n\r\n2，安装  FortinetClient SSLVPN插件 \r\n \r\n登陆页面需要填写 Server Address，\r\n联通宽带填写: 27.223.70.57\r\n电信宽带填写: 58.56.174.4\r\nUsername 为工号，密码为 Portal 密码。填写完毕后，点击 Connect 即可。\r\n3、遇到“是否继续”，请点击 是', '张天星', '15', '2016-12-22 16:02:26');
INSERT INTO `simple_test_paper` VALUES ('551', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '需要将桌面文件备份到其他盘，解释：重装系统会将c盘文件重新写入，，桌面属于c盘，重装完系统桌面会重置，', '张天星', '10', '2016-12-22 16:02:26');
INSERT INTO `simple_test_paper` VALUES ('552', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件，（如果是windows 8 或windows 10操作系统，请右键点击安装软件“以管理员的身份进行安装”）。\r\n2.VPN客户端软件安装完成之后，启动VPN客户端软件.\r\n3.在VPN服务器的窗口输入27.223.70.57:10445或者58.56.174.4:10445，然后点击“connect”进行VPN连接。\r\n4.在弹出的安全提示对话框中，点击“Connect Anyway”按钮。在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。\r\n5.连接成功后，桌面右下角会出现一个带锁的图标（连接不成功不带锁）.\r\n6.成功连接一次VPN后，系统会自动下载两个VPN服务器的连接策略，一个是Haier-DX（电信），另一个是Haier-LT（联通）。如果能确认自己使用联通线路上网，请选择Haier-LT进行连接，同理如果能确认使用电信线路上网，请选择Haier-DX进行连接，这样网络速度会最佳。使用长城宽带、中国移动线路上网的用户，建议选择Haier-DX电信接入点.如果不确定自己所使用的上网线路，比如在酒店里，需要按下面的方式设置自动选择点击下图中小齿轮的图标对anyconnect进行设置.选中“Enable automatic VPN Server Selection”，然后关闭对话框.然后,VPN连接对话框就会变成“Automatic Selection”,要连接VPN时直接点击“connect”即可。\r\n', '邹广祺', '15', '2016-12-22 16:03:35');
INSERT INTO `simple_test_paper` VALUES ('553', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.记录当前计算机名；\r\n2.确认用户桌面、收藏夹、我的文档里的资料已备份至其它盘符；\r\n3.确认notes安装在C盘外的其它盘符； \r\n4.确认用户C盘里的所有文档均备份至其它盘符，并请用户签字；\r\n5.从certmgr.msc中备份个人证书；\r\n6.记录用户电脑的特殊网络设置（固定IP）；\r\n7.记录RTX服务器地址；\r\n8.备份RTX配置文件C:users用户工号AppDataRoamingTencent； \r\n9.记录打印机型号及IP地址；\r\n\r\n', '邹广祺', '15', '2016-12-22 16:03:35');
INSERT INTO `simple_test_paper` VALUES ('554', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件，（如果是windows 8 或windows 10操作系统，请右键点击安装软件“以管理员的身份进行安装”）。\r\n2.VPN客户端软件安装完成之后，启动VPN客户端软件.\r\n3.在VPN服务器的窗口输入27.223.70.57:10445或者58.56.174.4:10445，然后点击“connect”进行VPN连接。\r\n4.在弹出的安全提示对话框中，点击“Connect Anyway”按钮。在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。\r\n', '揭志鹏', '15', '2016-12-22 16:04:10');
INSERT INTO `simple_test_paper` VALUES ('555', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.确认用户桌面、收藏夹、我的文档里的资料已备份至其它盘符；\r\n2.确认notes安装在C盘外的其它盘符； \r\n3.确认用户C盘里的所有文档均备份至其它盘符，并请用户签字；\r\n4.从certmgr.msc中备份个人证书；\r\n5.记录用户电脑的特殊网络设置（固定IP）', '揭志鹏', '15', '2016-12-22 16:04:10');
INSERT INTO `simple_test_paper` VALUES ('556', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1、询问客户是否具有VPN权限，如没有，辅助他去门户网站申请。\r\n2、去门户网站下载VPN安装包，并按照提示安装。\r\n3、安装完成在所有程序中找到VPN软件图标并启动，在弹出的运行窗口中输入27.223.70.57:10445或者58.56.174.4:10445点击connect连接。\r\n4、弹出窗口中点击connect anway按钮，在弹出框中输入自己的门户网账号和密码点击连接，连接成功后桌面右下角会带一个带锁的图标。', '代生灿', '15', '2016-12-22 16:05:56');
INSERT INTO `simple_test_paper` VALUES ('557', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1、告知客户系统损坏，无法修复，为了能尽快正常使用，需进行系统的重装，且数据不会丢失，征求客户同意。\r\n2、如果操作系统不变，提示客户将C盘重要数据备份到非系统盘或者其他移动硬盘，如果客户不会操作需要征求客户同意后帮助操作。\r\n3、客户如果不知道具体的位置可以询问客户存储习惯，并尽量将桌面文件、收藏夹和驱动备份。\r\n4、如果要修改磁盘格式（例如WIN8 10该为WIN7），所有磁盘数据将被格式化，提示客户将所有数据通过移动硬盘备份。', '代生灿', '15', '2016-12-22 16:05:56');
INSERT INTO `simple_test_paper` VALUES ('558', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '答： 将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件，（如果是windows 8 或windows 10操作系统，请右键点击安装软件“以管理员的身份进行安装 安装完成后进行网络配置在输入栏中输入VPN服务器的地址和端口，27.223.70.57:10445或者58.56.174.4:10445，然后点击“connect”进行VPN连接在下图空白栏中输入VPN服务器的地址和端口，27.223.70.57:10445或者58.56.174.4:10445，然后点击“connect”进行VPN连接，在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。另外指导用户如何退出VPN,和选择正确的接入点。', '倪涛', '15', '2016-12-22 16:07:32');
INSERT INTO `simple_test_paper` VALUES ('559', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '答：首先告知客户重装系统会导致系统盘资料丢失，是否确认要重新安装系统，如客户同意需要在故障单上签字确认。之后指导用户需要保留的系统盘资料。备份完成后即可开始安装操作系统。', '倪涛', '15', '2016-12-22 16:07:32');
INSERT INTO `simple_test_paper` VALUES ('560', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.1 将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件，（如果是windows 8 或windows 10操作系统，请右键点击安装软件“以管理员的身份进行安装”）。\r\n然后点击”next”\r\n1.2选择“I accept the terms in the License Agreement”，然后点击”next”\r\n1.3点击”Install”\r\n1.4点击”Finish”，安装完成。\r\n2.1 VPN客户端软件安装完成之后，启动VPN客户端软件：\r\n点击电脑屏幕左下角图标，然后点击“Cisco AnyConnect Secure Mobility Client”运行VPN软件。也可以将该软件图标拖到桌面，以后通过点击桌面的图标启动VPN软件。\r\n或者，点击电脑屏幕左下角图标，然后依次点击“所有程序”-“cisco”–“Cisco AnyConnect Secure Mobility Client”–“Cisco AnyConnect Secure Mobility Client”运行VPN软件。也可以将该快捷方式拖到桌面，以后通过点击桌面的图标启动VPN软件。\r\n2.2空白栏中输入VPN服务器的地址和端口，27.223.70.57:10445或者58.56.174.4:10445，然后点击“connect”进行VPN连接。\r\n2.3 在弹出的安全提示对话框中，点击“Connect Anyway”按钮。\r\n2.4 在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。\r\n2.5 连接成功后，桌面右下角会出现一个带锁的图标（连接不成功不带锁）\r\n2.6 如果想退出VPN连接，在桌面右下角会带锁的图标上点击右键，选Disconnect会中断连接，选Quit会退出VPN软件（同时也中断连接了）。\r\n2.7 成功连接一次VPN后，系统会自动下载两个VPN服务器的连接策略，一个是\r\nHaier-DX（电信），另一个是Haier-LT（联通）。\r\n如果能确认自己使用联通线路上网，请选择Haier-LT进行连接，同理如果能确认使用电信线路上网，请选择Haier-DX进行连接，这样网络速度会最佳。\r\n使用长城宽带、中国移动线路上网的用户，建议选择Haier-DX电信接入点。\r\n如果不确定自己所使用的上网线路，比如在酒店里，需要按下面的方式设置自动选择\r\n点击小齿轮的图标对anyconnect进行设置：\r\n选中“Enable automatic VPN Server Selection”，然后关闭对话框。\r\n然后，VPN连接对话框就会变成“Automatic Selection”,要连接VPN时直接点击“connect”即可。\r\n\r\n', '文超', '15', '2016-12-22 16:07:52');
INSERT INTO `simple_test_paper` VALUES ('561', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.记录计算机名\r\n2.记录IP\r\n3.备份用户桌面，收藏夹，我的文档里面的资料到其他盘\r\n4.备份邮箱\r\n5.确认C盘所有文档都以及备份到其他盘，然后找用户确认签字\r\n6.备份个人证书\r\n7.记录打印机型号及IP\r\n8.有使用腾讯通的记录服务器地址以及配置文件', '文超', '15', '2016-12-22 16:07:52');
INSERT INTO `simple_test_paper` VALUES ('562', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.告知用户申请VPN权限\r\n2.下载vpn安装包，安装主程序。\r\n3.运行vpn，在弹出的窗口中点击左下方小齿轮进行配置。\r\n4.确定最后一项未勾选之后提交配置，弹出窗口点确认。\r\n5.在用户登录窗口输入用户工号和门户密码。\r\n6.让用户在非内网情况下测试vpn使用情况。', '姜向博', '15', '2016-12-22 16:10:19');
INSERT INTO `simple_test_paper` VALUES ('563', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.和用户说明故障原因和解决方法。\r\n2.让用户告知需要使用的软件和保存的文件，以便确认有没有需要特别注意的软件或程序（财务系统和加密软件等）\r\n3.根据用户软件使用情况 将桌面文件 notes邮箱备份文件.ID文件和收藏夹等为用户保存到C盘除外的其他盘中以日期命名一个文件夹。\r\n4.重装完系统，将文件恢复软件安装调试完毕，经用户确认正常后离开。', '姜向博', '15', '2016-12-22 16:10:19');
INSERT INTO `simple_test_paper` VALUES ('564', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.下载VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9，双击运行，（windows 8 以上版本操作系统，请右键点击安装软件“以管理员的身份进行安装”）。\r\n2.软件安装完成之后，启动VPN客户端软件.\r\n3.在VPN服务器的窗口输入27.223.70.57:10445或者58.56.174.4:10445，然后点击“connect”进行VPN连接。\r\n4.在弹出的对话框中，点击“Connect Anyway”按钮。输入用户名和密码，（用户名和密码为客户的Portal门户系统的用户名和密码）。\r\n5.连接成功后，桌面右下角出现一个带锁的图标（连接不成功不带锁）.\r\n6.成功连接一次VPN后，系统会自动下载两个VPN服务器的连接策略，一个是Haier-DX（电信），另一个是Haier-LT（联通）。如果使用联通线路上网，请选择Haier-LT进行连接，如果是电信线路上网，请选择Haier-DX进行连接。若使用其他线路上网的用户，建议选择Haier-DX电信接入点.如果不确定自己所使用的上网线路，比如在酒店里，需要按下面的方式设置自动选择点击下图中小齿轮的图标对anyconnect进行设置.选中“Enable automatic VPN Server Selection”，然后关闭对话框.然后,VPN连接对话框就会变成“Automatic Selection”,要连接VPN时直接点击“connect”即可。', '王杨智', '15', '2016-12-22 16:10:20');
INSERT INTO `simple_test_paper` VALUES ('565', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.记录当前计算机名；\r\n2.确认用户桌面、收藏夹、我的文档里的资料已备份；\r\n3.确认notes安装在C盘外的其它盘符，若不是，请备份好！ \r\n4.确认用户C盘里的所有文档均备份至其它盘符，并请用户签字；\r\n5.从certmgr.msc中备份个人证书；\r\n6.记录用户电脑的IP地址（固定IP）；\r\n7.记录RTX服务器地址；\r\n8.备份RTX配置文件C:users用户工号AppDataRoamingTencent； \r\n9.记录网络打印机的打印机型号及IP地址；\r\n', '王杨智', '15', '2016-12-22 16:10:20');
INSERT INTO `simple_test_paper` VALUES ('566', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.下载VPN客户端软件，以管理员身份运行安装。\r\n2.在VPN服务窗口处输入IP地址   27.223.70.57:10445\r\n或58.56.174.4：10445然后进行VPN连接\r\n3.在安全提示对话框中点击\"Connect Anyway\"按钮。在淡出的对话框中，输入用户名和密码，此用户名和密码为PORtal门户系统的用户名和密码\r\n4.连接成功后选择请选择电信（DX），联通（LT）线路，保证网络流畅。\r\n', '郭旭', '15', '2016-12-22 16:14:10');
INSERT INTO `simple_test_paper` VALUES ('567', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.记录用户计算机名\r\n2.确认用户桌面，收藏夹，伙胡文档资料备份在其他盘符\r\n3.确认NOTES安装在C盘外其他盘符\r\n4.确认用户C盘里的所有文档均备份至其他盘符，并请用户签字\r\n5.从CERTMGR.MSC中备份个人证书\r\n6.记录用户IP设置\r\n7。记录打印机型号及地址', '郭旭', '15', '2016-12-22 16:14:10');
INSERT INTO `simple_test_paper` VALUES ('568', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '答：将VPN客户端下载安装，安装完成启动软件，在VPN服务器的地址和端口输入：27.223.70.57:10445或58.56.174.4:10445,然后点击connect进行连接，再弹出安全提示后，点击connect anyway，输入用户密码，该用户密码为portal门户系统的账号密码。连接后用户可使用集团内网。', '刘栋', '10', '2016-12-22 16:14:58');
INSERT INTO `simple_test_paper` VALUES ('569', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '答：1，让用户自己先备份好重要数据，再重装系统 。\r\n    2，如果用户强烈要求工程师备份数据，需让用户在备份数据的免责说明上签字之后，再进行操作。', '刘栋', '10', '2016-12-22 16:14:58');
INSERT INTO `simple_test_paper` VALUES ('570', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1 将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件，（如果是windows 8 或windows 10操作系统，请右键点击安装软件“以管理员的身份进行安装”）。\r\n2 VPN客户端软件安装完成之后，启动VPN客户端软件：\r\n3 在下图空白栏中输入VPN服务器的地址和端口，27.223.70.57:10445或者58.56.174.4:10445，然后点击“connect”进行VPN连接。\r\n4 在弹出的安全提示对话框中，点击“Connect Anyway”按钮。\r\n5 在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。\r\n6 连接成功后，桌面右下角会出现一个带锁的图标（连接不成功不带锁）\r\n7 成功连接一次VPN后，系统会自动下载两个VPN服务器的连接策略，一个是Haier-DX（电信），另一个是Haier-LT（联通）。使用长城宽带、中国移动线路上网的用户，建议选择Haier-DX电信接入点。如果不确定自己所使用的上网线路，比如在酒店里，需要按下面的方式设置自动选择：点击下图中小齿轮的图标对anyconnect进行设置：选中“Enable automatic VPN Server Selection”，然后关闭对话框。然后，VPN连接对话框就会变成“Automatic Selection”,要连接VPN时直接点击“connect”即可。', '刘刚', '15', '2016-12-22 16:16:33');
INSERT INTO `simple_test_paper` VALUES ('571', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1 记录当前计算机名；\r\n2 确认用户桌面、收藏夹、我的文档里的资料已备份至其它盘符；\r\n3 确认notes安装在C盘外的其它盘符； \r\n4 确认用户C盘里的所有文档均备份至其它盘符，并请用户签字；\r\n5 从certmgr.msc中备份个人证书；\r\n6 记录用户电脑的特殊网络设置（固定IP）；\r\n7 记录RTX服务器地址；\r\n8 备份RTX配置文件C:users用户工号AppDataRoamingTencent； \r\n9 记录打印机型号及IP地址；\r\n', '刘刚', '15', '2016-12-22 16:16:33');
INSERT INTO `simple_test_paper` VALUES ('572', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1、下载vpn软件安装包至用户电脑，双击运行安装程序，若为win8以上操作系统右键以管理员身份运行安装程序。\r\n2、安装程序安装完成后，启动vpn客户端软件，在弹出的服务器连接窗口中根据网络情况进行配置，联通配置为27.223.70.57:10445电信配置为58.56.174.4:10445，点击connect进行vpn连接。\r\n3、在弹出的安全提示对话框中点击”Connect Anyway”，弹出的登录对话框输入用户名和密码 ，一般为用户的Portal门户系统用户名密码。\r\n4、若电脑右下角出现一个带锁的图标则连接成功。若不成功图标不带锁。\r\n5、连接成功后系统会下载两个vpn服务器连接策略。告知用户若能确定自己所使用网络为联通线路时服务器窗口选择Haier-LT进行连接，若为电信线路选择Haier-DX，若为长城宽带或中国移动建议选择Haier-DX接入点。若不确定网络线路时，点击服务器窗口左下角齿轮，在Preferences选项卡勾选”Enable automatic VPN Server Selection”关闭对话框。服务器地址变为“Automatic Selection” 直接点击connect进行连接即可。\r\n', '黄丽云', '15', '2016-12-22 16:18:15');
INSERT INTO `simple_test_paper` VALUES ('573', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '告知用户电脑操作系统故障需要进行系统重装，可能会影响到硬盘数据安全，在重装系统前请用户对电脑内的重要数据进行备份。\r\n备份操作：1、记录当前计算机名及本机的固定ip地址。\r\n2、记录用户打印机型号及ip地址。\r\n3、确认用户的Notes安装在c盘以外的其他盘符上\r\n3、确认用户桌面、收藏夹及我的文档里的重要资料均已备份到其他盘符上。\r\n4、确认 用户c盘内的所有重要资料备份至其他盘符并请用户签字。\r\n5、从certmgr.msc中备份个人证书。\r\n6、记录RTX服务器的地址并备份C:users用户工号AppDataRoamingTencentxia 的RTX配置文件。\r\n', '黄丽云', '15', '2016-12-22 16:18:15');
INSERT INTO `simple_test_paper` VALUES ('574', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '答：\r\n1 若系统为windows系统，操作如下：\r\n一 登录 vpn.haier.net 下载windows版本vpn\r\n二 安装vpn，根据提示安装完成后打开（win8/10需要使用右击以管理员身份运行，安装完成后，在开始-所有程序中查找所安装的vpn，然后右击发送到桌面并打开）\r\n三 打开后在输入栏中输入VPN服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击“connect”进行VPN连接。\r\n四 在弹出的安全提示对话框中，点击“Connect Anyway”按钮。然后会弹出一个输入账户和密码的对话框，账号和密码为员工的门户账户密码。\r\n五 连接成功后，桌面右下角会出现一个带锁的图标（连接不成功不带锁），如果需要退出，右击右下角小图标，点击Disconnect会中断连接，点击Quit会退出VPN软件\r\n六 成功连接一次VPN后，系统会自动下载两个VPN服务器的连接策略，一个是Haier-DX（电信），另一个是Haier-LT（联通）。如果能确认自己使用联通线路上网，请选择Haier-LT进行连接，同理如果能确认使用电信线路上网，请选择Haier-DX进行连接，这样网络速度会最佳。\r\n七 使用长城宽带、中国移动线路上网的用户，建议选择Haier-DX电信接入点。\r\n八 如果不确定自己所使用的上网线路，需要在登录图标中，点击左下角小齿轮的图标对anyconnect进行设置。\r\n选中“Enable automatic VPN Server Selection”，然后关闭对话框\r\n九 设置完成后，VPN连接对话框就会变成“Automatic Selection”,要连接VPN时直接点击“connect”即可。\r\n\r\n2 若系统为mac系统\r\nmac系统配置方式和windows大致相同，需要注意的如下：\r\n打开安装好的vpn软件后，在输入栏中输入VPN服务器的地址和端口点击“connect”进行VPN连接后\r\n一 在弹出的安全提示对话框中，点击Change Setting更改设置\r\n二 然后将 block connnections to untrusted servers 取消选中\r\n三 弹出对话框后，选择 connect anyway\r\n其他就和windows所需要的配置和需要了解的问题一致。', '李军帅', '15', '2016-12-22 16:25:02');
INSERT INTO `simple_test_paper` VALUES ('575', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '答：\r\n重新安装系统，会导致c盘原先数据清空，所以告知用户对c盘所需要的数据备份到其他磁盘。若用户对数据备份操作不很了解，首先让用户确认c盘中所需要那些数据，然后对用户所需要备份的数据进行操作指导，在用户备份完确认无误后，请用户在工单上用户是否完成重要数据备份处进行签字确认，然后进行系统安装。', '李军帅', '15', '2016-12-22 16:25:02');
INSERT INTO `simple_test_paper` VALUES ('576', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1、将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件，安装\r\n2、启动VPN客户端软件在VPN服务器的窗口输入27.223.70.57:10445或者58.56.174.4:10445，然后点击“connect”进行VPN连接。点击“connect any”输入用户名和密码。', '高雄雄', '15', '2016-12-22 16:25:38');
INSERT INTO `simple_test_paper` VALUES ('577', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1、记录当前计算机名；\r\n2、确认用户桌面、收藏夹、我的文档里的资料已备份至其它盘符；\r\n3、确认notes安装在C盘外的其他盘符；\r\n4、确认用户C盘里的所有文档均备份至其它盘符，并请用户签字；\r\n5、从certmgr.msc中备份个人证书；\r\n6、记录用户电脑的特殊网络设置（固定IP）；\r\n7、记录RTX服务器地址；\r\n8、备份RTX配置文件C:users用户工号AppDataRoamingTencent;\r\n9、记录打印机型号及IP地址。', '高雄雄', '15', '2016-12-22 16:25:38');
INSERT INTO `simple_test_paper` VALUES ('578', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '答：\r\n   1.将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载或拷贝到本地后，Windows7操作系统双击运行该软件，如果是windows8或windows 10操作系统，右键安装软件点击“以管理员的身份进行安装”。\r\n   2.安装完成后，启动VPN软件，在服务器输入27.233.70.57:10445或者58.56.174.4:10445，然后点击“connect”进行连接。\r\n   3.在弹出的对话框中点击“Connect Anyway”按钮。在弹出的对话框中，输入VPN用户名和密码，此用户名和密码为登录Portal门户系统的用户名和密码（已申请VPN权限）。\r\n   4.连接成功后任务栏会出现一个带锁的图标，否则表示连接未成功。\r\n   5.成功连接一次VPN后，系统会自动下载两个VPN服务器的连接策略，一个是Haier-DX（电信），另一个是Haier-LT（联通）。如果能确认自己使用联通线路上网，请选择Haier-LT进行连接，如果是使用电信线路上网，请选择Haier-DX进行连接，这样网络速度会比较快比较平稳。使用长城宽带、中国移动线路上网的用户，建议选择Haier-DX电信接入点.如果不确定自己所使用的上网线路，需要按下面的方式设置自动选择点击下图中小齿轮的图标对anyconnect进行设置.选中“Enable automatic VPN Server Selection”，然后关闭对话框.然后,VPN连接对话框就会变成“Automatic Selection”,要连接VPN时直接点击“connect”即可。', '王磊', '15', '2016-12-22 16:31:53');
INSERT INTO `simple_test_paper` VALUES ('579', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '答：\r\n   1.记录当前计算机名；\r\n   2.与用户确认桌面、收藏夹、我的文档里的资料已备份至除C盘外其他盘符；\r\n   3.确认notes安装在除C盘外的其他盘符以及邮箱ID位置；\r\n   4.确认用户C盘里的所有文档均备份到其他盘符，并请用户签字\r\n   5.从certmgr.msc中备份个人证书；\r\n   6.记录用户电脑的特殊网络设置（固定IP）；\r\n   7.记录RTX服务器地址；\r\n   8.备份RTX配置文件C：users用户工号AppDataRoamingTencent;\r\n   9.记录打印机型号和地址；', '王磊', '15', '2016-12-22 16:31:53');
INSERT INTO `simple_test_paper` VALUES ('580', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1，把VPN安装到电脑里。\r\n2，在程序里找到VPN软件打开。\r\n3，填写VPN服务器地址和端口，27.223.70.57：10445或者  58.56.174.4：10445。点击Connect连接。\r\n4，在弹出的界面点击Connect Anyway。\r\n5，接着填写工号和密码。\r\n6，连接成功。', '韦彬', '15', '2016-12-22 17:04:10');
INSERT INTO `simple_test_paper` VALUES ('581', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1，记录电脑计算机名和IP。\r\n2，协助用户保存C盘资料和桌面资料和收藏夹。\r\n3，检查哪些软件需要重装，备份重要文件。', '韦彬', '15', '2016-12-22 17:04:10');
INSERT INTO `simple_test_paper` VALUES ('582', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '', '丁世祥', '0', '2016-12-22 17:06:47');
INSERT INTO `simple_test_paper` VALUES ('583', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '跟用户说明情况，指导用户进行数据保存。', '丁世祥', '5', '2016-12-22 17:06:47');
INSERT INTO `simple_test_paper` VALUES ('584', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1.1 将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件，（如果是windows 8 或windows 10操作系统，请右键点击安装软件“以管理员的身份进行安装”）。\r\n点击”next”\r\n1.2 选择“I accept the terms in the License Agreement”\r\n1.3 点击”Install”\r\n1.4 点击”Finish”，安装完成。\r\n2.1 VPN客户端软件安装完成之后，启动VPN客户端软件：\r\n点击电脑屏幕左下角图标，然后点击“Cisco AnyConnect Secure Mobility Client”运行VPN软件。也可以将该软件图标拖到桌面，以后通过点击桌面的图标启动VPN软件。\r\n2.2 在下图空白栏中输入VPN服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击“connect”进行VPN连接。\r\n2.3 在弹出的安全提示对话框中，点击“Connect Anyway”按钮\r\n2.4 在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。\r\n连接成功后，桌面右下角会出现一个带锁的图标（连接不成功不带锁）。\r\n', '王斌', '15', '2016-12-22 17:08:24');
INSERT INTO `simple_test_paper` VALUES ('585', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1.首先告诉用户涉及数据需要先签单再进行操作。\r\n2.告知用户把数据备份好，安装系统会清空C盘数据，需要把C盘数据备份到除D、E、F盘。\r\n3.看好notes邮箱安装路径，若安装在C盘需要把邮箱备份文件及邮箱ID备份出来，还有浏览器收藏夹也要拷贝出来。\r\n4.重要软件若安装在C盘也要备份出来。', '王斌', '15', '2016-12-22 17:08:24');
INSERT INTO `simple_test_paper` VALUES ('586', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '联系用户，先确认用户是否已经开通VPN权限，如果用户已经开通权限，通过门户网线下载VPN最新客户端为用户安装并设置VPN的两种线路接入方式，并告知用户在何种网络下使用相对应的线路接入。如果用户没有VPN权限，协助用户在门户网站提报并申请，待权限审批通过后，在为用户在电脑上安装VPN软件', '王旭', '15', '2016-12-22 17:36:32');
INSERT INTO `simple_test_paper` VALUES ('587', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '告知用户，由于电脑系统问题，需要重新安装操作系统，安装之前需要其确认是否已经自行备份数据，电脑中有无未备份的数据，如果有，进入PE，协助用户用户进行数据备份，备份完成或用户确认其数据已经备份完毕，用户签单，说明数据已经备份完成，确认用户签字后，开始格式化硬盘，安装操作系统，如果用户未签字，带用户先签字后再进行相关的格式化等操作，如果因为硬盘故障告知PE下无法看到用户数据，告知用户需要去当地找专业的数据恢复人员恢复并备份其数据后在安装操作系统，如果用户表示不需要备份数据，也让用户签字确认后再安装操作系统', '王旭', '15', '2016-12-22 17:36:32');
INSERT INTO `simple_test_paper` VALUES ('588', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '答：1.将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件，（如果是windows 8 或windows 10操作系统，请右键点击安装软件“以管理员的身份进行安装”）。\r\n2.VPN客户端软件安装完成之后，启动VPN客户端软件.\r\n3.在VPN服务器的窗口输入27.223.70.57:10445或者58.56.174.4:10445，然后点击“connect”进行VPN连接。\r\n4.在弹出的安全提示对话框中，点击“Connect Anyway”按钮。在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。\r\n5.连接成功后，桌面右下角会出现一个带锁的图标（连接不成功不带锁）.\r\n6.成功连接一次VPN后，系统会自动下载两个VPN服务器的连接策略，一个是Haier-DX（电信），另一个是Haier-LT（联通）。如果能确认自己使用联通线路上网，请选择Haier-LT进行连接，同理如果能确认使用电信线路上网，请选择Haier-DX进行连接，这样网络速度会最佳。使用长城宽带、中国移动线路上网的用户，建议选择Haier-DX电信接入点.如果不确定自己所使用的上网线路，比如在酒店里，需要按下面的方式设置自动选择点击下图中小齿轮的图标对anyconnect进行设置.选中“Enable automatic VPN Server Selection”，然后关闭对话框.然后,VPN连接对话框就会变成“Automatic Selection”,要连接VPN时直接点击“connect”即可。', '黄荣杰', '15', '2016-12-22 17:54:14');
INSERT INTO `simple_test_paper` VALUES ('589', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '答：重装系统涉及数据，必须经用户同意并请用户签字；\r\n方可操作：备份当前计算机名，确认用户桌面、收藏夹、我的文档里的资料已备份至其它盘符；确认用户C盘里的所有文档均备份至其它盘符，从certmgr.msc中备份个人证书；记录用户电脑的特殊网络设置（固定IP）；记录打印机型号及IP地址。', '黄荣杰', '15', '2016-12-22 17:54:14');
INSERT INTO `simple_test_paper` VALUES ('590', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1、 VPN 客户端安装\r\n1.1 将 VPN 客户端软件 anyconnect-win-4.3.01095-pre-deploy-k9 下载到本地后，双击运行该\r\n软件，（如果是 windows 8 或 windows 10 操作系统，请右键点击安装软件“以管理员的身份\r\n进行安装”）。\r\n出现下图， 点击”next”\r\n1.2 出现下图， 选择“ I accept the terms in the License Agreement”， 然后点击”next”1.3 出现下图， 点击”Install”\r\n1.4 出现下图， 点击”Finish”， 安装完成。2、 VPN 客户端配置和使用\r\n2.1 VPN 客户端软件安装完成之后， 启动 VPN 客户端软件：\r\n点击电脑屏幕左下角图标，然后点击“ Cisco AnyConnect Secure Mobility Client”运行 VPN 软\r\n件。 也可以将该软件图标拖到桌面，以后通过点击桌面的图标启动 VPN 软件。\r\n或者， 点击电脑屏幕左下角图标， 然后依次点击“ 所有程序” -“ cisco” –“ Cisco AnyConnect\r\nSecure Mobility Client” –“ Cisco AnyConnect Secure Mobility Client” 运行 VPN 软件。 也可以\r\n将该快捷方式拖到桌面，以后通过点击桌面的图标启动 VPN 软件。2.2 在下图空白栏中输入 VPN 服务器的地址和端口， 27.223.70.57:10445 或者\r\n58.56.174.4:10445 ，然后点击左下角的“小齿轮” 进行设置。\r\n确保”Block connections to untrusted servers”未被选中后关闭设置窗口， 点击 Connect 按钮2.3 在弹出的安全提示对话框中，点击“ Connect Anyway”按钮。\r\n2.4 在弹出的对话框中，输入用户名和密码， 此用户名和密码为 Portal 门户系统的自己的用\r\n户名和密码。\r\n2.5 连接成功后，桌面右下角会出现一个带锁的图标（连接不成功不带锁），如下图\r\n2.6 如果想退出 VPN 连接，在桌面右下角会带锁的图标上点击右键，选 Disconnect 会中断连\r\n接，选 Quit 会退出 VPN 软件（同时也中断连接了）。', '曲开浩', '15', '2016-12-22 17:55:48');
INSERT INTO `simple_test_paper` VALUES ('591', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '备份数据填写工单确认数据备份\r\n确认邮箱安装位置 打印机物理卡号信息', '曲开浩', '10', '2016-12-22 17:55:48');
INSERT INTO `simple_test_paper` VALUES ('592', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '打开vpn.haier.net\r\n下载对应安装包\r\n安装配置vpn', '高平歌', '5', '2016-12-23 09:31:46');
INSERT INTO `simple_test_paper` VALUES ('593', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '告知用户自行提前备份C盘数据\r\n签字确认后重新安装系统', '高平歌', '10', '2016-12-23 09:31:46');
INSERT INTO `simple_test_paper` VALUES ('594', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '从vpn.haier.net上下载安装与电脑系统相对应的vpn版本', '宋晓林', '5', '2016-12-23 10:06:46');
INSERT INTO `simple_test_paper` VALUES ('595', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1、备份C盘数据（包括桌面、驱动、计算机名、hosts文件）\r\n   防止数据丢失，便于在安装系统后进行配置\r\n2、记录之前所存在的软件\r\n   便于重装系统后的软件安装', '宋晓林', '15', '2016-12-23 10:06:46');
INSERT INTO `simple_test_paper` VALUES ('596', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件，（如果是windows 8 或windows 10操作系统，请右键点击安装软件“以管理员的身份进行安装”，选择“I accept the terms in the License Agreement”，然后点击”next，然后点击”Install，点击”Finish”，安装完成。点击电脑屏幕左下角图标，然后点击“Cisco AnyConnect Secure Mobility Client”运行VPN软件。也可以将该软件图标拖到桌面，以后通过点击桌面的图标启动VPN软件。在空白栏中输入VPN服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击“connect”进行VPN连接。在弹出的安全提示对话框中，点击“Connect Anyway”按钮。在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。连接成功后，桌面右下角会出现一个带锁的图标（连接不成功不带锁）成功连接一次VPN后，系统会自动下载两个VPN服务器的连接策略，一个是\r\nHaier-DX（电信），另一个是Haier-LT（联通）。\r\n然后，如下图VPN连接对话框就会变成“Automatic Selection”,要连接VPN时直接点击“connect”即可。', '丁世祥', '15', '2016-12-23 10:45:42');
INSERT INTO `simple_test_paper` VALUES ('597', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '给用户说明安装系统的导致c盘清空\r\n告知用户要备份数据\r\n用户不会就告知用户让他找到自己用的文件然后指导备份\r\n备份完确认无误后\r\n在工单重要数据备份处签字确认\r\n然后安装系统\r\n\r\n', '丁世祥', '15', '2016-12-23 10:45:42');
INSERT INTO `simple_test_paper` VALUES ('598', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '1登陆vpn.haier.net。将VPN客户端软件anyconnect-win-4.3.01095-pre-deploy-k9下载到本地后，双击运行该软件，（如果是windows 8 或windows 10操作系统，请右键点击安装软件“以管理员的身份进行安装”）。点击“next”。选择“I accept the terms in the License Agreement”，然后再点“next”；然后点击”Install”出现“finish”之后完成安装。\r\n2 VPN客户端软件安装完成之后，启动VPN客户端软件：\r\n\r\n点击电脑屏幕左下角图标，然后点击“Cisco AnyConnect Secure Mobility Client”运行VPN软件。也可以将该软件图标拖到桌面，以后通过点击桌面的图标启动VPN软件。\r\n在下图空白栏中输入VPN服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击“connect”进行VPN连接。\r\n在弹出的安全提示对话框中，点击“Connect Anyway”按钮。\r\n在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。\r\n连接成功后，桌面右下角会出现一个带锁的图标（连接不成功不带锁）\r\n如果想退出VPN连接，在桌面右下角会带锁的图标上点击右键，选Disconnect会中断连接，选Quit会退出VPN软件（同时也中断连接了）。\r\n成功连接一次VPN后，系统会自动下载两个VPN服务器的连接策略，一个是\r\nHaier-DX（电信），另一个是Haier-LT（联通）。\r\n如果能确认自己使用联通线路上网，请选择Haier-LT进行连接，同理如果能确认使用电信线路上网，请选择Haier-DX进行连接，这样网络速度会最佳。\r\n\r\n使用长城宽带、中国移动线路上网的用户，建议选择Haier-DX电信接入点。\r\n\r\n如果不确定自己所使用的上网线路，比如在酒店里，需要按下面的方式设置自动选择\r\n点击下图中小齿轮的图标对anyconnect进行设置：\r\n选中“Enable automatic VPN Server Selection”，然后关闭对话框，然后VPN连接对话框就会变成“Automatic Selection”,要连接VPN时直接点击“connect”即可。', '曲宗升', '15', '2016-12-26 16:39:49');
INSERT INTO `simple_test_paper` VALUES ('599', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '1告知用户备份C盘资料及用到的软件并告知用户数据需用户亲自备份\r\n2备份之后需用户签单确认\r\n3装系统', '曲宗升', '15', '2016-12-26 16:39:49');
INSERT INTO `simple_test_paper` VALUES ('600', '集团员工要到外地（国内）出差且出差地非工业园或工贸，想在出差期间能够通过VPN连接到集团内网，电脑已标准化，请问工程师接单后需如何操作。（写出VPN安装配置过程）', '答：1 VPN客户端软件安装完成之后，启动VPN客户端软件：\r\n点击电脑屏幕左下角图标，然后点击“Cisco AnyConnect Secure Mobility Client”运行VPN软件。也可以将该软件图标拖到桌面，以后通过点击桌面的图标启动VPN软件。或者，点击电脑屏幕左下角图标，然后依次点击“所有程序”-“cisco” –“Cisco AnyConnect Secure Mobility Client” –“Cisco AnyConnect Secure Mobility Client” 运行VPN软件。也可以将该快捷方式拖到桌面，以后通过点击桌面的图标启动VPN软件。\r\n2 在空白栏中输入VPN服务器的地址和端口，27.223.70.57:10445 或者 58.56.174.4:10445 ，然后点击“connect”进行VPN连接。\r\n3 在弹出的安全提示对话框中，点击“Connect Anyway”按钮。\r\n4 在弹出的对话框中，输入用户名和密码，此用户名和密码为Portal门户系统的自己的用户名和密码。\r\n5 连接成功后，桌面右下角会出现一个带锁的图标（连接不成功不带锁）\r\n6 如果想退出VPN连接，在桌面右下角会带锁的图标上点击右键，选Disconnect会中断连接，选Quit会退出VPN软件（同时也中断连接了）。', '牛延群', '15', '2016-12-26 16:53:28');
INSERT INTO `simple_test_paper` VALUES ('601', '用户报修一台电脑，工程师上门发现操作系统故障需要重装系统。请说明在安装系统前对数据部分应怎样操作和解释。', '答：1.首先礼貌用语告知用户这个问题在维修时可能会影响到您的硬盘数据安全，请您将重要数据进行备份，\r\n2.强调并协助告知用户收藏夹和桌面的文件等C盘重要数据要备份到其他硬盘\r\n3.备份完毕请在服务单上签字，谢谢。', '牛延群', '15', '2016-12-26 16:53:28');
INSERT INTO `simple_test_paper` VALUES ('602', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', 'z', '钟希康', '15', '2017-01-03 11:32:19');
INSERT INTO `simple_test_paper` VALUES ('603', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', 'z', '钟希康', '15', '2017-01-03 11:32:19');
INSERT INTO `simple_test_paper` VALUES ('604', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '回答，可行。\r\n单击“开始”按钮，在搜索框中键入“程序和功能”，然后单击左窗格中的“查看已安装的更新”。2、在“卸载更新”下，向下滚动到“Microsoft Windows”部分。3、右键单击“Windows Internet Explorer 11”，单击“卸载”，然后在出现提示时单击“是”。4、单击以下选项之一：(1) 立即重新启动（完成 Internet Explorer 11 卸载过程，恢复以前的 Internet Explorer 版本）。 (2) 稍后重新启动（等待您关闭或重新启动电脑）', '蔡艳林', '15', '2017-01-18 10:24:15');
INSERT INTO `simple_test_paper` VALUES ('605', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '还要对浏览器安全级别进行设置\r\n点击IE浏览器的“Intenet选项，“安全”选项，然后选择本地，把该区域的安全级别拉到“低”。\r\n可信任站点，也拉到低，点击“站点”按钮，取消勾选“对该区域中所有站点要求服务器验证https并将*.haier.com和*.haier.net添加，切换到“隐私”选项卡并取消勾选“启用弹窗阻止程序”，切换到“内容”选项卡，并点击“清除SSL”状态。', '蔡艳林', '15', '2017-01-18 10:24:15');
INSERT INTO `simple_test_paper` VALUES ('606', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行。\r\n具体步骤：\r\n1.打开“计算机”—“卸载或更改程序”—“查看已安装的更新”\r\n2.在此页面中找到Internet Explorer9或10或11并卸载，卸载后需要重启\r\n3.因为原电脑安装的是IE11，所以每次卸载后还需要卸载更低版本的IE直到降为IE8', '张志亚', '15', '2017-01-18 10:25:03');
INSERT INTO `simple_test_paper` VALUES ('607', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1.重置IE浏览器\r\n2.重启浏览器后再次打开Internet选项，设置p.haier.com为首页\r\n3.切换到安全选项卡，选择本地Intranet并将安全级别拉到最低，选择“可信站点”并将安全级别降到最低，如果没有级别调整选项，使用默认级别按钮重置，点击“站点”按钮，取消勾选“对该区域中所有站点要求服务器验证https”，并将*.haier.com和*.haier.net添加\r\n4.切换到“隐私”选项卡并取消勾选“启用弹窗阻止程序”\r\n5.切换到“内容”选项卡，并点击“清除SSL”状态', '张志亚', '15', '2017-01-18 10:25:03');
INSERT INTO `simple_test_paper` VALUES ('608', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '1.首先，打开开始菜单，然后直接在搜索框中输入“程序和功能“并单击回车,点击左侧菜单中的卸载程序，然后在窗口中列表出现的项目中找到Windows Internet Explorer 11这一项，这便是IE11代表的补丁升级了，右键点击，选择菜单中的卸载，等待卸载完成之后，咱们就会发现IE被降级到IE10的版本，想要降级到IE8，也只能是一级一级的进行卸载了!\r\n\r\n\r\n2.打开ie11浏览器界面,检查下当前的IE版本是否就是ie11。\r\n点击IE11浏览器右上角的齿轮图标，点击F12开发人员工具。点击后，下面会显示出，开发工具操作对话框。\r\n然后选择下拉Edge，选择你想要降级的ie版本。选择好版本后，ie浏览器就会根据你选择的相应版本运行了，选择叉叉就全部Ok啦。', '冯军', '15', '2017-01-18 10:37:08');
INSERT INTO `simple_test_paper` VALUES ('609', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '打开ie11浏览器界面,点击工具-Internet选项-安全-可信站点里添加http://*.haier.com和http://*.haier.net。', '冯军', '15', '2017-01-18 10:37:08');
INSERT INTO `simple_test_paper` VALUES ('610', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可以直接在点击设置-开发人员工具-点击下侧edga选项，选择8 就是IE8版本了。', '姜向博', '5', '2017-01-18 10:38:36');
INSERT INTO `simple_test_paper` VALUES ('611', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1.设置信任网址安全等级为最低\r\n2.关闭阻止弹出窗口\r\n3.设置将所有网页以兼容模式打开\r\n4.将部分网址EVS等加入信任网址', '姜向博', '10', '2017-01-18 10:38:36');
INSERT INTO `simple_test_paper` VALUES ('612', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '打开“开始”—“卸载或更改程序”—“查看已安装的更新”\r\n在此页面中找到Internet 11并卸载，卸载后需要重启。\r\n如果之前浏览器是一步一步安装到IE11版本，每次卸载后还需要卸载更低版本的IE直到降为IE8版本。', '刘胜彬', '15', '2017-01-18 10:45:11');
INSERT INTO `simple_test_paper` VALUES ('613', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '打开Internet选项，设置p.haier.com为首页。\r\n切换到安全选项卡，选择本地Intranet并将安全级别拉到最低。\r\n选择“可信站点”并将安全级别降到最低，如果没有级别调整选项，使用默认级别按钮重置。\r\n点击“站点”按钮，取消勾选“对该区域中所有站点要求服务器验证https”，并将*.haier.com和*.haier.net添加。\r\n切换到“隐私”选项卡并取消勾选“启用弹窗阻止程序”。\r\n切换到“内容”选项卡，并点击“清除SSL”状态。\r\n然后点击“确定”关闭此页面。\r\n', '刘胜彬', '15', '2017-01-18 10:45:11');
INSERT INTO `simple_test_paper` VALUES ('614', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可以降级成ie8，到控制面板添加和删除Windows更新，找到ie11相关更新和补丁，依次顺序进行卸载，防止卸载出错，对于IE11相关联补丁比较难找，有些是杀毒软件更新补丁，必须准确找到，否则提示“无法完全卸载Windows更新”，IE将无法降级。', '刘刚奇', '15', '2017-01-18 10:46:57');
INSERT INTO `simple_test_paper` VALUES ('615', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '常用插件Microsoft Silverlight的安装，内网安全网站添加受信任，开启一些签名插件安装提示', '刘刚奇', '10', '2017-01-18 10:46:57');
INSERT INTO `simple_test_paper` VALUES ('616', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '答：可行。卸载或更改程序中查看已安装的更新，在此页面中找到Internet Explorer11并卸载，然后重启电脑。再查看IE是否降级为IE8，未降级再重复以上步骤，找到Internet Explorer9并卸载，然后重启电脑即可。', '石晓君', '15', '2017-01-18 11:00:48');
INSERT INTO `simple_test_paper` VALUES ('617', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '答：打开Internet选项，在安全选项卡，选择Intranet、本地、可信站点将安全级别拉到最低。', '石晓君', '10', '2017-01-18 11:00:48');
INSERT INTO `simple_test_paper` VALUES ('618', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行。\r\n程序卸载中点击查看已安装的更新，找到IE11将其卸载，重启电脑 查看是否为IE8若还有更高版本继续卸载重启电脑查看，直到浏览器为IE8版本。', '李涛', '15', '2017-01-18 11:06:10');
INSERT INTO `simple_test_paper` VALUES ('619', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '查看浏览器版本是否为IE8，如果不是需要升级或者降级为IE8', '李涛', '5', '2017-01-18 11:06:10');
INSERT INTO `simple_test_paper` VALUES ('620', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '答：可行 在控制面版里 程序和功能  查看已安装的更新 卸载IE11重启后再次程序和功能  查看已安装的更新 卸载IE10 再次操作卸载IE9完成', '吴天生', '15', '2017-01-18 11:07:28');
INSERT INTO `simple_test_paper` VALUES ('621', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '答：1 在安全先项里设置添加 *.haier.com *.haier.net 到信任  站点\r\n    2   在安全自定义级别把ACtierx 控件开启 \r\n    3   关掉 弹出窗口阻止程序\r\n', '吴天生', '15', '2017-01-18 11:07:28');
INSERT INTO `simple_test_paper` VALUES ('622', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可以 下载一个ie8的安装包直接安装将会覆盖原来的ie11', '于振强', '0', '2017-01-18 11:07:41');
INSERT INTO `simple_test_paper` VALUES ('623', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '进行加域  安装一些更是必备的软件', '于振强', '0', '2017-01-18 11:07:41');
INSERT INTO `simple_test_paper` VALUES ('624', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行，首先确认用使用的是Windows7操作系统，如果使用的是Windows8或8.1则最低浏览器版本为IE11，无法降级。\r\nWindows7系统降级为IE8浏览器，需要打开“计算机”—“卸载或更改程序”—“查看已安装的更新\r\n在此页面中找到Internet Explorer9或10或11并卸载，卸载后需要重启。\r\n如果之前浏览器是一步一步安装到10或11版本，每次卸载后还需要卸载更低版本的IE直到降为IE8.\r\n\r\n', '石成军', '15', '2017-01-18 11:14:58');
INSERT INTO `simple_test_paper` VALUES ('625', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', 'Haier集团绝大多数的内网应用都是基于IE8开发的，所以用户电脑如不是IE8浏览器，需要先将浏览器升级或降级为IE8。有一部分业务系统在非IE核心或IE核心的第三方浏览器下工作会出现问题，所以现场建议用户在访问业务系统时使用IE8浏览器。\r\n', '石成军', '10', '2017-01-18 11:14:58');
INSERT INTO `simple_test_paper` VALUES ('626', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '无法降级，需要卸载IE11然后在安装IE8\r\n步骤：Windows7系统降级为IE8浏览器，需要打开“计算机”—“卸载或更改程序”—“查看已安装的更新\r\n在此页面中找到Internet Explorer9或10或11并卸载，卸载后需要重启。\r\n如果之前浏览器是一步一步安装到10或11版本，每次卸载后还需要卸载更低版本的IE直到降为IE8\r\n', '肖玉', '15', '2017-01-18 11:18:42');
INSERT INTO `simple_test_paper` VALUES ('627', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1、重置IE浏览器\r\n2、设置p.haier.com为首页\r\n3、选择本地Intranet并将安全级别拉到最低\r\n4、切换到安全选项卡，选择本地Intranet并将安全级别拉到 最低', '肖玉', '10', '2017-01-18 11:18:42');
INSERT INTO `simple_test_paper` VALUES ('628', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可以\r\n开始 -控制面板- 程序和功能-查看已安装的更新-找到IE11 右键删除 卸载后需要重启\r\n', '党小蒙', '10', '2017-01-18 11:30:22');
INSERT INTO `simple_test_paper` VALUES ('629', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '重置IE浏览器：\r\n打开浏览器—工具—internet选项，找到高级选项卡，点击“重置”，勾选“删除个性化设置”，然后点重置。切换到安全选项卡，选择本地Intranet并将安全级别拉到最低，选择“可信站点”并将安全级别降到最低，如果没有级别调整选项，使用默认级别按钮重置。点击“站点”按钮，取消勾选“对该区域中所有站点要求服务器验证https”，并将*.haier.com和*.haier.net添加，切换到“隐私”选项卡并取消勾选“启用弹窗阻止程序”，切换到“内容”选项卡，并点击“清除SSL”状态。', '党小蒙', '15', '2017-01-18 11:30:22');
INSERT INTO `simple_test_paper` VALUES ('630', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '答：\r\n   可行  \r\n   \r\n   按照以下步骤找到更新目录：开始-控制面板-程序和功能-查看\r\n\r\n已安装的更新，找到IE11进行卸载并重启电脑，另部分电脑的浏览\r\n\r\n器是一级一级升级上去的，必须逐级进行卸载直至降级到IE8。', '王磊', '15', '2017-01-18 11:39:47');
INSERT INTO `simple_test_paper` VALUES ('631', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '答：\r\n\r\n 首先打开浏览器点击Internet选项，设置portal.haier.com\r\n\r\n为首页。\r\n\r\n  点击安全选项卡，选择本地Internet将安全级别拉到最低。选\r\n\r\n择“受信任站点”将安全级别降到最低，如果没有级别调整选项，\r\n\r\n点击默认级别进行重置。\r\n\r\n  点击“受限制站点”按钮，取消勾选“对该区域中所有站点要求\r\n\r\n服务器验证https”，并将海尔相关网址信息进行添加。\r\n  \r\n  点击到“隐私”选项卡并取消勾选“启用弹窗阻止程序”。\r\n  \r\n  点击到“内容”选项卡，并点击“清除SSL”状态。然后点击“确定”关闭此页面。\r\n', '王磊', '15', '2017-01-18 11:39:47');
INSERT INTO `simple_test_paper` VALUES ('632', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '答：可行。\r\n1.找到计算机，卸载删除程序并打开。\r\n2.查看已安装的更新。\r\n3.找到ie11，并卸载掉，重新启动。\r\n4.如果之前浏览器是一步一步安装到ie11版本，每次卸载后还需要卸载更低版本的IE直到降为IE8。\r\n', '孙群', '15', '2017-01-18 11:41:40');
INSERT INTO `simple_test_paper` VALUES ('633', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '答：\r\n1.查看浏览器版本是否为ie8，不是则升级或降级为ie8.\r\n2.重置ie浏览器，并将p.haier.com设为首页。\r\n3.找到安全选项卡，本地Intranet并将安全级别拉到最低。\r\n4.选择可信站点并将安全级别降到最低，如果没有级别调整选项，使用默认级别按钮重置。\r\n5.添加站点，取消勾选“对该区域中所有站点要求服务器验证https，并将*.haier.com和*.haier.net添加。\r\n6.切换到“隐私”选项卡并取消勾选启用弹窗阻止程序。\r\n7.出现脚本问题的话还需设置兼容视图。\r\n', '孙群', '15', '2017-01-18 11:41:40');
INSERT INTO `simple_test_paper` VALUES ('634', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '打开“计算机”—“卸载或更改程序”—“查看已安装的更新”\r\n在此页面中找到Internet Explorer9或10或11并卸载，卸载后需要重启。\r\n如果之前浏览器是一步一步安装到10或11版本，每次卸载后还需要卸载更低版本的IE直到降为IE8.\r\n', '邹广祺', '15', '2017-01-18 11:50:48');
INSERT INTO `simple_test_paper` VALUES ('635', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '打开Internet选项，设置p.haier.com为首页。切换到安全选项卡，选择本地Intranet并将安全级别拉到最低。选择“可信站点”并将安全级别降到最低，如果没有级别调整选项，使用默认级别按钮重置。点击“站点”按钮，取消勾选“对该区域中所有站点要求服务器验证https”，并将*.haier.com和*.haier.net添加。切换到“隐私”选项卡并取消勾选“启用弹窗阻止程序”。切换到“内容”选项卡，并点击“清除SSL”状态。然后点击“确定”关闭此页面。\r\n', '邹广祺', '15', '2017-01-18 11:50:48');
INSERT INTO `simple_test_paper` VALUES ('636', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '打开“控制面板”—“卸载程序”—“查看已安装的更新”\r\n在此页面中找到IE9或IE10或IE11的相关更新并卸载，卸载后重启。\r\n如果之前浏览器是一步一步安装到IE11版本，每次卸载后还需要卸载更低版本的IE直到降为IE8.', '王杨智', '15', '2017-01-18 12:05:22');
INSERT INTO `simple_test_paper` VALUES ('637', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1、打开Internet选项，在“常规”中设置p.haier.com为首页。\r\n2、点开“安全”选项，选择本地Intranet并将安全级别拉到最低。选择“可信站点”并将安全级别降到最低，如果没有级别调整选项，使用默认级别按钮重置。点击“站点”按钮，取消勾选“对该区域中所有站点要求服务器验证https”，并将*.haier.com和*.haier.net添加。\r\n3、点开“隐私”选项并取消勾选“启用弹窗阻止程序”。\r\n4、切换到“内容”选项，并点击“清除SSL”状态。然后点击“确定”关闭此页面。', '王杨智', '15', '2017-01-18 12:05:22');
INSERT INTO `simple_test_paper` VALUES ('638', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行.\r\n1,先卸载IE11(开始-控制面板-程度和功能-找到IE11卸载)\r\n2,重启后再安装IE8.', '王兴和', '15', '2017-01-18 12:06:59');
INSERT INTO `simple_test_paper` VALUES ('639', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1.添加可信任站点*.haier.com和*.haier.net.\r\n2.取消打开窗口阻止程序.\r\n3.启用Activex控件和插件安装.启用文件下载.', '王兴和', '15', '2017-01-18 12:06:59');
INSERT INTO `simple_test_paper` VALUES ('640', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '答：可行\r\n\r\n1.Windows7系统降级为IE8浏览器，需要打开“计算机”—“卸载或更改程序”—“查看已安装的更新”\r\n2.在此页面中找到Internet Explorer11并卸载，卸载后需要重启。\r\n3.如果之前浏览器是一步一步安装到1版本，每次卸载后还需要卸载更低版本的IE直到降为IE8.\r\n', '叶建龙', '15', '2017-01-18 12:09:29');
INSERT INTO `simple_test_paper` VALUES ('641', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1.查看浏览器版本。把浏览器通过升降级直到IE8为止；\r\n2.重置IE浏览器。重置ie浏览器，安全选项级别调到最低，把.haier.com和*.haier.net添加为可信站点，取消勾选隐私中启用弹窗阻止程序，内容”选项卡清除SSL”状态；\r\n3.如遇到脚本报错或内容显示不完整，除了重置浏览器之外，还有两款IE修复工具可以使用；\r\n4.在建议用户打开经常使用的网页，在处理具体故障；\r\n5.在安装1-2个备用浏览器。’', '叶建龙', '15', '2017-01-18 12:09:29');
INSERT INTO `simple_test_paper` VALUES ('642', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行。\r\n打开控制面板，卸载程序。\r\n点击-查看已安装的更新。\r\n找到IE11并卸载。完成后重启电脑。\r\n', '韦彬', '10', '2017-01-18 12:26:29');
INSERT INTO `simple_test_paper` VALUES ('643', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '点击工具-Internet选项。\r\n选择 安全，把每个区域设置的自定义级别到调到最低或全部选启用。\r\n再把*.haier.com和*.haier.net添加到可信站点。\r\n选择 隐私，取消勾选的打开弹出窗口阻止程序。取消勾选禁用工具栏和扩选。', '韦彬', '15', '2017-01-18 12:26:29');
INSERT INTO `simple_test_paper` VALUES ('644', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可以\r\n在电脑控控制面板所有控制面板项程序和功能，查看已安装的更新，找到IE11的更新选项，卸载即可', '宋晓林', '10', '2017-01-18 12:46:43');
INSERT INTO `simple_test_paper` VALUES ('645', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '设置信任项，自定义安全级别改为低，添加相关网址信任并添加兼容模式', '宋晓林', '10', '2017-01-18 12:46:43');
INSERT INTO `simple_test_paper` VALUES ('646', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行，打开控制面板，找到程序和功能打开后勾选已安装的更新找到IE版本，一直卸载到IE8即可。', '孟世超', '15', '2017-01-18 13:32:25');
INSERT INTO `simple_test_paper` VALUES ('647', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '设置internet选项安全选项全部设置为低，如果没最低，选择自定义手动设置，隐私选项中去掉弹窗阻止程序，internet区域设置拉至低，高级中勾选安全中允许运行或安装软件，即使签名无效。顺便勾选打印背景颜色和图像。然后英勇确定', '孟世超', '10', '2017-01-18 13:32:25');
INSERT INTO `simple_test_paper` VALUES ('648', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可以降级，步骤为“点击开始-控制面板-程序和功能-单击查看已安装的更新”然后在列表中选择IE11，单击上方删除', '周宇翔', '10', '2017-01-18 13:33:47');
INSERT INTO `simple_test_paper` VALUES ('649', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '把海尔内网地址添加进本地信任站点内，将本地信任站点的安全级别调至中低，然后关闭弹出窗口阻止', '周宇翔', '10', '2017-01-18 13:33:47');
INSERT INTO `simple_test_paper` VALUES ('650', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '打开计算机—卸载或更改程序—查看已安装的更新在此页面中找到Internet Explorer9或10或11并卸载，卸载后需要重启。如果之前浏览器是一步一步安装到10或11版本，每次卸载后还需要卸载更低版本的IE直到降为IE8.\r\n', '揭志鹏', '15', '2017-01-18 13:37:37');
INSERT INTO `simple_test_paper` VALUES ('651', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '打开Internet选项，设置p.haier.com为首页。切换到安全选项卡，选择本地Intranet并将安全级别拉到最低。选择可信站点，并将安全级别降到最低，如果没有级别调整选项，使用默认级别按钮重置。点击站点按钮，取消勾选对该区域中所有站点要求服务器验证https，并将*.haier.com和*.haier.net添加。切换到隐私选项卡并取消勾选启用弹窗阻止程序。切换到内容选项卡，并点击清除SSL状态。然后点击确定关闭此页面。', '揭志鹏', '15', '2017-01-18 13:37:37');
INSERT INTO `simple_test_paper` VALUES ('652', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '答：可行\r\n单击“开始”按钮，点击控制面板，找到“程序和功能”，然后单击左窗格中的“查看已安装的更新”；\r\n在“卸载更新”下，向下滚动到“Microsoft Windows”部分；\r\n右键单击“Windows Internet Explorer 11”，单击“卸载”，然后在出现提示时单击“是”；\r\n单击以下选项之一：\r\n立即重新启动（完成 Internet Explorer 11 卸载过程，恢复以前的 Internet Explorer 版本）；\r\n稍后重新启动（等待手动关闭或重新启动电脑）。\r\n然后即可自动回复ie8。', '黄龙', '15', '2017-01-18 13:41:19');
INSERT INTO `simple_test_paper` VALUES ('653', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '答：1.添加*.haier.com、*.haier.net信任站点，取消https验证，并将信任站点安全级别调为最低\r\n    2.取消弹出窗口阻止程序\r\n    3.调整IE浏览器安全级别', '黄龙', '15', '2017-01-18 13:41:19');
INSERT INTO `simple_test_paper` VALUES ('654', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可以，打开控制面板，在程序中找到已安装的更新。找到IE11卸载后重启即可，如果没有更低版本，可上网上寻找IE8的安装包进行安装', '郭旭', '15', '2017-01-18 13:49:53');
INSERT INTO `simple_test_paper` VALUES ('655', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '对Internet选项进行设置，切换到安全选项卡，选择本地internet并将安全级别调整为自定义，将其中的允许JAVA插件，active视图，签名等需要进行调整的选项启用。在可信任站点添加*.haier.com和*.haier.net等网址。在隐私选项卡。取消允许阻止弹窗选项', '郭旭', '15', '2017-01-18 13:49:53');
INSERT INTO `simple_test_paper` VALUES ('656', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '答：可以降级\r\n\r\n登陆管理员帐户，打开控制面板-程序和功能-查看已安装的更新-找到IE11-卸载-重启电脑。', '李强', '10', '2017-01-18 14:06:51');
INSERT INTO `simple_test_paper` VALUES ('657', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '答：把用户需要使用的系统域名或IP地址添加进受信任站点，然后把受信站点的安全级别重置为低，关闭弹出窗口阻止程序，如果是IE11还需要把常用域名或IP地址加入兼容性视图站点。', '李强', '10', '2017-01-18 14:06:51');
INSERT INTO `simple_test_paper` VALUES ('658', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '在控制面板打开“程序和功能”，单击“查看已安装的更新”；\r\n找到IE11更新右键单击“Windows Internet Explorer 11”，单击“卸载”重新启动后完成 Internet Explorer 11 卸载过程然后即可自动回复ie8。', '赵明炜', '15', '2017-01-18 14:13:55');
INSERT INTO `simple_test_paper` VALUES ('659', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', 'Internet选项里，选择安全选项，点击自定义级别。启用ActiveX  控件和插件。添加站点为可信任。', '赵明炜', '10', '2017-01-18 14:13:55');
INSERT INTO `simple_test_paper` VALUES ('660', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行，在安装与卸载程序里卸载掉ie11的最新更新包然后重启电脑。', '刘寅', '15', '2017-01-18 14:15:44');
INSERT INTO `simple_test_paper` VALUES ('661', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '重置ie浏览器设置，删除个性化设置，添加信任站点，打开active插部分java插件选项。', '刘寅', '10', '2017-01-18 14:15:44');
INSERT INTO `simple_test_paper` VALUES ('662', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '打开控制面板，然后向下滚动到“Microsoft Windows”部分；\r\n卸载Windows Internet Explorer 11，；\r\n单击立即重新启动或稍后重新启动即可自动回复ie8。', '徐甘', '15', '2017-01-18 14:19:34');
INSERT INTO `simple_test_paper` VALUES ('663', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', 'Internet选项-安全-自定义级别-ActiveX控件和插件选项选择启用。', '徐甘', '10', '2017-01-18 14:19:34');
INSERT INTO `simple_test_paper` VALUES ('664', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行；\r\n打开控制面板。选择【卸载程序】选项，查看已经安装的更新，\r\n找到新的IE版本更新，然后右击卸载，重启计算机，IE恢复为系统初始版本。\r\n', '邱成龙', '15', '2017-01-18 14:22:22');
INSERT INTO `simple_test_paper` VALUES ('665', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '调整IE主页，在安全选项卡中调整 Internet、本地Internet（Active控件和插件全部选为启用）、受信任的站点（添加*.haier.com、*.haier.net信任站点，取消https验证，并将信任站点安全级别调为最低），取消弹出窗口阻止程序\r\n', '邱成龙', '15', '2017-01-18 14:22:22');
INSERT INTO `simple_test_paper` VALUES ('666', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', 'Windows7系统降级为IE8浏览器，需要打开“计算机”—“卸载或更改程序”—“查看已安装的更新”\r\n在此页面中找到Internet Explorer9或10或11并卸载，卸载后需要重启。\r\n如果之前浏览器是一步一步安装到10或11版本，每次卸载后还需要卸载更低版本的IE直到降为IE8.\r\n', '郑勇', '15', '2017-01-18 14:23:39');
INSERT INTO `simple_test_paper` VALUES ('667', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1.打开Internet选项，设置p.haier.com为首页\r\n2.切换到安全选项卡，选择本地Intranet并将安全级别拉到最低。\r\n3.选择“可信站点”并将安全级别降到最低，如果没有级别调整选项，使用默认级别按钮重置。点击“站点”按钮，取消勾选“对该区域中所有站点要求服务器验证https\r\n”，并将*.haier.com和*.haier.net添加。\r\n4.切换到“隐私”选项卡并取消勾选“启用弹窗阻止程序”。\r\n最后点击应用，点击确定退出。设置完成。', '郑勇', '15', '2017-01-18 14:23:39');
INSERT INTO `simple_test_paper` VALUES ('668', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可以卸载，需要在控制面板-程序和功能-已安装更新里面卸载IE11的更新即可', '邱冠桦', '10', '2017-01-18 14:24:00');
INSERT INTO `simple_test_paper` VALUES ('669', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '确定是否为IE8，然后修改安全选项，添加可信任站点等。', '邱冠桦', '5', '2017-01-18 14:24:00');
INSERT INTO `simple_test_paper` VALUES ('670', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行。\r\n1.首先，打开开始菜单，然后直接在搜索框中输入“程序和功能“并单击回车。\r\n2.点击左侧菜单中的卸载程序，然后在窗口中列表出现的项目中找到Windows Internet Explorer 11这一项，这便是IE11代表的补丁升级了，咱们右键点击，选择菜单中的卸载，等待卸载完成之后，咱们就会发现IE被降级到IE10的版本，想要降级到IE8，也只能是一级一级的进行卸载了!', '薛孟', '15', '2017-01-18 14:24:18');
INSERT INTO `simple_test_paper` VALUES ('671', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '更改internet选项，首先打开internet选项，打开“安全”--internet---自定义级别---启用部分插件！', '薛孟', '10', '2017-01-18 14:24:18');
INSERT INTO `simple_test_paper` VALUES ('672', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '首先确定系统是否自带有IE8 即：开始 -控制面板- 程序和功能 点击“查看已安装的更新” 查看是否有IE11的安装更新 如果有说明系统自带IE8升级上来的 点击删除更新即可降级为IE8 若是没有说明系统不自带需要通过官方下载安装包更新解决', '杨程钧', '15', '2017-01-18 14:27:55');
INSERT INTO `simple_test_paper` VALUES ('673', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1.添加海尔网页到信任站点\r\n2.开启浏览器兼容模式\r\n3.安全等级选项卡设置为默认', '杨程钧', '10', '2017-01-18 14:27:55');
INSERT INTO `simple_test_paper` VALUES ('674', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '答：Windows7系统降级为IE8浏览器，需要先打开-计算机”—卸载或更改程序—查看已安装的更新在此页面中找到Internet Explorer11并卸载，此时版本为Explorer10然后重复以上步骤直到版本为Explorer8，卸载后需要重启。\r\n', '孙宏宇', '15', '2017-01-18 14:35:29');
INSERT INTO `simple_test_paper` VALUES ('675', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '答：设置ie的安全级别为最低，把*.haier.com和*.haier.net添加为信任站点。', '孙宏宇', '10', '2017-01-18 14:35:29');
INSERT INTO `simple_test_paper` VALUES ('676', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行\r\n打开“计算机”—“卸载或更改程序”—“查看已安装的更新\r\n在此页面中找到Internet Explorer9或10或11并卸载，卸载后需要重启。\r\n如果之前浏览器是一步一步安装到10或11版本，每次卸载后还需要卸载更低版本的IE直到降为IE8.\r\n', '朱红波', '15', '2017-01-18 14:35:59');
INSERT INTO `simple_test_paper` VALUES ('677', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1.打开Internet选项,\r\n2.设置p.haier.com为首页\r\n3.切换到安全选项卡，选择本地Intranet并将安全级别拉到最低\r\n4.选择“可信站点”并将安全级别降到最低，如果没有级别调整选项，使用默认级别按钮重置\r\n5.点击“站点”按钮，取消勾选“对该区域中所有站点要求服务器验证https，并将*.haier.com和*.haier.net添加\r\n6.切换到“隐私”选项卡并取消勾选“启用弹窗阻止程序\r\n7.切换到“内容”选项卡，并点击“清除SSL”状态然后点击“确定”关闭此页面\r\n', '朱红波', '15', '2017-01-18 14:35:59');
INSERT INTO `simple_test_paper` VALUES ('678', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可以，开始控制面板选择Windows Update查看更新历史记录，选择IE11卸载即可。', '阎飞', '10', '2017-01-18 14:36:14');
INSERT INTO `simple_test_paper` VALUES ('679', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '添加可信任站点，设置安全级别为低，取消启用窗口阻止程序', '阎飞', '10', '2017-01-18 14:36:14');
INSERT INTO `simple_test_paper` VALUES ('680', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行。 升级IE11补丁后 卸载IE11浏览器，并安装IE8浏览器。', '蔡逢阳', '10', '2017-01-18 14:37:20');
INSERT INTO `simple_test_paper` VALUES ('681', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '清理浏览器缓存。\r\n添加海尔信任网址。', '蔡逢阳', '10', '2017-01-18 14:37:20');
INSERT INTO `simple_test_paper` VALUES ('682', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行。控制面板-卸载程序-查看已安装的更新-卸载IE11-重启电脑。', '刘福春', '10', '2017-01-18 14:41:59');
INSERT INTO `simple_test_paper` VALUES ('683', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1.设置门户首页\r\n2.添加加*.haier.com、*.haier.net信任站点，取消https验证，并将信任站点安全级别调为最低；\r\n3.可信站点的自定义里 开启 activeX控件\r\n4.取消弹出窗口阻止程序；\r\n5.导入nac证书，门户认证证书\r\n6.高级里 勾掉 检查发行商的证书是否吊销 和 检查服务器证书吊销。\r\n', '刘福春', '15', '2017-01-18 14:41:59');
INSERT INTO `simple_test_paper` VALUES ('684', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行\r\n需要打开“计算机”—“卸载或更改程序”—“查看已安装的更新”。在此页面中找到Internet Explorer9或10或11并卸载，卸载后需要重启。\r\n如果之前浏览器是一步一步安装到10或11版本，每次卸载后还需要卸载更低版本的IE直到降为IE8\r\n', '刘东昌', '15', '2017-01-18 14:42:59');
INSERT INTO `simple_test_paper` VALUES ('685', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '打开IE浏览器，依次选择菜单栏工具——internet选项。\r\n切换到安全选项卡，选择本地Intranet并将安全级别拉到最低。\r\n选择“可信站点”并将安全级别降到最低，如果没有级别调整选项，使用默认级别按钮重置。\r\n点击“站点”按钮，取消勾选“对该区域中所有站点要求服务器验证https\r\n”，并将*.haier.com和*.haier.net添加。\r\n切换到“隐私”选项卡并取消勾选“启用弹窗阻止程序”。\r\n切换到“内容”选项卡，并点击“清除SSL”状态。\r\n然后点击“确定”关闭此页面。', '刘东昌', '15', '2017-01-18 14:42:59');
INSERT INTO `simple_test_paper` VALUES ('686', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', 'Windows7系统可以降级为IE8浏览器，具体步骤为：打开“计算机”—“卸载或更改程序”—“查看已安装的更新”。在此页面中找到Internet Explorer9或10或11并卸载，卸载后需要重启。\r\n如果之前浏览器是一步一步安装到10或11版本，每次卸载后还需要卸载更低版本的IE直到降为IE8.\r\n', '刘刚', '15', '2017-01-18 14:43:13');
INSERT INTO `simple_test_paper` VALUES ('687', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '因为Haier集团绝大多数的内网应用都是基于IE8开发的，所以用户电脑如不是IE8浏览器，需要先将浏览器升级或降级为IE8。所以一。查看浏览器版本，确定为IE8;二．重置IE浏览器：切换到安全选项卡，选择本地Intranet并将安全级别拉到最低。选择“可信站点”并将安全级别降到最低，如果没有级别调整选项，使用默认级别按钮重置。点击“站点”按钮，取消勾选“对该区域中所有站点要求服务器验证https\r\n”，并将*.haier.com和*.haier.net添加。切换到“隐私”选项卡并取消勾选“启用弹窗阻止程序”。切换到“内容”选项卡，并点击“清除SSL”状态。然后点击“确定”关闭此页面。\r\n', '刘刚', '15', '2017-01-18 14:43:13');
INSERT INTO `simple_test_paper` VALUES ('688', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '答:可以降级。\r\n 步骤：打开计算机-卸载或更改程序-查看安装的更新，然后找到页面中的Internet explorer9或者10及11并点击卸载，然后从启，直到降到Ie8.', '黄荣杰', '15', '2017-01-18 14:44:12');
INSERT INTO `simple_test_paper` VALUES ('689', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '答：打开浏览器，设置p.haier.com为首页。把本地安全级别降到最低，可信站点降到最低。在信任站点中添加*.haier.com,*.haier.net,并取消区域中所有站点要求服务器验证https.清除浏览历史和ssl状态。', '黄荣杰', '15', '2017-01-18 14:44:12');
INSERT INTO `simple_test_paper` VALUES ('690', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '1、单击“开始”按钮，在搜索框中键入“程序和功能”，然后单击左窗格中的“查看已安装的更新”。2、在“卸载更新”下，向下滚动到“Microsoft Windows”部分。3、右键单击“Windows Internet Explorer 11”，单击“卸载”，然后在出现提示时单击“是”。4、单击以下选项之一：(1) 立即重新启动（完成 Internet Explorer 11 卸载过程，恢复以前的 Internet Explorer 版本）。 (2) 稍后重新启动（等待您关闭或重新启动电脑）。', '刘凯', '15', '2017-01-18 14:44:21');
INSERT INTO `simple_test_paper` VALUES ('691', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1 首先确认有加域的四套软件，趋势 DLP NAC smartIT，如果没             有需要安装和桌面标准化，然后在管理员权限下配置域账号，检查域账号是否有管理员权限如果不是就添加该域账号管理员权限，切换域账号登陆对IE进行相关设置。\r\n2 鼠标右键点击IE属性-安全将里面的四个选项级别设置为最低-隐私-把启用窗口组织去掉，最后根据用户的需要在设置IE', '刘凯', '15', '2017-01-18 14:44:21');
INSERT INTO `simple_test_paper` VALUES ('692', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '答：是可行的。首先打开控制面板，找到程序和功能这一项，然后在右边的查看已安装的更新中找到IE11，直接删除就可以了。', '王亮', '10', '2017-01-18 14:48:31');
INSERT INTO `simple_test_paper` VALUES ('693', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '答：关闭阻止弹出窗口程序，打开IETERNET选项，在安全这一项中，将本地intranet中的有关ACTIVEX控件中的选项全部改为启用即可。', '王亮', '10', '2017-01-18 14:48:31');
INSERT INTO `simple_test_paper` VALUES ('694', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可以将win7系统浏览器降级为ie8\r\n1.打开控制面板-程序和功能-查看已安装的更新。\r\n2.在右上角搜索中搜索Windows Internet Explorer 11更新补丁，找到该补丁后将其右键卸载并重启电脑。\r\n3.若重启后ie版本为9或10，需要重复上述操作将ie10或9的更新补丁逐步卸载直至降级为ie8。\r\n', '黄丽云', '15', '2017-01-18 14:51:48');
INSERT INTO `simple_test_paper` VALUES ('695', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1、点击浏览器菜单栏中工具-Internet选项，在常规选项卡中将p.haier.com设为主页\r\n2、在安全选项卡中选择本地Internet，将安全级别拉至最低。\r\n3、选择可信站点，同样将安全级别拉至最低，若无法调整先点击默认级别重置。\r\n4、点击站点按钮，取消勾选“对该区域中的所有站点要求服务器验证（https:）”并添加*.haier.com和*.haier.net\r\n5、在隐私选项卡中取消勾选“启用弹窗阻止程序”\r\n6、在内容选项卡中，点击“清除SSL状态”点击确定关闭此页面。\r\n', '黄丽云', '15', '2017-01-18 14:51:48');
INSERT INTO `simple_test_paper` VALUES ('696', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可以降为IE8 打开控制面板 添加删除程序 查看已安装的更新 找到IE11卸载即可', '毕凡', '10', '2017-01-18 14:54:39');
INSERT INTO `simple_test_paper` VALUES ('697', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '打开浏览器属性 安全自定义 把ActiveX控件和插件启动 关闭弹出窗口阻止  启动 通过域访问数据源', '毕凡', '10', '2017-01-18 14:54:39');
INSERT INTO `simple_test_paper` VALUES ('698', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '            不行    原因：  首先要使用的是Windows7操作系统，如果使用的是Windows8或8.1则最低浏览器版本为IE11，无法降级。\r\n可行     Windows7系统降级为IE8浏览器，需要打开“计算机”—“卸载或更改程序”—“查看已安装的更新” 为用户卸载到ie8   找到Internet Explorer9或10或11并卸载，卸载后需要重启。\r\n如果之前浏览器是一步一步安装到10或11版本，每次卸载后还需要卸载更低版本的IE直到降为IE8.\r\n\r\n', '徐已轩', '15', '2017-01-18 14:54:57');
INSERT INTO `simple_test_paper` VALUES ('699', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '   勾选“删除个性化设置”，然后点重置。重置完成后重新打开浏览器测试故障是否消失\r\n    重启浏览器后再次打开Internet选项，设置p.haier.com为首页                                                       \r\n    切换到安全选项卡，选择本地Intranet并将安全级别拉到最低。\r\n   选择“可信站点”并将安全级别降到最低，如果没有级别调整选项，使用默认级别按钮重置。\r\n    点击“站点”按钮，取消勾选“对该区域中所有站点要求服务器验证https\r\n”，并将*.haier.com和*.haier.net添加。\r\n    切换到“隐私”选项卡并取消勾选“启用弹窗阻止程序”\r\n    切换到“内容”选项卡，并点击“清除SSL”状态\r\n    最后点确定\r\n\r\n\r\n\r\n     \r\n', '徐已轩', '15', '2017-01-18 14:54:57');
INSERT INTO `simple_test_paper` VALUES ('700', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '答：WIN7电脑安装IE11可以降级IE8\r\n打开计算机—卸载或更改程序—查看已安装的更新，在此页面中找到Internet Explorer11并卸载，卸载后需要重启。\r\n如果之前浏览器是一步一步安装到10或11版本，每次卸载后还需要卸载更低版本的IE直到降为IE8。\r\n', '梁飞风', '15', '2017-01-18 14:58:29');
INSERT INTO `simple_test_paper` VALUES ('701', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1：打开Internet选项，设置p.haier.com为首页\r\n2：切换到安全选项卡，选择本地Intranet并将安全级别拉到最低\r\n3：选择“可信站点”并将安全级别降到最低，如果没有级别调整选项，使用默认级别按钮重置\r\n4：点击“站点”按钮，取消勾选“对该区域中所有站点要求服务器验证https”，并将*.haier.com和*.haier.net添加\r\n5：切换到“隐私”选项卡并取消勾选“启用弹窗阻止程序”。', '梁飞风', '15', '2017-01-18 14:58:29');
INSERT INTO `simple_test_paper` VALUES ('702', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行，打开控制面板选择程序和功能，然后在左边选择查看已安装的更新，等右边加载出来所有的更新信息后找到Windows Internet Explorer 11   注意不要先卸载语言包，这样可能造成IE11无法卸载，直接卸载IE11。', '严从政', '10', '2017-01-18 14:58:30');
INSERT INTO `simple_test_paper` VALUES ('703', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '先重置浏览器设置，然后清除浏览器缓存文件，再添加需要添加的海尔网站到可信站点。', '严从政', '10', '2017-01-18 14:58:30');
INSERT INTO `simple_test_paper` VALUES ('704', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行\r\n开始菜单-控制面板-卸载程序-查看已安装更新-卸载ie11的更新', '刘佳林', '10', '2017-01-18 15:01:29');
INSERT INTO `simple_test_paper` VALUES ('705', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1.设置首页p.haier.com\r\n2.添加加*.haier.com、*.haier.net信任站点，取消https验证，  并将信任站点安全级别调为最低\r\n3.取消弹出窗口阻止程序\r\n4.导入门户证书\r\n5.取消高级菜单中检查发行商的证书是否吊销和检查服务器证书吊销\r\n6.将安全站点的自定义级别全部改为启用或提示\r\n7.添加兼容性视图', '刘佳林', '15', '2017-01-18 15:01:29');
INSERT INTO `simple_test_paper` VALUES ('706', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '答：可以降级。\r\n1、为防止报错，以管理员帐号登录系统。\r\n2、打开控制面板---添加删除程序---查看已安装的更新，找到IE的更新补丁，卸载。\r\n3、重启电脑，会提示正在更新系统，进入桌面，查看浏览器版本。\r\n4、有的电脑会直接降到IE8，有的会降到10，再执行2、3步骤。', '李扬', '15', '2017-01-18 15:01:38');
INSERT INTO `simple_test_paper` VALUES ('707', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '答：1、打开浏览器---工具，关闭弹出窗口阻止程序。 \r\n    2、进入internet选项，站点--可信任站点，查看*.haier.com和×.haier.net是否已经加入可信任站点，没有，要加入。\r\n    3、单击自定义级别，将ActiveX控件和提示至下载已签名的ActiveX控件，都设为启用；并将浏览器级别设为低。', '李扬', '15', '2017-01-18 15:01:38');
INSERT INTO `simple_test_paper` VALUES ('708', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '答：可行\r\n步骤：\r\n1、打开控制面板，找到程序和功能\r\n2、添加删除程序，找到IE11\r\n3、去掉前面对勾\r\n4、查看已安装的更新找到IE11，卸载掉\r\n5、重启电脑\r\n', '高平歌', '10', '2017-01-18 15:03:07');
INSERT INTO `simple_test_paper` VALUES ('709', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '答：1、设置浏览器主页\r\n    2、更改工具选项卡下Internet选项\r\n    3、本地intranet安全级别设置到最低\r\n    4、隐私设置到最低\r\n    5、Internet安全脚本以前全部启用\r\n    6、安全选项卡：受信任站点要求服务器验证去掉对勾\r\n    7、关闭弹出窗口阻止程序\r\n    8、去掉高级选项卡下检查发行商证书是否已吊销、发行商证书是否已吊销、所下载程序的签名前面的对勾\r\n    9、添加haier.com、haier.net到兼容性视图\r\n    10、添加haier.com、haier.net到信任站点', '高平歌', '15', '2017-01-18 15:03:07');
INSERT INTO `simple_test_paper` VALUES ('710', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '答：如果Windows7系统电脑安装了IE11是可以降级为IE8的\r\n1打开计算机—卸载或更改程序—查看已安装的更新\r\n2找到Internet Explorer9或10或11并卸载，卸载后需要重启。\r\n3如果之前浏览器是一步一步安装到10或11版本，每次卸载后还需要卸载更低版本的IE直到降为IE8.\r\n', '郭洋博', '15', '2017-01-18 15:07:35');
INSERT INTO `simple_test_paper` VALUES ('711', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '答：重置IE浏览器\r\n1打开浏览器—工具—internet选项，找到高级选项卡，点击重置。\r\n2勾选“删除个性化设置”，然后点重置。重置完成后重新打开浏览器测试故障是否消失。\r\n3重启浏览器后再次打Internet选项，设置p.haier.com为首页\r\n4切换到安全选项卡，选择本地Intranet并将安全级别拉到最低\r\n5选择“可信站点”并将安全级别降到最低，如果没有级别调整选项，使用默认级别按钮重置。点击“站点”按钮，取消勾选“对该区域中所有站点要求服务器验证https”，并将*.haier.com和*.haier.net添加。\r\n6切换到“隐私”选项卡并取消勾选“启用弹窗阻止程序”\r\n7切换到“内容”选项卡，并点击“清除SSL”状态，然后点击“确定”关闭此页面。', '郭洋博', '15', '2017-01-18 15:07:35');
INSERT INTO `simple_test_paper` VALUES ('712', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行;\r\nWindows7系统降级为IE8浏览器，需要打开“计算机”—“卸载或更改程序”—“查看已安装的更新”在此页面中找到Internet Explorer9或10或11并卸载，卸载后需要重启。\r\n如果之前浏览器是一步一步安装到10或11版本，每次卸载后还需要卸载更低版本的IE直到降为IE8。', '李冬冬', '15', '2017-01-18 15:09:43');
INSERT INTO `simple_test_paper` VALUES ('713', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '打开浏览器—工具—internet选项，找到高级选项卡，点击“重置”\r\n勾选“删除个性化设置”，然后点重置。重置完成后重新打开浏览器测试故障是否消失。重启浏览器后再次打开Internet选项，设置p.haier.com为首页\r\n切换到安全选项卡，选择本地Intranet并将安全级别拉到最低\r\n选择“可信站点”并将安全级别降到最低，如果没有级别调整选项，使用默认级别按钮重置。\r\n点击“站点”按钮，取消勾选“对该区域中所有站点要求服务器验证https\r\n”，并将*.haier.com和*.haier.net添加。\r\n切换到“隐私”选项卡并取消勾选“启用弹窗阻止程序”。\r\n切换到“内容”选项卡，并点击“清除SSL”状态\r\n然后点击“确定”关闭此页面\r\n', '李冬冬', '15', '2017-01-18 15:09:43');
INSERT INTO `simple_test_paper` VALUES ('714', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可以，打开控制面板然后点程序和功能，然后再点查看已安装的更新找到IE11点解卸载，卸载完以后IE是9，重启电脑再卸载一遍IE9然后重启就降到IE8了。如果在降级过程中提示报错说明系统有问题。', '郝丙伟', '15', '2017-01-18 15:11:49');
INSERT INTO `simple_test_paper` VALUES ('715', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '需要对浏览器把安全级别调到最低，然后把一些网站添加到受信任站点里面，再调试一下兼容性设置，设置成在在兼容性视图中显示所有网站', '郝丙伟', '15', '2017-01-18 15:11:49');
INSERT INTO `simple_test_paper` VALUES ('716', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '答：Windows7系统降级为IE8浏览器，需要打开“计算机”—“卸载或更改程序”—“查看已安装的更新”，在此页面中找到Internet Explorer9或10或11并卸载，卸载后需要重启。\r\n如果之前浏览器是一步一步安装到10或11版本，每次卸载后还需要卸载更低版本的IE直到降为IE8.', '倪涛', '15', '2017-01-18 15:11:51');
INSERT INTO `simple_test_paper` VALUES ('717', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '答：重置IE浏览器\r\n\r\n打开浏览器—工具—internet选项，找到高级选项卡，点击“重置”\r\n重启浏览器后再次打开Internet选项，设置p.haier.com为首页。\r\n切换到安全选项卡，选择本地Intranet并将安全级别拉到最低。\r\n选择“可信站点”并将安全级别降到最低，如果没有级别调整选项，使用默认级别按钮重置。\r\n点击“站点”按钮，取消勾选“对该区域中所有站点要求服务器验证https”，并将*.haier.com和*.haier.net添加。\r\n切换到“隐私”选项卡并取消勾选“启用弹窗阻止程序”。\r\n切换到“内容”选项卡，并点击“清除SSL”状态。\r\n', '倪涛', '15', '2017-01-18 15:11:51');
INSERT INTO `simple_test_paper` VALUES ('718', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行，在系统已安装的更新中找到IE11，卸载掉后重启，回到以前版本，如果还不是ie8，重复上述操作卸载上次版本可以降级到IE8。', '徐德欣', '15', '2017-01-18 15:12:40');
INSERT INTO `simple_test_paper` VALUES ('719', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '设置浏览器internet选项，取消站点服务器验证，将*.haier.com和*.haier.net添加到信任站点中，在安全级别选择自定义并设置为低，重置后启用所有ActiveX控件和插件；关闭启用窗口弹出程序。', '徐德欣', '15', '2017-01-18 15:12:40');
INSERT INTO `simple_test_paper` VALUES ('720', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '答：可行。1.打开电脑的开始菜单里的控制面板 2.点开卸载程序  3.查看已安装的更新点开。4.找到IE11的更新包，将其卸载，重启电脑，查看是否已经将为IE8. ', '耿晓琳', '15', '2017-01-18 15:14:47');
INSERT INTO `simple_test_paper` VALUES ('721', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1.打开工具菜单。调interner选项里的安全性选项里的信任站点里的站点，添加上haier.net,haier.com  2.调本地intranet选项里重置自定义设置，设为低。将列表里该调的点启用。3.在隐私里将弹出窗口阻止程序里的勾去掉。4.调一下兼容性视图。', '耿晓琳', '15', '2017-01-18 15:14:47');
INSERT INTO `simple_test_paper` VALUES ('722', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', ' 可以。\r\n在控制面板-程序和功能里面，查看已安装的更新，，找到IE11，删除掉。\r\n再查看打开或关闭WINDOWS功能里是否有IE8，重启后即可。', '王成亮', '15', '2017-01-18 15:17:07');
INSERT INTO `simple_test_paper` VALUES ('723', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1、关闭弹出窗口阻止程序\r\n2、接受所有cookie为全部允许\r\n3、将*.haier.com,*.haier.net添加到信任站点\r\n4、调整信任站点的安全级别', '王成亮', '15', '2017-01-18 15:17:07');
INSERT INTO `simple_test_paper` VALUES ('724', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '答：单击开始按钮，在搜索框中键入程序和功能，然后单击左窗格中的查看已安装的更新，在卸载更新下，向下滚动到Microsoft Windows部分，右键单击Windows Internet Explorer 11，单击卸载，然后在出现提示时单击是，之后重启计算机后正常。\r\n', '刘栋', '15', '2017-01-18 15:20:03');
INSERT INTO `simple_test_paper` VALUES ('725', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '答：1：关闭弹出阻止窗口\r\n    2：在Internet属性-安全中的自定义级别里把：ActiveX 控件和插件点启用\r\n    3：在Internet属性-安全中的自定义级别里把：通过域访问数据源点启用\r\n    4：在Internet属性-高级选项里找到正在打印在打印背景颜色和图像前打勾\r\n', '刘栋', '10', '2017-01-18 15:20:03');
INSERT INTO `simple_test_paper` VALUES ('726', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '打开控制面板，卸载程序，查看已安装的更新，找到IE11的更新，卸载就可以了。', '王亚洲', '10', '2017-01-18 15:27:22');
INSERT INTO `simple_test_paper` VALUES ('727', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '打开IE，1，在工具里调试“兼容性视图设置”把勾全部去掉；2，工具里面调试“internet\"，安全和隐私下拉条拉到最低。把”站点“和”隐私“的勾去掉，然后在”自定义级别设置“里面把Activex插件和控件全部启用。', '王亚洲', '10', '2017-01-18 15:27:22');
INSERT INTO `simple_test_paper` VALUES ('728', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', 'WIN7可以将IE降级至8。\r\n1.打开控制面板\r\n2.打开程序和功能\r\n3.打开查看已安装的更新\r\n4.卸载IE11安装包', '赵恒明', '10', '2017-01-18 15:30:47');
INSERT INTO `simple_test_paper` VALUES ('729', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1.添加*.haier.net *.haier.com至受信任组\r\n2.打开ACTION功能全部权限\r\n', '赵恒明', '15', '2017-01-18 15:30:47');
INSERT INTO `simple_test_paper` VALUES ('730', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', 'WIN7可以将IE降级至8。\r\n1.打开控制面板\r\n2.打开程序和功能\r\n3.打开查看已安装的更新\r\n4.卸载IE11安装包', '许锋', '10', '2017-01-18 15:32:41');
INSERT INTO `simple_test_paper` VALUES ('731', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '', '许锋', '0', '2017-01-18 15:32:41');
INSERT INTO `simple_test_paper` VALUES ('732', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可以。\r\n在控制面板中-卸载-已安装的更新-IE11升级包-卸载更新-重启电脑。\r\n重启后检查已安装的更新中IE版本，如果现实IE10，重复上面的步骤。直至卸载到IE8', '王旭', '15', '2017-01-18 15:34:08');
INSERT INTO `simple_test_paper` VALUES ('733', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '设置安全站点，设置打印水印，将个别网址加入到安全站点，调试信任站点中的设置。导入收藏夹网址。', '王旭', '10', '2017-01-18 15:34:08');
INSERT INTO `simple_test_paper` VALUES ('734', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '1使用批处理卸载  命令行输入 FORFILES /P %WINDIR%servicingPackages /M Microsoft-Windows-InternetExplorer-*11.*.mum /c \"cmd /c echo Uninstalling package @fname && start /w pkgmgr /up:@fname /quiet /norestart\r\n\r\n2使用程序和功能-查看已安装的更新-中卸载IE11', '孟祥来', '10', '2017-01-18 15:38:20');
INSERT INTO `simple_test_paper` VALUES ('735', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1切换到\"安全\"选项卡点击“站点”按钮，取消勾选“对该区域中所有站点要求服务器验证https”，并将*.haier.com和*.haier.net添加。\r\n2切换到“隐私”选项卡并取消勾选“启用弹窗阻止程序”。\r\n3切换到“内容”选项卡，并点击“清除SSL”状态。然后点击“确定”关闭此页面。\r\n4将portal.haier.com 设置为主页', '孟祥来', '15', '2017-01-18 15:38:20');
INSERT INTO `simple_test_paper` VALUES ('736', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '1、如果系统以前是IE吧因为WINDOWSUPDATE更新为IE11，打开控制面板--卸载程序--查看已安装的更新--卸载IE11，重启电脑后还原为1E8.\r\n2、如原来版本为IE9以上，则需要重新安装带IE8镜像的系统，现在百度软件提供的 IE8已不可再WIN7系统中使用。', '代生灿', '15', '2017-01-18 15:39:50');
INSERT INTO `simple_test_paper` VALUES ('737', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1、因为系统主要使用IE8，需要开启兼容模式，或则选择在所有网站中使用兼容模式。\r\n2、INTERNET选项--安全--自定义选项中根据所IE需要的工作环境选择打开或关系显示混合内容、阻止弹出窗口等选项。', '代生灿', '10', '2017-01-18 15:39:50');
INSERT INTO `simple_test_paper` VALUES ('738', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可以降级到IE8\r\n具体步骤如下\r\n1 打开“计算机”—“卸载或更改程序”—“查看已安装的更新”\r\n2 在此页面中找到Internet Explorer9或10或11并卸载，卸载后需要重启。\r\n3 如果之前浏览器是一步一步安装到10或11版本，每次卸载后还需要卸载更低版本的IE直到降为IE8.\r\n', '李军帅', '15', '2017-01-18 15:42:01');
INSERT INTO `simple_test_paper` VALUES ('739', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '具体操作如下\r\n1 打开浏览器—工具—internet选项，找到高级选项卡，点击“重置”，勾选“删除个性化设置”，然后点重置。\r\n2 重启浏览器后再次打开Internet选项，设置p.haier.com为首页\r\n3 切换到安全选项卡，选择本地Intranet并将安全级别拉到最低\r\n4 选择“可信站点”并将安全级别降到最低，如果没有级别调整选项，使用默认级别按钮重置\r\n5 点击“站点”按钮，取消勾选“对该区域中所有站点要求服务器验证https”，并将*.haier.com和*.haier.net添加。\r\n6 切换到“隐私”选项卡并取消勾选“启用弹窗阻止程序”。\r\n7 切换到“内容”选项卡，并点击“清除SSL”状态。然后点击“确定”关闭此页面', '李军帅', '15', '2017-01-18 15:42:01');
INSERT INTO `simple_test_paper` VALUES ('740', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行，首先打开“计算机”—“卸载或更改程序”—“查看已安装的更新”\r\n然后找到Internet Explorer9或10或11并卸载，卸载后需要重启。\r\n如果之前浏览器是一步一步安装到10或11版本，每次卸载后还需要卸载更低版本的IE直到降为IE8.\r\n', '文超', '15', '2017-01-18 15:43:14');
INSERT INTO `simple_test_paper` VALUES ('741', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '首先打开Internet选项，设置 p.haier.com为首页，然后切换到安全选项卡，选择本地Intranet并将安全级别拉到最低。选择“可信站点”并将安全级别降到最低，如果没有级别调整选项，使用默认级别按钮重置，然后点击“站点”按钮，取消勾选“对该区域中所有站点要求服务器验证https”，并将*. haier.com和*. haier.net添加。切换到“隐私”选项卡并取消勾选“启用弹窗阻止程序”。切换到“内容”选项卡，并点击“清除SSL”状态。最后点击“确定”后关闭此页面即可。', '文超', '15', '2017-01-18 15:43:14');
INSERT INTO `simple_test_paper` VALUES ('742', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行，在控制面板删除已安装的更新，重启', '张天星', '10', '2017-01-18 15:43:37');
INSERT INTO `simple_test_paper` VALUES ('743', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '关闭弹窗，启用插件', '张天星', '10', '2017-01-18 15:43:37');
INSERT INTO `simple_test_paper` VALUES ('744', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '答：1.可以降低IE为IE8\r\n2.具体步骤：\r\n打开控制面板->卸载程序->查看已安装的更新->找到IE11的更新程序右击卸载->卸载完成重启电脑\r\n', '牛延群', '10', '2017-01-18 15:43:55');
INSERT INTO `simple_test_paper` VALUES ('745', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '答：1.打开浏览器工具中的兼容视图设置，选择兼容所有网站并添加需要兼容的网站地址。\r\n2.打开浏览器的Internet选项，找到安全选项卡，设置受信任的站点，添加站点，设置自定义级别启用全部的ActiveX控件\r\n3.设置隐私项中取消启用弹出窗口阻止程序', '牛延群', '10', '2017-01-18 15:43:55');
INSERT INTO `simple_test_paper` VALUES ('746', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '需要打开“计算机”—“卸载或更改程序”—“查看已安装的更新”，在此页面中找到Internet Explorer11并卸载，卸载后需要重启。如果之前浏览器是一步一步安装到11版本，每次卸载后还需要卸载更低版本的IE直到降为IE8.\r\n', '曹磊', '15', '2017-01-18 15:48:08');
INSERT INTO `simple_test_paper` VALUES ('747', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '打开浏览器—工具—internet选项，找到高级选项卡，点击“重置”，勾选“删除个性化设置”，然后点重置。重启浏览器后再次打开Internet选项，设置p.haier.com为首页.切换到安全选项卡，选择本地Intranet并将安全级别拉到最低。\r\n', '曹磊', '10', '2017-01-18 15:48:08');
INSERT INTO `simple_test_paper` VALUES ('748', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行。\r\n控制面板卸载更新IE11，然后重新启动电脑即可。', '周德昌', '10', '2017-01-18 15:58:27');
INSERT INTO `simple_test_paper` VALUES ('749', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1.添加可信任站点。\r\n2.把可信任站点安全级别降到最低。\r\n3.安全级别中，自定义选项中全部改为启用。\r\n4.IE首页设置为“海尔门户”\r\n5.在隐私复选框中，弹出窗口阻止程序中，取消掉“启用弹出窗口阻止程序”。\r\n6在高级复选框中，取消掉“对证书地址不匹配发出警告”，“检查发行商的证书是否已吊销”。', '周德昌', '10', '2017-01-18 15:58:27');
INSERT INTO `simple_test_paper` VALUES ('750', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行\r\n 控制面板找到程序功能\r\n 选择查看已安装更新\r\n 找到ie11\r\n 选择卸载 卸载成功后重启即可', '曲开浩', '10', '2017-01-18 16:06:11');
INSERT INTO `simple_test_paper` VALUES ('751', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1.把haier.com haier.net添加兼容性视图\r\n2.把haier.com haier.net添加到安全站点同时把安全级别降到最低\r\n3.把自定义级别里的active控件里面的选项改为启用\r\n4.把隐私选项卡弹出窗口阻止程序的√取消', '曲开浩', '15', '2017-01-18 16:06:11');
INSERT INTO `simple_test_paper` VALUES ('752', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可以降级为IE8，开始--控制面板--卸载程序--查看已安装的更新--找到Windwons Internet Explorer 11卸载--重启电脑。', '王斌', '10', '2017-01-18 16:17:21');
INSERT INTO `simple_test_paper` VALUES ('753', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1.添加可信任站点：*.haier.com和*.haier.net\r\n2.这只可信任站点的自定义级别，把有关ActiveX的选项启用\r\n3.取消弹出窗口阻止程序\r\n4.把用户常用的网站加入可信站点\r\n5.浏览器导入NAC证书\r\n', '王斌', '15', '2017-01-18 16:17:21');
INSERT INTO `simple_test_paper` VALUES ('754', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行。步骤为开始-控制面板-程序和功能-查看已安装的更新-找到IE11卸载-然后重启电脑就降级为IE8', '李可湘', '10', '2017-01-18 16:22:26');
INSERT INTO `simple_test_paper` VALUES ('755', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', 'ActiveX控件和插件里面的选项全启用，其他选项里面的通过域访问数据源也启用，下载里面的选项也全全部启用，方便下载报表。', '李可湘', '10', '2017-01-18 16:22:26');
INSERT INTO `simple_test_paper` VALUES ('756', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '计算机-卸载-查看已安装更新-找到internet Explorer11卸载到internet Explorer8为止', '高雄雄', '15', '2017-01-18 16:24:07');
INSERT INTO `simple_test_paper` VALUES ('757', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '打开ie8选项设置p.haier.com为首页，将安全级别降到最低 可信站点取消勾选对该区域所有服务器验证 取消 启用弹窗阻止程序 清楚ssl 然后确定', '高雄雄', '10', '2017-01-18 16:24:07');
INSERT INTO `simple_test_paper` VALUES ('758', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可以！在控制面板里面找到已安装的更新，然后卸载掉高版本呢的IE，低版本的自动启用，如果还有ie8高的版本，接着卸载，直到ie8为止。', '朱帅', '15', '2017-01-18 16:27:26');
INSERT INTO `simple_test_paper` VALUES ('759', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '', '朱帅', '0', '2017-01-18 16:27:26');
INSERT INTO `simple_test_paper` VALUES ('760', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可行\r\n开始--控制面板--卸载程序--查看已安装的更新--找到iternet exploer11--重启电脑。', '孙涛', '10', '2017-01-18 16:27:41');
INSERT INTO `simple_test_paper` VALUES ('761', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '\r\n1.添加*.haier.com、*.haier.net信任站点\r\n2.可信站点的自定义级别,开启有关ActiveX的选项\r\n3.自定义级别，取消弹出窗口阻止程序\r\n4.导入nac证书', '孙涛', '15', '2017-01-18 16:27:41');
INSERT INTO `simple_test_paper` VALUES ('762', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '1找到控制面板-卸载程序-查看已安装的更新；找到IE11安装程序,有IE11安装程序就可进行卸载。没有则不能卸载', '曲宗升', '10', '2017-01-18 16:31:42');
INSERT INTO `simple_test_paper` VALUES ('763', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1打开ie浏览器-工具-Internet选项-安全-本地与可信站点自定义级别中全部启用\r\n2打开ie浏览器-工具-兼容性视图设置-在兼容性视图中显示所有网站前打钩', '曲宗升', '10', '2017-01-18 16:31:42');
INSERT INTO `simple_test_paper` VALUES ('764', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '在开始运行处 使用appwiz.cpl  左侧找到卸载或更改程序，查看已经安装的更新。找到IE11 卸载 或者卸载WINDOWS组件可以把IE11卸载成功', '贾鑫龙', '10', '2017-01-18 16:39:13');
INSERT INTO `simple_test_paper` VALUES ('765', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '把IE安全级别降低 添加P.HAIER.COM为首页。添加信任站打开Internet选项，设置*.haier.com和*.haier.net设置为信任站点取消勾选“对该区域中所有站点要求服务器验证https”。切换到“隐私”选项卡并取消勾选“启用弹窗阻止程序”。切换到“内容”选项卡，并点击“清除SSL”状态。然后点击“确定”关闭此页面。', '贾鑫龙', '15', '2017-01-18 16:39:13');
INSERT INTO `simple_test_paper` VALUES ('766', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可以,在控制面板-程序-已安装的更新中找到ie9 10 11卸载', '赵伟贺', '10', '2017-01-18 16:40:19');
INSERT INTO `simple_test_paper` VALUES ('767', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '设置首页为海尔门户网站portal.haier.com 浏览器安全等级设置为最低,点击站点选项取消勾选 对该区域中所有站点要求服务器验证https,添加安全站点haier.net和haier.com', '赵伟贺', '15', '2017-01-18 16:40:19');
INSERT INTO `simple_test_paper` VALUES ('768', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', 'Windows7系统降级为IE8浏览器，需要打开“计算机”—“卸载或更改程序”—“查看已安装的更新在此页面中找到Internet Explorer9或10或11并卸载，卸载后需要重启。如果之前浏览器是一步一步安装到10或11版本，每次卸载后还需要卸载更低版本的IE直到降为IE8\r\n', '于旭', '15', '2017-01-18 17:01:58');
INSERT INTO `simple_test_paper` VALUES ('769', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '重启浏览器后再次打开Internet选项，设置p.haier.com为首页切换到安全选项卡，选择本地Intranet并将安全级别拉到最低选择“可信站点”并将安全级别降到最低，如果没有级别调整选项，使用默认级别按钮重置点击“站点”按钮，取消勾选“对该区域中所有站点要求服务器验证https”，并将*.haier.com*.haier.net添加切换到“隐私”选项卡并取消勾选“启用弹窗阻止程序切换到“内容”选项卡，并点击“清除SSL”状态然后点击“确定”关闭此页面', '于旭', '15', '2017-01-18 17:01:58');
INSERT INTO `simple_test_paper` VALUES ('770', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '可以，打开控制面板，程序与功能，查看已更新，卸载\r\nInternet Explorer 11与语言包，（卸载后检查是否有10跟9如有都卸载），然后重启。\r\n', '代志伟', '15', '2017-01-18 17:16:36');
INSERT INTO `simple_test_paper` VALUES ('771', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '添加信任网址，去掉启用弹出窗口阻止程序，将受信任的站点安全级别拉至最低，启用Activex控件', '代志伟', '10', '2017-01-18 17:16:36');
INSERT INTO `simple_test_paper` VALUES ('772', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', 'win7降级为IE8可行。\r\n需要打开“计算机”—“卸载或更改程序”—“查看已安装的更新”在此页面中找到Internet Explorer9或10或11并卸载，卸载后需要重启。\r\n如果之前浏览器是一步一步安装到10或11版本，每次卸载后还需要卸载更低版本的IE直到降为IE8\r\n', '丁世祥', '15', '2017-01-18 17:48:08');
INSERT INTO `simple_test_paper` VALUES ('773', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '升级浏览器到IE8，重置IE浏览器', '丁世祥', '5', '2017-01-18 17:48:08');
INSERT INTO `simple_test_paper` VALUES ('774', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '首先要切换管理员权限或者为用户添加管理员权限\r\n然后打开计算机-卸载或更改程序-查看已安装的更新。在此页面中找到IE11 并卸载后重启', '孟祥山', '10', '2017-01-18 17:51:42');
INSERT INTO `simple_test_paper` VALUES ('775', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '1为避免pe病毒更改IE的设置项需要先重置IE浏览器\r\n打开浏览器—工具—internet选项，找到高级选项卡，点击“重置勾选“删除个性化设置”，然后点重置。重置完成后重新打开浏览器\r\n2设置p.haier.com为首页切换到安全选项卡，选择本地Intranet并将安全级别拉到最低，选择“可信站点”并将安全级别降到最低，如果没有级别调整选项，使用默认级别按钮重置。点击“站点”按钮，取消勾选“对该区域中所有站点要求服务器验证https\r\n”，并将*.haier.com和*.haier.net添加。\r\n切换到“隐私”选项卡并取消勾选“启用弹窗阻止程序”\r\n切换到“内容”选项卡，并点击“清除SSL”状态\r\n3 为用户安装其他版本的浏览器 （有些系统IE打不开）', '孟祥山', '15', '2017-01-18 17:51:42');
INSERT INTO `simple_test_paper` VALUES ('776', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '打开系统安装更新，卸载ie11，重启后变为之前版本，如果不是ie8，继续重复卸载更新，直到变成ie8.', '李军辉', '15', '2017-01-18 18:12:47');
INSERT INTO `simple_test_paper` VALUES ('777', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '配置internet选项：取消启用关闭弹出窗口；信任站点加上haier内网，安全级别自定义，启用全部ActiveX控件。', '李军辉', '10', '2017-01-18 18:12:47');
INSERT INTO `simple_test_paper` VALUES ('778', '一台win7电脑安装了IE11，现在要降级为IE8，请问是否可行？如果可行请写出具体步骤；如果不可行请写出具体原因。', '答：可以降级为IE8.具体步骤为：1、打开控制面板，2、打开添加删除程序。3、打开已安装更新。4、找到相关IE更新并卸载。', '冯秉杰', '15', '2017-01-19 16:01:02');
INSERT INTO `simple_test_paper` VALUES ('779', '在海尔域内，一台计算机安装完官方镜像操作系统后，还要对浏览器做哪些操作？', '答：作如下操作。1、设置p.haier.com为主页。\r\n2、将本地intranet安全级别拉到最低，将可信站点的安全级别拉到最低，并取消“站点”选项里的“对该区域中所有站点要求服务器验证https”，并将*.haier.com和*.haier.com添加。\r\n3、取消勾选隐私选项卡中“启用弹窗组织程序”', '冯秉杰', '15', '2017-01-19 16:01:02');
